(55, 'Coronavirus en Argentina: confirmaron 264 víctimas fatales', NULL, 'De acuerdo con el parte vespertino del Ministerio de Salud son 5020 los infectados desde el inicio de la pandemia en el país.', '1', '2020-05-06 04:35:47', '2020-05-06 07:35:47', '55_5lpqb2qvZgI7CmTr.jpg', 'coronavirus-en-argentina-confirmaron-264-victimas-fatales', 0, NULL, 2, 0, '0', '<p style=\"margin-bottom: 20px; padding: 0px; border: 0px; text-size-adjust: 100%; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-weight: lighter; font-stretch: inherit; font-size: 17px; line-height: 27px; font-family: Merriweather, sans-serif; vertical-align: baseline; text-align: justify;\">En las últimas 24 horas, las víctimas fatales fueron 4, dos hombres y dos mujeres, todos mayores de 70 años. Los casos de contagio por \"contacto estrecho\" son los de mayor registro, con un 43,9 % del total.&nbsp;</p><div class=\"center source m_image\" style=\"margin: 20px auto; padding: 5px 10px; border: 0px; text-size-adjust: 100%; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 12px; line-height: inherit; font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; vertical-align: baseline; background: rgb(244, 244, 244); border-radius: 4px; text-align: center;\"><figure style=\"margin-bottom: 15px; padding: 0px; border: 0px; text-size-adjust: 100%; font: inherit; vertical-align: baseline;\"><img alt=\"prueba_corona_0.jpg\" src=\"https://www.radiodos.com.ar/content/bucket/3/78193.jpg\" class=\"source\" style=\"margin: 0px; padding: 5px 10px; text-size-adjust: 100%; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; vertical-align: baseline; border-radius: 4px; display: inline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; width: auto; max-width: 100%;\"></figure></div><p style=\"margin-bottom: 20px; padding: 0px; border: 0px; text-size-adjust: 100%; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-weight: lighter; font-stretch: inherit; font-size: 17px; line-height: 27px; font-family: Merriweather, sans-serif; vertical-align: baseline; text-align: justify;\">El informe vespertino del Ministerio de Salud precisó que, del total de contagios, &nbsp;2.207 (43,9%) son \"contactos estrechos\" de casos confirmados, 1.445 (28,8%) son casos de \"circulación comunitaria\" y 927 (18,5%) son \"importados\". Mientras que 441 casos se encuentran en investigación epidemiológica.</p><p style=\"margin-bottom: 20px; padding: 0px; border: 0px; text-size-adjust: 100%; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-weight: lighter; font-stretch: inherit; font-size: 17px; line-height: 27px; font-family: Merriweather, sans-serif; vertical-align: baseline; text-align: justify;\">&nbsp;<br style=\"margin: 0px; padding: 0px;\">Respecto de las víctimas mortales, se reportaron dos fallecimiento en el reporte matutino y dos en este segundo reporte diario. Se trató de dos hombres residentes en Córdoba, de 76 y 75 años; y de dos mujeres que vivían en ciudad y provincia de Buenos Aires, también de 76 y 75 años.&nbsp;</p><p style=\"margin-bottom: 20px; padding: 0px; border: 0px; text-size-adjust: 100%; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-weight: lighter; font-stretch: inherit; font-size: 17px; line-height: 27px; font-family: Merriweather, sans-serif; vertical-align: baseline; text-align: justify;\"><strong style=\"margin: 0px; padding: 0px; border: 0px; text-size-adjust: 100%; font-style: inherit; font-variant: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">Detalle por provincia (Nº de confirmados | Nº de acumulados)</strong></p><p style=\"margin-bottom: 20px; padding: 0px; border: 0px; text-size-adjust: 100%; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-weight: lighter; font-stretch: inherit; font-size: 17px; line-height: 27px; font-family: Merriweather, sans-serif; vertical-align: baseline; text-align: justify;\">Buenos Aires 58 | 1811</p><p style=\"margin-bottom: 20px; padding: 0px; border: 0px; text-size-adjust: 100%; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-weight: lighter; font-stretch: inherit; font-size: 17px; line-height: 27px; font-family: Merriweather, sans-serif; vertical-align: baseline; text-align: justify;\">Ciudad de Buenos Aires 57 | 1404</p><p style=\"margin-bottom: 20px; padding: 0px; border: 0px; text-size-adjust: 100%; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-weight: lighter; font-stretch: inherit; font-size: 17px; line-height: 27px; font-family: Merriweather, sans-serif; vertical-align: baseline; text-align: justify;\">Catamarca 0 | 0</p><p style=\"margin-bottom: 20px; padding: 0px; border: 0px; text-size-adjust: 100%; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-weight: lighter; font-stretch: inherit; font-size: 17px; line-height: 27px; font-family: Merriweather, sans-serif; vertical-align: baseline; text-align: justify;\">Chaco 11 | 358</p><p style=\"margin-bottom: 20px; padding: 0px; border: 0px; text-size-adjust: 100%; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-weight: lighter; font-stretch: inherit; font-size: 17px; line-height: 27px; font-family: Merriweather, sans-serif; vertical-align: baseline; text-align: justify;\">Chubut 0 | 4</p><p style=\"margin-bottom: 20px; padding: 0px; border: 0px; text-size-adjust: 100%; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-weight: lighter; font-stretch: inherit; font-size: 17px; line-height: 27px; font-family: Merriweather, sans-serif; vertical-align: baseline; text-align: justify;\">Córdoba 1 | 311</p><p st