(56, 'Se creó un subsidio flexible para clubes de todo el país', NULL, 'En el marco de la emergencia sanitaria por el COVID-19, el Ministerio de Turismo y Deportes de la Nación, a través de su Secretaría de Deportes, anunció el Programa de Apoyo en la Emergencia para Clubes', '1', '2020-05-06 05:10:31', '2020-05-06 08:10:31', '56_CS21qNVrkR6FwpHD.jpg', 'se-creo-un-subsidio-flexible-para-clubes-de-todo-el-pais', 0, NULL, 2, 0, '0', '<p style=\"margin-bottom: 9px; padding: 0px; color: rgb(91, 91, 91); font-family: Ubuntu, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 16px; text-align: justify;\">Este apoyo, que se articulará con los gobiernos provinciales y municipales, podrá ser utilizado para campañas de prevención conforme a las medidas y pautas sanitarias que se han establecido desde el Gobierno nacional; capacitaciones para trabajadoras y trabajadores, socios y dirigentes; servicios e infraestructura, entre otros.&nbsp;</p><p style=\"margin-bottom: 9px; padding: 0px; color: rgb(91, 91, 91); font-family: Ubuntu, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 16px; text-align: justify;\">Al respecto, el ministro de Turismo y Deportes, Matías Lammens, expresó: “Cuando asumimos desde el Gobierno Nacional nos comprometimos a poner a los clubes en el centro de nuestra política deportiva, porque estamos convencidos de que son una herramienta fundamental de inclusión y oportunidades en todas las regiones del país. Ante esta situación excepcional de crisis, vamos a cuidarlos con herramientas concretas de apoyo que contemplen su delicada situación”.</p><p style=\"margin-bottom: 9px; padding: 0px; color: rgb(91, 91, 91); font-family: Ubuntu, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 16px; text-align: justify;\">Por su parte, la secretaria de Deportes, Inés Arrondo, subrayó: “Es muy importante que podamos anunciar hoy esta medida, que al ser flexible, les permitirá a los clubes destinar el subsidio fijando cada uno sus prioridades. Es un paso más que damos en el trabajo que venimos realizando con clubes de toda la Argentina y en conjunto con las autoridades provinciales y municipales, que ha sido una de las principales instrucciones que nos ha dado nuestro Presidente”.</p><p style=\"margin-bottom: 9px; padding: 0px; color: rgb(91, 91, 91); font-family: Ubuntu, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 16px; text-align: justify;\">Para inscribirse hay plazo hasta el 22 de mayo y deben ingresar en la página de Clubes Argentinos (clubesargentinos.deportes.gob.ar), con la siguiente consigna: los clubes ya inscriptos, deben ingresar con clave y contraseña para enviar nota de solicitud; los clubes no inscriptos, deberán hacerlo presentando la documentación solicitada y luego realizar el trámite.</p><p style=\"margin-bottom: 9px; padding: 0px; color: rgb(91, 91, 91); font-family: Ubuntu, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 16px; text-align: justify;\">Este beneficio se suma a otras medidas anunciadas por el Gobierno nacional, como la Resolución 173/2020 que establece que los clubes de barrio y sociedades de fomento no sufrirán el corte de los servicios de energía eléctrica, gas por redes y agua corriente, telefonía fija e internet y TV por cable, por vínculo radioeléctrico o satelital, en caso de mora o falta de pago de hasta tres facturas consecutivas o alternas, con vencimientos desde el 1º de marzo de 2020.</p><p style=\"margin-bottom: 9px; padding: 0px; color: rgb(91, 91, 91); font-family: Ubuntu, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 16px; text-align: justify;\">También se incluyó a los clubes y federaciones deportivas en el Programa de Asistencia de Emergencia al Trabajo y la Producción. Contempla la postergación o reducción de hasta el 95% del pago de las contribuciones patronales al Sistema Integrado Previsional Argentino, y el apoyo del Estado para pagar hasta el 50% de los salarios, entre otros.</p>', 0, 'subsidio'),
(84, 'Se estrelló un avión sanitario cerca del aeropuerto de Esquel', 'Se estrelló un avión sanitario cerca del aeropuerto de Esquel', 'El accidente ocurrió cerca del aeropuerto Crédito: https://www.eldiariodemadryn.com/. Comentar (0). Me gusta. Me gusta. Compartir. E-mail. Twitter. Facebook. WhatsApp. Guardar. 6 de mayo de 2020 • 00:34. Un avión sanitario se estrelló esta noche en el&nbsp;...', '1', '2020-05-06 09:07:05', '2020-05-06 09:07:05', 'se-estrello-un-avion-sanitario-cerca-del-aeropuerto-de-esquel.jpg', 'se-estrello-un-avion-sanitario-cerca-del-aeropuerto-de-esquel', 0, NULL, 0, 2, NULL, 'El accidente ocurrió cerca del aeropuerto Crédito: https://www.eldiariodemadryn.com/. Comentar (0). Me gusta. Me gusta. Compartir. E-mail. Twitter. Facebook. WhatsApp. Guardar. 6 de mayo de 2020 • 00:34. Un avión sanitario se estrelló esta noche en el&nbsp;...Un avión sanitario se estrelló este martes en la pista del aeropuerto de Esquel, en Chubut?, mientras hacía maniobras de aterrizaje. Viajaban cuatro personas, de las cuales sobrevivieron dos, que fueron trasladadas al Hospital Zonal de la ciudad.La aeronave se estrelló en las inmediaciones del aeropuerto Internacional Brigadier Gral. Antonio Parodi. El vuelo sanitario iba a buscar a una niña de 3 años con una patología cardíaca.A última hora de la noche del martes, un avión sanitario se estrelló llegando al aeropuerto de la ciudad de Esquel. La nave arribaba con cuatro tripulantes, dos de ellos habrían sobrevivido. La aeronave que venía desde Santa Fe para buscar a un paciente&nbsp;...Un avión con 4 tripulantes se estrelló la noche de este martes cerca del aeropuerto de Esquel, en la provincia argentina de Chubut. En la aeronave viajaban cuatro personas, de las cuales sobrevivieron dos, siendo trasladadas al hospital local.Un jet que iba a buscar una paciente perdió el control y se precipitó a tierra segundos antes de aterrizar.Ocurrió a última hora de este martes. Venía de Santa Fe y estaba destinado a trasladar una niña en estado delicado.El vuelo había salido de Santa Fe para buscar a una nena que debía ser derivada de emergencia.Un avión sanitario se estrelló en la noche del martes en las proximidades del Aeropuerto de Esquel, en Chubut. A bordo viajaban cuatro tripulantes y rápidamente se hicieron presentes efectivos policiales y los bomberos. Según precisiones de El Chubut,&nbsp;...Un avión que iba de San Fernando rumbo a Chubut en una misión de emergencia sanitaria se estrelló en Esquel cuando el piloto perdió el control de la nave al aterrizar.', 0, 'Tendencia News'),
