(86, 'Alerta coronavirus: importante advertencia del Banco Central en relación a los cajeros automáticos', 'Alerta coronavirus: importante advertencia del Banco Central en relación a los cajeros automáticos', 'La entidad lanzó la información debido al gran agite económico de estos días en el país.', '1', '2020-05-06 09:07:05', '2020-05-06 09:07:05', 'alerta-coronavirus-importante-advertencia-del-banco-central-en-relacion-a-los-cajeros-automaticos.jpg', 'alerta-coronavirus-importante-advertencia-del-banco-central-en-relacion-a-los-cajeros-automaticos', 0, NULL, 0, 2, NULL, 'La entidad lanzó la información debido al gran agite económico de estos días en el país.El Banco Central de la República Argentina recordó que se puede retirar esta cantidad de efectivo. Además, que las compañías no deben realizar un cobro por utilizarlo.', 0, 'Tendencia News'),
(87, 'La autocrítica de Nazarena Vélez: de qué se arrepiente de su relación con Daniel Agostini', 'La autocrítica de Nazarena Vélez: de qué se arrepiente de su relación con Daniel Agostini', 'Nazarena Vélez habló en una entrevista acerca de su familia y recordó parte de su pasado. Ante esto reconoció que se arrepiente de algo en particular de su relación con Daniel Agostini, papá de su segundo hijo, Gonzalo &#39;Chyno&#39; Agostini.', '1', '2020-05-06 09:07:06', '2020-05-06 09:07:06', 'la-autocritica-de-nazarena-velez-de-que-se-arrepiente-de-su-relacion-con-daniel-agostini.jpg', 'la-autocritica-de-nazarena-velez-de-que-se-arrepiente-de-su-relacion-con-daniel-agostini', 0, NULL, 0, 2, NULL, 'Nazarena Vélez habló en una entrevista acerca de su familia y recordó parte de su pasado. Ante esto reconoció que se arrepiente de algo en particular de su relación con Daniel Agostini, papá de su segundo hijo, Gonzalo &#39;Chyno&#39; Agostini.La actriz, que estuvo casada con el cantante durante ocho años, hizo una autocrítica pública de aquella época de su vida.En cualquier centro comercial, o en las salas de juegos infantiles, llaman la atención esas máquinas preciosas, que aglutinan peluches o juguetes en su interior. Todos desean desafiar esa complejidad para atrapar un premio, pero la mayoría cae en el&nbsp;...Actualmente, Nazarena Vélez disfruta de un día a día sin sobresaltos. Atrás quedaron las peleas mediáticas y los cruces en televisión. En plena cuarentena obligatoria por coronavirus, aislada con su familia en su casa e intentando aprovechar cada&nbsp;...La actriz habló de su relación con el padre de uno de sus hijos.Nazarena Vélez tuvo hace algunos años una complicada relación con su expareja Daniel Agostini, con quien tuvo a su hijo Gonzalo. Incluso, la exvedette tuvo fuertes cruces mediáticos con el cantante de música tropical. Durante las últimas horas, en plena&nbsp;...', 0, 'Tendencia News'),
(88, 'Quién es la pareja futbolera del Fideo', 'Quién es la pareja futbolera del Fideo', 'Jorgelina Cardoso dio vueltas por el mundo por las revelaciones que hizo sobre la carrera de su marido, Angel Di María. &quot;Le dije que lo compren de cualquier país menos de Inglaterra y al año caímos en Manchester, una mierda”, expresó en Canal 13.', '1', '2020-05-06 09:07:06', '2020-05-06 09:07:06', 'quien-es-la-pareja-futbolera-del-fideo.jpg', 'quien-es-la-pareja-futbolera-del-fideo', 0, NULL, 0, 2, NULL, 'Jorgelina Cardoso dio vueltas por el mundo por las revelaciones que hizo sobre la carrera de su marido, Angel Di María. &quot;Le dije que lo compren de cualquier país menos de Inglaterra y al año caímos en Manchester, una mierda”, expresó en Canal 13.(VIDEO) Jorgelina Cardoso, contó en una entrevista como vivieron aquel fichaje y las críticas que recibió su marido por parte de los aficionados del Real Madrid.Este martes 5 fue una mañana &quot;angelada&quot; en la pantalla del Trece. Es que el programa de Ángel de Brito, Los Ángeles de la Mañana, con sus &quot;angelitas&quot;, tuvieron a la esposa de Ángel Di María como invitada, dando una nota por videollamada desde París,&nbsp;...Jorgelina Cardoso, esposa de Ángel Di María, recordó hoy la controvertida salida del volante rosarino de Real Madrid de España con destino a Manchester United de Inglaterra que desató la furia de los hinchas españoles en el año 2014. &quot;Ángel un día vino&nbsp;...Jorgelina, esposa del jugador argentino contó el difícil momento que vivieron en Inglaterra. | Premier League | futbolred.com.En pareja desde hace más de 10 años con Fideo, mamá de Mía y Pía, contó intimidades de la relación y de cómo acompaña (y defiende) a su compañero ante las críticas. 5 de mayo de 2020. Compartir en FacebookCompartir; Compartir en TwitterTweet.Jorgelina Cardoso relató lo sucedido cuando el futbolista dejó España para jugar en Inglaterra.La esposa del crack rosarino, Jorgelina Cardoso, contó cómo Angelito transita la cuarentena en Francia y destacó su condición de asador.Jorgelina Cardoso, pareja de Ángel Di María, reconoció en una televisión de Argentina que el motivo por el que se fueron al Manchester United por puramente económica. - BeSoccer.Jorgelina reveló cómo tomó la decisión de Angelito de mudarse para vestir la camiseta del United. También explicó su postura cuando los merengues lo trataron de &quot;pesetero&quot;.', 0, 'Tendencia News'),
(89, 'Tom Cruise protagonizará la primera película rodada en el espacio con Elon Musk y la NASA', 'Tom Cruise protagonizará la primera película rodada en el espacio con Elon Musk y la NASA', 'La colaboración entre Cruise y Musk tiene como objetivo grabar una cinta de acción que aún no cuenta con el apoyo de ningún estudio cinematográfico.', '1', '2020-05-06 09:07:50', '2020-05-06 09:07:50', 'tom-cruise-protagonizara-la-primera-pelicula-rodada-en-el-espacio-con-elon-musk-y-la-nasa.jpg', 'tom-cruise-protagonizara-la-primera-pelicula-rodada-en-el-espacio-con-elon-musk-y-la-nasa', 0, NULL, 0, 2, NULL, 'La colaboración entre Cruise y Musk tiene como objetivo grabar una cinta de acción que aún no cuenta con el apoyo de ningún estudio cinematográfico.&quot;¡La NASA está entusiasmada de trabajar con @TomCruise en una película a bordo de @Space_Station!&quot;, escribió en Twitter el administrador de la NASA Jim Bridenstine.LOS ANGELES (Reuters) - La estrella de cine Tom Cruise está trabajando para filmar una película en el espacio exterior, dijo el martes la NASA. “¡La NASA está entusiasmada de trabajar con @TomCruise en una película a bordo de @Space_Station!El jefe de la NASA confirmó el martes que la agencia espacial está trabajando con el actor Tom Cruise para hacer una película en la Estación Espacial Internacional.Tom Cruise ha buscado la ayuda de SpaceX y la NASA para su nueva &#39;misión imposible&#39;, grabar la primera película de acción en el espacio.El filme, que no será parte de la franquicia de &quot;Misión Imposible&quot;, se enmarcará en el género de acción y aventuras. El proyecto se encuentra en las primeras etapas de desarrollo, por el momento, no hay ningún estudio asociado a la producción.El proyecto está en una etapa inicial y hasta ahora no cuenta con apoyo de ningún estudio cinematográfico.El actor estadounidense ya estaría satisfecho con las misiones imposibles en la Tierra, pues pasará a grabar en la Estación Espacial Internacional (ISS por su sigla en inglés) como parte de un proyecto del organismo norteamericano para atraer nuevos&nbsp;...La agencia espacial confirmó que trabajará junto al actor para grabar el primer filme de la historia en el espacio, usando la Estación internacional como set de rodaje.¡QUÉ! Según reseña el sitio de entretenimiento Deadline, el actor estadounidense Tom Cruise, la NASA y Elon Musk, fundador de Tesla y la compañía aeroespacial SpaceX, están trabajando para la primera película en el espacio.', 0, 'Tendencia News'),
(90, '“X Æ A-12”: ¿por qué el hijo de Elon Musk se llama así?', '“X Æ A-12”: ¿por qué el hijo de Elon Musk se llama así?', 'Musk es conocido por sus alardes de extravagancia, casi al mismo nivel mediático que su actividad empresarial.', '1', '2020-05-06 09:07:50', '2020-05-06 09:07:50', 'x-ae-a-12-por-que-el-hijo-de-elon-musk-se-llama-asi.jpg', 'x-ae-a-12-por-que-el-hijo-de-elon-musk-se-llama-asi', 0, NULL, 0, 2, NULL, 'Musk es conocido por sus alardes de extravagancia, casi al mismo nivel mediático que su actividad empresarial.El nombre X Æ A-12 se volvió tendencia en Internet e internautas se cuestionan su significado.El CEO de Tesla y la cantante celebran la llegada de su primer hijo, a quien han decidido nombrar de una manera muy particular: X Æ A-12.Elon Musk y la cantante Grimes se convirtieron en padres de un niño el lunes. El fundador de Tesla y SpaceX hizo uso de su cuenta de Twitter para comunicar el nacimiento. Horas después, a través de la misma red social, el empresario dio a conocer el&nbsp;...Desde que Grimes anunció su embarazo en Instagram, las especulaciones sobre cómo sería el hijo entre la cantante y el magnate de la tecnología, Elon Musk no se hicieron esperar, pues los dos tienen fama de excéntricos. Y si aún dudábamos cuán&nbsp;...Nadie pone en duda la creatividad que tiene Elon Musk, emprendedor, fundador de Tesla, SpaceX y uno de los hombre más ricos del mundo. Sin embargo, puede que se haya...El hijo de Elon Musk y Grimesse se llama X Æ A-12. La cantante dio a luz a su bebé el pasado 4 de mayo, así lo informó el empresario.Elon Musk y la cantante Grimes tuvieron a su primer hijo pero le pusieron un nombre muy raro.El empresario Elon Musk anunció en Twitter el nacimiento de su hijo con la artista de música electrónica Grimes, llamado “X Æ A-12 Musk”, según el propio padre. En respuesta, no se hicieron esperar los tuits en tono de broma de parte de usuarios de redes&nbsp;...Elon Musk y Grimes se convirtieron en padres y eligieron un nombre bastante curioso para su bebé: X Æ A-12. Los usuarios en redes sociales lo convirtieron en tendencia y realizaron divertidos memes.', 0, 'Tendencia News'),
(91, 'No se repetirá en mayo el plan de 9 cuotas para pagar la tarjeta de crédito', 'No se repetirá en mayo el plan de 9 cuotas para pagar la tarjeta de crédito', 'La ayuda que se otorgó en abril fue por única vez. Sin embargo, el Banco Central confirmó que se mantendrá el tope de la tasa, que es del 43% anual.', '1', '2020-05-06 09:07:51', '2020-05-06 09:07:51', 'no-se-repetira-en-mayo-el-plan-de-9-cuotas-para-pagar-la-tarjeta-de-credito.jpg', 'no-se-repetira-en-mayo-el-plan-de-9-cuotas-para-pagar-la-tarjeta-de-credito', 0, NULL, 0, 2, NULL, 'La ayuda que se otorgó en abril fue por única vez. Sin embargo, el Banco Central confirmó que se mantendrá el tope de la tasa, que es del 43% anual.La opción para pagar el total en nueve cuotas fue solo para abril. Sí mantendrán la tasa con un techo.Desde el Banco Central informaron que no habrá refinanciación de los vencimientos de las tarjetas de crédito de mayo. La media incluyó solo a abril.En abril, ya en plena pandemia y con millones de argentinos sin trabajar, cobrar o facturar, los vencimientos a pagar se convirtieron en una misión imposible. Como ayuda, se anunció la prorrogación de los vencimientos de las tarjetas de crédito a fin de mes&nbsp;...La ayuda de abril fue por única vez. Desde el Banco Central confirmaron que se mantendrá el techo para la tasa. 5 de mayo de 2020. Ya no habrá cuotas ni período de gracia. Con la cuarentena a pleno, los vencimientos de las tarjetas de crédito no se&nbsp;...La decisión fue confirmada por el Banco Central y los usuarios no contarán con esta opción especial para pagar sus gastos.Es por la aplicación de los créditos a tasa cero para monotributistas y autónomos.Durante el mes de abril, los usuarios de tarjetas de crédito que no pudieron pagar su saldo contaron con la opción de refinanciar ese monto en nueve cuotas y con un período de tres meses de gracia. Sin embargo, a partir de los vencimientos de mayo esa&nbsp;...Para pagar los resúmenes vencidos durante abril, los usuarios tuvieron la opción de refinanciar en 9 cuotas y con tres meses de gracia. Esa opción no estará disponible este mes.Ya no habrá cuotas ni período de gracia. Con la cuarentena a pleno, los vencimientos de las tarjetas de crédito no se postergarán como sucedió en marzo y en abril y el plan que el Banco Central le había impuesto a los bancos para que le ofrecieran a los&nbsp;...', 0, 'Tendencia News'),
(92, 'Halo 2 Anniversary se lanzará el 12 de mayo en PC', 'Halo 2 Anniversary se lanzará el 12 de mayo en PC', 'Halo sigue llegando lentamente a Steam, esta vez es el caso de Halo 2 Anniversary, el remaster de uno de los juegos más grandes de Microsoft que pronto...', '1', '2020-05-06 09:07:51', '2020-05-06 09:07:51', 'halo-2-anniversary-se-lanzara-el-12-de-mayo-en-pc.jpg', 'halo-2-anniversary-se-lanzara-el-12-de-mayo-en-pc', 0, NULL, 0, 2, NULL, 'Halo sigue llegando lentamente a Steam, esta vez es el caso de Halo 2 Anniversary, el remaster de uno de los juegos más grandes de Microsoft que pronto...La Xbox, pasando por su consola original, hasta la Xbox 360 y Xbox One, tuvo una enorme cantidad de videojuegos y sagas exclusivas que significaron algo para el mundo de los videojuegos. Algunos ejemplos son Gears of War, Banjo &amp; Kazooie, y Dead&nbsp;...Saber Interactive y Microsoft anuncian la llegada de Halo 2: Anniversary a la Master Chief Collection de PC para la próxima semana.La segunda parte de la trilogía original de Master Chief estará disponible en Steam y Xbox Game Pass a partir de la semana que viene.Microsoft anunció que Halo 2: Anniversary, el remake del FPS de 2004 y la siguiente parte de Halo: The Master Chief Collection, llegará a PC el 12 de mayo a través de Steam y la Microsoft Store.A través de redes sociales, se anunció la fecha de lanzamiento de Halo 2: Anniversary en PC como parte de The Master Chief Collection.Halo 2 Anniversary fue lanzado originalmente en 2014 como parte de la Halo: Master Chief Collection en Xbox One.El FPS forma parte de la Master Chief Collection.Después de haber estado adelantando la llegada de este título durante los últimos días, Microsoft finalmente ha decidido revelarnos la fecha de lanzamiento para.Microsoft ha confirmado que el juego Halo 2: Anniversary estará llegando a PC con Windows 10 el día 12 de mayo, como parte del contenido de Halo: The Master Chief Collection, según se anunció hoy la compañía.', 0, 'Tendencia News'),
(93, 'Habrá espectacular lluvia de estrellas a principios de mayo', 'Habrá espectacular lluvia de estrellas a principios de mayo', 'CIUDAD DE MÉXICO. La lluvia de estrellas &#39;Eta Acuáridas&#39; se verá en su máxima expresión el próximo 7 de mayo debido al paso de la Tierra cerca de los fragmentos del Cometa Halley, los cuales se encuentran en la constelación de acuario. Cancún lanza&nbsp;...', '1', '2020-05-06 09:07:51', '2020-05-06 09:07:51', 'habra-espectacular-lluvia-de-estrellas-a-principios-de-mayo.jpg', 'habra-espectacular-lluvia-de-estrellas-a-principios-de-mayo', 0, NULL, 0, 2, NULL, 'CIUDAD DE MÉXICO. La lluvia de estrellas &#39;Eta Acuáridas&#39; se verá en su máxima expresión el próximo 7 de mayo debido al paso de la Tierra cerca de los fragmentos del Cometa Halley, los cuales se encuentran en la constelación de acuario. Cancún lanza&nbsp;...La NASA informó que el fenómeno podrá ser visto en todo su esplendor desde el hemisferio sur. La última aparición cercana a la Tierra ocurrió en 1986.Son meteoros Eta Acuáridas, que se desprendieron del cometa Halley. Esta semana alcanza su esplendor en el hemisferio sur.El fenómeno, que se conoce como Eta Acuáridas, escribe líneas brillantes a través del cielo mientras sus deja desechos a su paso. Se puede apreciar mejor desde el hemisferio sur y se deberá mirar al noreste.La lluvia de meteoros Eta Acuáridas alcanzará su máximo esplendor esta semana, como cada inicio de mayo, y particularmente durante este 2020 las condiciones son perfectas para apreciar el espectáculo.A lo largo de la historia humana, este fenómeno fue atribuido a un sin número de presagios, buenos o malos augurios o simplemente la expresión de los dioses.Se trata de los meteoros Eta Acuáridas, que se desprendieron del cometa Halley. El Observatorio Astronómico de Córdoba informó que la mejor hora para observar meteoros es después de las 4 de la madrugada.CIUDAD DE MÉXICO.- Como cada año, la lluvia de estrellas &quot;Eta Acuáridas&quot; se percibirá en su máxima expresión este 7 de mayo, producto del paso de la Tierra cerca de los fragmentos del Cometa Halley, ubicados en la constelación de Acuario.Por Nicholas St. Fleur ?. Durante todo el año, mientras la Tierra gira alrededor del sol, pasa a través de corrientes de desechos cósmicos - rastros de rocas y hielo dejados por los cometas. Cuando la Tierra los atraviesa, los trozos de escombros, que pueden&nbsp;...Aquí te decimos qué es la &quot;Luna llena da flores&quot; y en dónde podrás ver la lluvia de meteoritos Eta Acuáridas.', 0, 'Tendencia News'),
(94, 'Germán Paoloski y Sabrina Garciarena mostraron las primeras fotos de Mía, a segundos de nacer: &quot;Bienvenida&quot;', 'Germán Paoloski y Sabrina Garciarena mostraron las primeras fotos de Mía, a segundos de nacer: &quot;Bienvenida&quot;', 'Este martes no fue un día cualquiera para Germán Paoloski, quien debió dejar la conducción de El Noticiero de la Gente en manos de sus compañeros por una razón muy especial: nació su hija, Mía.', '1', '2020-05-06 09:07:52', '2020-05-06 09:07:52', 'german-paoloski-y-sabrina-garciarena-mostraron-las-primeras-fotos-de-mia-a-segundos-de-nacer-quotbienvenidaquot.jpg', 'german-paoloski-y-sabrina-garciarena-mostraron-las-primeras-fotos-de-mia-a-segundos-de-nacer-quotbienvenidaquot', 0, NULL, 0, 2, NULL, 'Este martes no fue un día cualquiera para Germán Paoloski, quien debió dejar la conducción de El Noticiero de la Gente en manos de sus compañeros por una razón muy especial: nació su hija, Mía.El conductor anunció la feliz noticia a través de sus compañeros de “El noticiero de la gente”. Es la tercera hija de la pareja, que ya tiene a León y Beltrán. 5 de mayo de 2020. Compartir en FacebookCompartir; Compartir en TwitterTweet. Play. Germán&nbsp;...&quot;Nació Mía, está divina&quot;, dijo el conductor de el &quot;Noticiero de la gente&quot;.El conductor y la actriz se convirtieron en padres por tercera vez y tanto la mamá como la beba se encuentran en buen estado de salud.La tan esperada Mía por fin llegó. Se trata de la primera hija mujer de Germán Paoloski y Sabrina Garciarena. Los dos estaban muy ansiosos.La actriz mostró el momento en que daba a luz a la pequeña, la tercera de sus hijos.El periodista y la actriz agrandaron la familia: nació Mía, su tercera hija juntos. Comentar (0). Me gusta. Me gusta. Compartir. E-mail. Twitter. Facebook. WhatsApp. Guardar. 5 de mayo de 2020 • 14:33. Sabrina Garciarena y Germán Paoloski fueron padres por&nbsp;...Nuestro colega y conductor de El Noticiero de la Gente recibió a su pequeña hija Mía este martes y hace instantes publicó al primera foto de la pequeña junto a su madre, Sabrina Garciarena. Compartir &middot; Tweet. Con un mensaje más que tierno, el periodista&nbsp;...El conductor y su pareja, la actriz Sabrina Garciarena, se convirtieron en padres por tercera vez.En el mediodía de este 5 de mayo de 2020 nació Mía, la tercera hija de Germán Paoloski (45) y Sabrina Garciarena (36). El conductor, que junto a su pareja es padre de León y Beltrán, de tres y seis años respectivamente, brindó la noticia a través de un&nbsp;...', 0, 'Tendencia News'),
(95, 'En Esquel hubo marcha contra la cuarentena', 'En Esquel hubo marcha contra la cuarentena', 'Con tapabocas y poco distanciamiento, decenas de manifestantes hicieron oír su demanda en las calles de la ciudad gobernada por el radical Sergio Ongarato.', '1', '2020-05-06 09:07:52', '2020-05-06 09:07:52', 'en-esquel-hubo-marcha-contra-la-cuarentena.jpg', 'en-esquel-hubo-marcha-contra-la-cuarentena', 0, NULL, 0, 2, NULL, 'Con tapabocas y poco distanciamiento, decenas de manifestantes hicieron oír su demanda en las calles de la ciudad gobernada por el radical Sergio Ongarato.Los vecinos de Esquel marcharon autoconvocados por las calles Avenida Alvear y Fontana a las 17 horas, para expresar la disconformidad por las medidas adoptadas por parte del gobierno Nacional, Provincial y Municipal. Concurrieron con tapabocas&nbsp;...Un importante número de vecinos salieron a la calle ayer a la tarde en Esquel para realizar la habitual marcha de los días 4 de cada mes en contra de la megaminería metalífera.A pesar de regir en todo el país el DNU que obliga respetar la cuarentena e impide la aglomeración de personas, este lunes por la tarde, un grupo autoconvocado, marchó por las calles de Esquel, con barbijos y pancartas. La manifestación tuvo varios&nbsp;...', 0, 'Tendencia News'),
(96, 'Un feroz incendio azota un rascacielos en Emiratos Árabes Unidos', 'Un feroz incendio azota un rascacielos en Emiratos Árabes Unidos', 'Las llamas ascendieron rápidamente por los costados del edificio, tal como ocurrió en otros incendios recientes que involucran revestimientos inflamables.', '1', '2020-05-06 09:07:52', '2020-05-06 09:07:52', 'un-feroz-incendio-azota-un-rascacielos-en-emiratos-arabes-unidos.jpg', 'un-feroz-incendio-azota-un-rascacielos-en-emiratos-arabes-unidos', 0, NULL, 0, 2, NULL, 'Las llamas ascendieron rápidamente por los costados del edificio, tal como ocurrió en otros incendios recientes que involucran revestimientos inflamables.Los bomberos lograron evacuar a las personas que se encontraban en el interior del lugar.Las llamas han consumido los costados de la Torre Abbco, en el emirato de Sharjah de Emiratos Árabes Unidos (EAU). El edificio de 48 pisos y 190 metros de alto es uno...Un voraz incendio destruyó un rascacielos de la ciudad de Sharjah en Emiratos Árabes Unidos. Los vecinos fueron evacuados y están fuera de peligro.El Abbco Tower es uno de los rascacielos más importantes de Sharjah, ciudad satélite para los trabajadores de Dubái.Un gran incendio estalló este martes 5 de mayo en uno de los rascacielos del distrito de Al Nahda de la ciudad de Sharjah, en Emiratos Árabes Unidos (EAU) sin que se produjeran víctimas, pese a la masiva destrucción. De acuerdo con el diario Khaleej&nbsp;...Al menos siete personas resultaron heridas al incendiarse un edificio residencial de 50 pisos en Sharjan, ciudad ubicada al este de Emiratos Árabes Unidos. Según informaciones difundidas en medios internacionales, el gobierno del emirato indicó que los&nbsp;...Ocurrió en la Abcco Tower en el emirato de Sharjah, situada en el golfo Pérsico. Afortunadamente no se reportaron víctimas fatales en el incendio.Abu Dabi.- Un incendio masivo se registró hoy en el edificio habitacional Sharjah, en el área de Al Nahda, localidad vecina de Dubai, Emiratos Árabes Unidos, y hasta el momento no hay reportes de víctimas mortales. De acuerdo con información oficial,&nbsp;...Según las agencias de bienes raíces de aquel país, señala que había una alta demanda por ocupar este edificio.', 0, 'Tendencia News'),
(97, 'A ocho años del final del romance entre el Barcelona y Pep Guardiola en el Camp Nou', 'A ocho años del final del romance entre el Barcelona y Pep Guardiola en el Camp Nou', 'Un día como hoy, el entrenador español dirigió su último partido en casa blaugrana. Recuerda los mejores momentos de &#39;Pep&#39; con los culés y su emotiva despedida en el Camp Nou.', '1', '2020-05-06 09:07:52', '2020-05-06 09:07:52', 'a-ocho-anos-del-final-del-romance-entre-el-barcelona-y-pep-guardiola-en-el-camp-nou.jpg', 'a-ocho-anos-del-final-del-romance-entre-el-barcelona-y-pep-guardiola-en-el-camp-nou', 0, NULL, 0, 2, NULL, 'Un día como hoy, el entrenador español dirigió su último partido en casa blaugrana. Recuerda los mejores momentos de &#39;Pep&#39; con los culés y su emotiva despedida en el Camp Nou.Pep Guardiola marcó un antes y un después en la historia del Barcelona, el técnico consiguió un lugar en el cuadro de honor del club a lado de figuras como Johan Cruyff y logró hacer del equipo el mejor del mundo, sus 14 títulos en cuatro temporadas&nbsp;...Se convirtió en un día negro para los aficionados blaugrana, uno que muchos quisieran que nunca hubiera sucedido porque terminó una de las mejores etapas en la historia del equipo. Lamentablemente muchos lo recuerdan con dolor porque se cumplen&nbsp;...Ciudad de México.- ¡Cómo te extrañan! En el 2012 el mundo del futbol español y mundial veían el fin de una era dorada en el club Fc Barcelona, ya que era la última temporada de Pep Guardiola al frente del club, del cual hizo el mejor equipo en la historia&nbsp;...&quot;No es fácil dejar a estos jugadores, pero sentí que tenía que dar un paso al lado&quot;, fueron las palabras de Pep Guardiola hace 8 años cuando se despidió del FC Barcelona en el Camp Nou Hace 8...En una reciente entrevista con La &quot;Gazzetta dello Sport&quot;, el sueco Zlatan Ibrahimovic volvió a remover su pasado oscuro en el FC Barcelona, en donde jugó sólo una temporada, la 2009-10, y la pasó bastante mal, sobre todo con el entrenador, Pep&nbsp;...', 0, 'Tendencia News'),
(98, 'Ciudadano malayo venció al coronavirus en el Houssay: Así lo despidieron los médicos de Vicente López', 'Ciudadano malayo venció al coronavirus en el Houssay: Así lo despidieron los médicos de Vicente López', 'Después de estar 45 días entubado, un paciente malayo venció al virus y fue dado de alta. Fue tratado en el Hospital Houssay de Vicente López. El hombre hoy fue dado de alta y los trabajadores del nosocomio le dieron una cálida despedida: Médicos,&nbsp;...', '1', '2020-05-06 09:07:53', '2020-05-06 09:07:53', 'ciudadano-malayo-vencio-al-coronavirus-en-el-houssay-asi-lo-despidieron-los-medicos-de-vicente-lopez.jpg', 'ciudadano-malayo-vencio-al-coronavirus-en-el-houssay-asi-lo-despidieron-los-medicos-de-vicente-lopez', 0, NULL, 0, 2, NULL, 'Después de estar 45 días entubado, un paciente malayo venció al virus y fue dado de alta. Fue tratado en el Hospital Houssay de Vicente López. El hombre hoy fue dado de alta y los trabajadores del nosocomio le dieron una cálida despedida: Médicos,&nbsp;...Se trata de Zaidy Bin Abdul Rahmn que estuvo internado en el Hospital Houssay.El personal del hospital municipal de Vicente López, donde estuvo internado, lo despidió cantándole “Resistiré”. Momentos de mucha emoción se vivieron en el Hospital Houssay de Vicente López cuando un paciente con un cuadro grave de covid-19 logró&nbsp;...En el Hospital Houssay de Vicente López, personal médico despidió de manera creativa a un hombre recuperado de la enfermedad.', 0, 'Tendencia News'),
(99, 'Se normaliza la recolección de residuos tras entrega de nueva indumentaria al personal', 'Se normaliza la recolección de residuos tras entrega de nueva indumentaria al personal', 'El servicio de recolección de residuos tendía a normalizarse ayer luego de que el municipio de Esquel hiciera entrega al personal del sector de la ropa de abrigo comprometida.', '1', '2020-05-06 09:07:53', '2020-05-06 09:07:53', 'se-normaliza-la-recoleccion-de-residuos-tras-entrega-de-nueva-indumentaria-al-personal.jpg', 'se-normaliza-la-recoleccion-de-residuos-tras-entrega-de-nueva-indumentaria-al-personal', 0, NULL, 0, 2, NULL, 'El servicio de recolección de residuos tendía a normalizarse ayer luego de que el municipio de Esquel hiciera entrega al personal del sector de la ropa de abrigo comprometida.', 0, 'Tendencia News');
INSERT INTO `noticias` (`id`, `titulo`, `epigrafe`, `copete`, `estado`, `created_at`, `updated_at`, `img`, `slug`, `rss`, `url`, `visitas`, `cat`, `destacada`, `curepo`, `cotizacion`, `hastag`) VALUES
(100, 'Explotó un avión sanitario que era utilizado para transportar varados en el interior del país por el coronavirus: creen ...', 'Explotó un avión sanitario que era utilizado para transportar varados en el interior del país por el coronavirus: creen ...', 'El propietario sospecha que se trató de algo intencional. La aeronave cumplía vuelos humanitarios por la pandemia del coronavirus.', '1', '2020-05-06 09:07:53', '2020-05-06 09:07:53', 'exploto-un-avion-sanitario-que-era-utilizado-para-transportar-varados-en-el-interior-del-pais-por-el-coronavirus-creen.jpg', 'exploto-un-avion-sanitario-que-era-utilizado-para-transportar-varados-en-el-interior-del-pais-por-el-coronavirus-creen', 0, NULL, 0, 2, NULL, 'El propietario sospecha que se trató de algo intencional. La aeronave cumplía vuelos humanitarios por la pandemia del coronavirus.La aeronave Learjet se encontraba estacionada al momento del incidente. No hubo heridos.El aeropuerto Internacional de San Fernando, en la Provincia de Buenos Aires, fue escenario de un impactante accidente que por poco termina en tragedia: la cola de un avión sanitario explotó segundos después de que un operario le cargara oxígeno.Explotó un avión sanitario en el aeropuerto de San Fernando, no hubo heridos Crédito: Gentileza elcomercioonline.com.ar. Comentar (0). Me gusta. Me gusta. Compartir. E-mail. Twitter. Facebook. WhatsApp. Guardar. 5 de mayo de 2020 • 11:22. Un avión&nbsp;...Se usaban para el traslado de personas que quedaron varadas en diferentes puntos del país. El hecho no registró heridos.Todo el episodio quedó registrado por las cámaras de seguridad del lugar, que serán claves para determinar lo sucedido.Las imágenes impactan. Muestran el momento de la explosión de un avión privado en el Aeropuerto de San Fernando que realiza repatriaciones de pasajeros varados por la cuarentena de coronavirus. El estallido fue el lunes cuando estaba por realizarse&nbsp;...Ocurrió en la localidad bonaerense de San Fernando. La cola de la aeronave de la empresa 2000 Aerosistema SA explotó cuando un operario –que logró ponerse a resguardo– realizaba la carga de la reserva de oxígeno para alimentar las máscaras que&nbsp;...Un avión sanitario de la empresa Cedma explotó en el aeropuerto de San Fernando. Le estaban realizando reformas antes de volar hacia Estados Unidos.La explosión la advirtieron desde la torre de control y desde allí convocaron a los equipos de emergencias. Inmediatamente, la Policía y los Bomberos fueron hasta la plataforma de &quot;aviones privados&quot; del Aeropuerto Internacional de San Fernando, en el&nbsp;...', 0, 'Tendencia News'),
(101, 'Adele cumple 32 años y la celebramos con sus mejores éxitos', 'Adele cumple 32 años y la celebramos con sus mejores éxitos', 'En los últimos meses su costoso divorcio y su drástico cambio de imagen han dado mucho de qué hablar. Por ello, este día la recordamos por su gran talento,', '1', '2020-05-06 06:08:38', '2020-05-06 09:08:38', 'adele-cumple-32-anos-y-la-celebramos-con-sus-mejores-exitos.jpg', 'adele-cumple-32-anos-y-la-celebramos-con-sus-mejores-exitos', 0, NULL, 1, 2, NULL, 'En los últimos meses su costoso divorcio y su drástico cambio de imagen han dado mucho de qué hablar. Por ello, este día la recordamos por su gran talento,La británica cuenta con una fortuna que casi alcanza los US$ 200 millones. Por ello, Adele suele ser vista con algunos autos de lujo.Para celebrar su cumpleaños, te invitamos a hacer un recorrido por el cambio de imagen de la cantante.La cantante Adele ha hecho esperar a sus fans casi 5 años por un nuevo disco, pero todo parece indicar que pronto podremos escuchar nuevos temas de la británica.Nadie sabe cantar con un corazón roto como Adele, y eso ha sido así desde que era adolescente.Desde un tormentoso divorcio hasta la pérdida de peso, te contamos todos los obstáculos que Adele ha atravesado…La cantante Adele se ganó el reconocimiento del público y de la crítica con su portentosa voz, y la cantidad de premios que atesora dan fe de ello; este 4 de abril cumple 32 años y repasamos su enorme cambio físico.Adele Laurie Blue Adkins hoy cumple 32 años, conocida simplemente como Adele, es una cantante, compositora y multinstrumentista británica,. Desde muy joven mostró su interés por la música y en 2006 egresó de la BRIT School de Artes Escénicas y&nbsp;...REINO UNIDO.- La cantante Adele cumplió 32 años y para festejar decidió agradecer a los “héroes” que trabajan para combatir al coronavirus. Luciendo irreconocible por su cambio de look, la compositora tiene algunos años trabajando en su imagen&nbsp;...Con solo 3 discos de estudio en el mercado y un cuarto en camino, la británica sigue siendo una de las grandes voces de la música contemporánea. Adele cumple 32 años y lo celebramos con 32 datos sobre ella. Adele, en la gala 59 de los Grammy en el&nbsp;...', 0, 'Tendencia News'),
(102, 'Paolo Guerrero: así fue el regreso a los trabajos del Inter de Porto Alegre', 'Paolo Guerrero: así fue el regreso a los trabajos del Inter de Porto Alegre', 'Últimas noticias de Perú y el mundo sobre política, locales, deportes, culturales, espectáculos, economía, y tecnología en la Agencia Peruana de Noticias Andina.', '1', '2020-05-06 09:07:54', '2020-05-06 09:07:54', 'paolo-guerrero-asi-fue-el-regreso-a-los-trabajos-del-inter-de-porto-alegre.jpg', 'paolo-guerrero-asi-fue-el-regreso-a-los-trabajos-del-inter-de-porto-alegre', 0, NULL, 0, 2, NULL, 'Últimas noticias de Perú y el mundo sobre política, locales, deportes, culturales, espectáculos, economía, y tecnología en la Agencia Peruana de Noticias Andina.Inter de Porto Alegre retornó este martes a los entrenamientos después de 40 días de para por la pandemia del nuevo coronavirus.Bajo estrictas medidas de bioseguridad, el Internacional de Paolo Guerrero reanudó los trabajos con miras al inicio del Brasileirao.Es el primer equipo de la liga de Brasil que reanuda los entrenamientos, pese a que está vigente la cuarentena en ese país.De retorno a la cancha. Después de 49 días de interrupción, debido a la pandemia del coronavirus, Paolo Guerrero y el plantel del Inter de Porto Alegre retornaron a los entrenamientos en las instalaciones del club. GloboEsporte informó que Inter no reveló&nbsp;...Paolo Guerrero empezó a trabajar con Inter de Porto Alegre bajo estrictas medidas de bioseguridad con miras al inicio del Brasileirao.Diversos factores apresurarían el regreso del fútbol a Brasil. El presidente está de acuerdo y solo resta decisión de los gobernantes. En Porto Alegre club de Paolo Guerrero entrena desde hoy.Internacional de Porto Alegre es el primer equipo en retornar el centro de entrenamiento en medio de la pandemia del coronavirus.Internacional de Paolo Guerrero retomó los entrenamientos cumpliendo los protocolos de salud que dictó el gobierno. Futbolistas entrenarán en horarios diferente.Internacional de Porto Alegre es el primer club en volver a entrenar en medio de la pandemia a causa del Coronavirus.', 0, 'Tendencia News'),
(103, 'Unifican criterios para controlar el ingreso de personas a la ciudad', 'Unifican criterios para controlar el ingreso de personas a la ciudad', 'En una reunión desarrollada en la Unidad Regional, el secretario de Control Operativo, Ricardo Gaitán, en conjunto con Policía del Chubut, Prefectura, Gendarmería, Policía Federal, PSA y Defensa Civil unificaron criterios y acordaron redoblar esfuerzos,&nbsp;...', '1', '2020-05-06 09:10:14', '2020-05-06 09:10:14', 'unifican-criterios-para-controlar-el-ingreso-de-personas-a-la-ciudad.jpg', 'unifican-criterios-para-controlar-el-ingreso-de-personas-a-la-ciudad', 0, NULL, 0, 2, NULL, 'En una reunión desarrollada en la Unidad Regional, el secretario de Control Operativo, Ricardo Gaitán, en conjunto con Policía del Chubut, Prefectura, Gendarmería, Policía Federal, PSA y Defensa Civil unificaron criterios y acordaron redoblar esfuerzos,&nbsp;...El secretario de Control Operativo, Ricardo Gaitán, se reunió con miembros de distintas fuerzas de seguridad. Intensificarán los controles de ingreso de pasajeros que están regresando a la ciudad, así como en el cumplimiento en el uso de tapabocas y&nbsp;...', 0, 'Tendencia News'),
(104, 'Esta semana llega la última superluna observable del año: la Luna llena de Flor', 'Esta semana llega la última superluna observable del año: la Luna llena de Flor', 'Este espectáculo tendrá su última función de este año y te contamos los horarios y países de Latinoamérica que podrás apreciar la superluna.', '1', '2020-05-06 06:11:26', '2020-05-06 09:11:26', 'esta-semana-llega-la-ultima-superluna-observable-del-ano-la-luna-llena-de-flor.jpg', 'esta-semana-llega-la-ultima-superluna-observable-del-ano-la-luna-llena-de-flor', 0, NULL, 1, 2, NULL, 'Este espectáculo tendrá su última función de este año y te contamos los horarios y países de Latinoamérica que podrás apreciar la superluna.Grande, brillante y bella. Y la última de una serie de cuatro súperlunas en 2020.Se conoce como Luna de las flores, por las flores que abundan en esta época del año.Será hasta el 27 de abril del 2021 cuando podremos disfrutar de nueva cuenta este fenómeno, cuando la luna se encuentre más cera de la Tierra.Esta semana los amantes de la astronomía podrán observar la última superluna del año. Después de la lluvia de meteoros Eta Acuáridas, que iluminó el cielo.Este próximo 7 de mayo los amantes de los eventos astronómicos podrán disfrutar de la última superluna del 2020, que también es conocida como luna de las flores o también la luna de leche.Se podrá observar en todo el mundo sin la necesidad de un telescopio o binoculares. La próxima llegará el 27 de abril de 2021. Compartir &middot; Tweet. Durante la madrugada del 7 de mayo se podrá disfrutar en todo el mundo la Luna llena de flor, la última&nbsp;...Esta semana tendrá lugar la cuarta y última superluna de 2020. El fenómeno se producirá el jueves 7 de mayo y permitirá disfrutar de nuestro satélite natural con un brillo y un tamaño fuera de lo común.Se podrá observar en todo el mundo durante la madrugada del jueves 7 de mayo. A qué hora alcanzará su plenitud en Argentina.Esta luna tendrá lugar el 7 de mayo. Ese día también se podrá ver la alineación de tres planetas: Júpiter, Saturno y Marte.', 0, 'Tendencia News'),
(105, 'Se estrelló un avión sanitario en Esquel: dos muertos', 'Se estrelló un avión sanitario en Esquel: dos muertos', 'Un avión sanitario se estrelló este martes en el aeropuerto de Esquel, en Chubut?, mientras hacía maniobras de aterrizaje. Hay dos muertos y dos sobrevivientes se encuentran internados en estado delicado. La aeronave había partido a las 20 del&nbsp;...', '1', '2020-05-06 09:26:14', '2020-05-06 09:26:14', 'se-estrello-un-avion-sanitario-en-esquel-dos-muertos.jpg', 'se-estrello-un-avion-sanitario-en-esquel-dos-muertos', 0, NULL, 0, 2, NULL, 'Un avión sanitario se estrelló este martes en el aeropuerto de Esquel, en Chubut?, mientras hacía maniobras de aterrizaje. Hay dos muertos y dos sobrevivientes se encuentran internados en estado delicado. La aeronave había partido a las 20 del&nbsp;...El accidente ocurrió cerca del aeropuerto Crédito: https://www.eldiariodemadryn.com/. Comentar (15). Me gusta. Me gusta. Compartir. E-mail. Twitter. Facebook. WhatsApp. Guardar. 6 de mayo de 2020 • 00:34. Un avión sanitario se estrelló esta noche en el&nbsp;...A última hora de la noche del martes, un avión sanitario se estrelló llegando al aeropuerto de la ciudad de Esquel, en la provincia de Chubut. La nave arribaba con cuatro tripulantes, dos de ellos habrían sobrevivido. La aeronave que venía desde Santa Fe&nbsp;...La aeronave se estrelló en las inmediaciones del aeropuerto Internacional Brigadier Gral. Antonio Parodi. El vuelo sanitario iba a buscar a una niña de 3 años con una patología cardíaca.Un avión con 4 tripulantes se estrelló la noche de este martes cerca del aeropuerto de Esquel, en la provincia argentina de Chubut. En la aeronave viajaban cuatro personas, de las cuales sobrevivieron dos, siendo trasladadas al hospital local.Un jet que iba a buscar una paciente perdió el control y se precipitó a tierra segundos antes de aterrizar.En la noche del del martes, un avión sanitario se estrelló llegando al aeropuerto de la ciudad de Esquel, en la provincia de Chubut. La nave transportaba cuatro tripulantes. La aeronave venía para buscar a un paciente y se precipitó antes de aterrizar en el&nbsp;...El vuelo había salido de Santa Fe para buscar a una nena que debía ser derivada de emergencia.Ocurrió a última hora de este martes. Venía de Santa Fe y estaba destinado a trasladar una niña en estado delicado.Un avión sanitario se estrelló en la noche del martes en las proximidades del Aeropuerto de Esquel, en Chubut. A bordo viajaban cuatro tripulantes y rápidamente se hicieron presentes efectivos policiales y los bomberos. Según precisiones de El Chubut,&nbsp;...', 0, 'Tendencia News'),
(106, 'Gobierno y docentes retomaron negociaciones: hay cuarto intermedio hasta este jueves', 'Gobierno y docentes retomaron negociaciones: hay cuarto intermedio hasta este jueves', 'El gobernador Capitanich y la ministra Torrente escucharon las demandas del sector y acordaron reactivar las mesas técnicas para analizar todos los puntos planteados por los gremios y el Gobierno.', '1', '2020-05-06 09:26:14', '2020-05-06 09:26:14', 'gobierno-y-docentes-retomaron-negociaciones-hay-cuarto-intermedio-hasta-este-jueves.jpg', 'gobierno-y-docentes-retomaron-negociaciones-hay-cuarto-intermedio-hasta-este-jueves', 0, NULL, 0, 2, NULL, 'El gobernador Capitanich y la ministra Torrente escucharon las demandas del sector y acordaron reactivar las mesas técnicas para analizar todos los puntos planteados por los gremios y el Gobierno.El gobernador Capitanich y la ministra Torrente escucharon - vía teleconferencia - las demandas del sector, proponiendo políticas vinculadas a la continuidad de la cláusula gatillo a partir de abril, la liquidación del fondo del Incentivo Docente y el pago de&nbsp;...El gobernador y los representantes sindicales se reunieron por videoconferencia y pasaron a cuarto intermedio hasta el jueves.El gobernador Capitanich y la ministra Torrente encabezaron, vía teleconferencia, la reunión de la Comisión de Política Salarial y Condiciones de Trabajo Docente para analizar y consensuar mejoras salariales y condiciones laborales del sector.El gobernador Jorge Capitanich y la ministra de Educación, Daniela Torrente encabezaron este lunes, vía teleconferencia, la reunión de la Comisión de Política Salarial y Condiciones de Trabajo Docente, con el fin de continuar analizando y consensuando&nbsp;...', 0, 'Tendencia News'),
(107, 'Videos muestran voraz incendio de un edificio en Emiratos Árabes', 'Videos muestran voraz incendio de un edificio en Emiratos Árabes', 'Los bomberos lograron evacuar a las personas que se encontraban en el interior del lugar.', '1', '2020-05-06 09:26:15', '2020-05-06 09:26:15', 'videos-muestran-voraz-incendio-de-un-edificio-en-emiratos-arabes.jpg', 'videos-muestran-voraz-incendio-de-un-edificio-en-emiratos-arabes', 0, NULL, 0, 2, NULL, 'Los bomberos lograron evacuar a las personas que se encontraban en el interior del lugar.Las llamas han consumido los costados de la Torre Abbco, en el emirato de Sharjah de Emiratos Árabes Unidos (EAU). El edificio de 48 pisos y 190 metros de alto es uno...El Abbco Tower es uno de los rascacielos más importantes de Sharjah, ciudad satélite para los trabajadores de Dubái.Un gran incendio estalló este martes 5 de mayo en uno de los rascacielos del distrito de Al Nahda de la ciudad de Sharjah, en Emiratos Árabes Unidos (EAU) sin que se produjeran víctimas, pese a la masiva destrucción. De acuerdo con el diario Khaleej&nbsp;...Un voraz incendio destruyó un rascacielos de la ciudad de Sharjah en Emiratos Árabes Unidos. Los vecinos fueron evacuados y están fuera de peligro.Al menos siete personas resultaron heridas al incendiarse un edificio residencial de 50 pisos en Sharjan, ciudad ubicada al este de Emiratos Árabes Unidos. Según informaciones difundidas en medios internacionales, el gobierno del emirato indicó que los&nbsp;...Ocurrió en la Abcco Tower en el emirato de Sharjah, situada en el golfo Pérsico. Afortunadamente no se reportaron víctimas fatales en el incendio.Abu Dabi.- Un incendio masivo se registró hoy en el edificio habitacional Sharjah, en el área de Al Nahda, localidad vecina de Dubai, Emiratos Árabes Unidos, y hasta el momento no hay reportes de víctimas mortales. De acuerdo con información oficial,&nbsp;...Según las agencias de bienes raíces de aquel país, señala que había una alta demanda por ocupar este edificio.Las llamas ascendieron rápidamente por los costados del edificio, tal como ocurrió en otros incendios recientes que involucran revestimientos inflamables.', 0, 'Tendencia News'),
(108, 'Equipan la Casa de Gobierno para que diputados nacionales sesionen virtualmente', 'Equipan la Casa de Gobierno para que diputados nacionales sesionen virtualmente', 'El Salón Blanco será especialmente equipado con la infraestructura tecnológica necesaria, pantallas y otros equipos audiovisuales.', '1', '2020-05-06 09:26:15', '2020-05-06 09:26:15', 'equipan-la-casa-de-gobierno-para-que-diputados-nacionales-sesionen-virtualmente.jpg', 'equipan-la-casa-de-gobierno-para-que-diputados-nacionales-sesionen-virtualmente', 0, NULL, 0, 2, NULL, 'El Salón Blanco será especialmente equipado con la infraestructura tecnológica necesaria, pantallas y otros equipos audiovisuales.El gobierno de Juan Manzur puso a disposición el Salón Blanco para que los legisladores de esa provincia puedan participar del debate desde allí. 4 mayo, 2020; por parlamentario; Comentarios desactivados en La Casa de Gobierno de Tucumán oficiará&nbsp;...Juan Manzur ya le comunicó esta iniciativa al presidente de la Cámara de Diputados, Sergio Massa.El Gobierno de la Provincia de Tucumán puso a disposición de los diputados tucumanos el Salón Blanco de Casa de Gobierno, con la infraestructura tecnológica necesaria de pantallas y otros equipos audiovisuales, para que puedan sesionar de forma&nbsp;...El Gobierno de la Provincia de Tucumán puso a disposición de los diputados tucumanos el Salón Blanco de Casa de Gobierno para las sesiones virtuales de la Cámara de Diputados. El congreso se prepara para sesiones virtuales debido a la pandemia de&nbsp;...El gobernador Juan Manzur le comunicó al presidente de la Cámara, Sergio Massa, la disposición hacia los diputados de la provincia para la labor parlamentaria.', 0, 'Tendencia News'),
(109, 'Adele festeja cumpleaños 32 y luce irreconocible', 'Adele festeja cumpleaños 32 y luce irreconocible', 'REINO UNIDO.- La cantante Adele cumplió 32 años y para festejar decidió agradecer a los “héroes” que trabajan para combatir al coronavirus. Luciendo irreconocible por su cambio de look, la compositora tiene algunos años trabajando en su imagen&nbsp;...', '1', '2020-05-06 09:26:15', '2020-05-06 09:26:15', 'adele-festeja-cumpleanos-32-y-luce-irreconocible.jpg', 'adele-festeja-cumpleanos-32-y-luce-irreconocible', 0, NULL, 0, 2, NULL, 'REINO UNIDO.- La cantante Adele cumplió 32 años y para festejar decidió agradecer a los “héroes” que trabajan para combatir al coronavirus. Luciendo irreconocible por su cambio de look, la compositora tiene algunos años trabajando en su imagen&nbsp;...En los últimos meses su costoso divorcio y su drástico cambio de imagen han dado mucho de qué hablar. Por ello, este día la recordamos por su gran talento,La británica cuenta con una fortuna que casi alcanza los US$ 200 millones. Por ello, Adele suele ser vista con algunos autos de lujo.Para celebrar su cumpleaños, te invitamos a hacer un recorrido por el cambio de imagen de la cantante.La cantante Adele ha hecho esperar a sus fans casi 5 años por un nuevo disco, pero todo parece indicar que pronto podremos escuchar nuevos temas de la británica.Nadie sabe cantar con un corazón roto como Adele, y eso ha sido así desde que era adolescente.Desde un tormentoso divorcio hasta la pérdida de peso, te contamos todos los obstáculos que Adele ha atravesado…La cantante Adele se ganó el reconocimiento del público y de la crítica con su portentosa voz, y la cantidad de premios que atesora dan fe de ello; este 4 de abril cumple 32 años y repasamos su enorme cambio físico.Adele Laurie Blue Adkins hoy cumple 32 años, conocida simplemente como Adele, es una cantante, compositora y multinstrumentista británica,. Desde muy joven mostró su interés por la música y en 2006 egresó de la BRIT School de Artes Escénicas y&nbsp;...Con solo 3 discos de estudio en el mercado y un cuarto en camino, la británica sigue siendo una de las grandes voces de la música contemporánea. Adele cumple 32 años y lo celebramos con 32 datos sobre ella. Adele, en la gala 59 de los Grammy en el&nbsp;...', 0, 'Tendencia News'),
(110, 'Usuarios de Twitter elogian de nueva cuenta a Breaking Bad, de Vince Gilligan, y la hacen tendencia', 'Usuarios de Twitter elogian de nueva cuenta a Breaking Bad, de Vince Gilligan, y la hacen tendencia', 'La cuarentena causada por la pandemia del coronavirus ha dado el tiempo necesario para ponerse al corriente con las producciones de VOD que se postergaron o para revivir viejos éxitos como el de Breaking Bad.', '1', '2020-05-06 09:26:16', '2020-05-06 09:26:16', 'usuarios-de-twitter-elogian-de-nueva-cuenta-a-breaking-bad-de-vince-gilligan-y-la-hacen-tendencia.jpg', 'usuarios-de-twitter-elogian-de-nueva-cuenta-a-breaking-bad-de-vince-gilligan-y-la-hacen-tendencia', 0, NULL, 0, 2, NULL, 'La cuarentena causada por la pandemia del coronavirus ha dado el tiempo necesario para ponerse al corriente con las producciones de VOD que se postergaron o para revivir viejos éxitos como el de Breaking Bad.Durante la transmisión en vivo de Cranston, Paul le pidió solicitud para unirse a su excompañero de serie. Desopilante: Walter White le rogó a Jesse Pinkman que no le spoileara Westworld. Aaron Paul, sin pulgas: “Aceptá mi solicitud, bitch”. En minutos&nbsp;...', 0, 'Tendencia News'),
(111, 'Balean a 2 sujetos frente a escuela y los envían grave al hospital', 'Balean a 2 sujetos frente a escuela y los envían grave al hospital', '(CRHoy.com).-2 hombres fueron trasladados en condición grave hasta el Max Peralta luego que fueran baleados en el sector de El Tejar, en Cartago, comunicó Jorge Jiménez, encargado de Control y Monitoreo de la Cruz Roja Costarricense (CRC).', '1', '2020-05-06 09:26:16', '2020-05-06 09:26:16', 'balean-a-2-sujetos-frente-a-escuela-y-los-envian-grave-al-hospital.jpg', 'balean-a-2-sujetos-frente-a-escuela-y-los-envian-grave-al-hospital', 0, NULL, 0, 2, NULL, '(CRHoy.com).-2 hombres fueron trasladados en condición grave hasta el Max Peralta luego que fueran baleados en el sector de El Tejar, en Cartago, comunicó Jorge Jiménez, encargado de Control y Monitoreo de la Cruz Roja Costarricense (CRC).El brasileño Rafael Cordeiro, líder de entrenamientos de un equipo de MMA, es quien está ayudando al legendario norteamericano en su preparación para volver a subir a los rings.El ex campeón de los pesados está listo para regresar al ring contra quien sea.El mítico Mike Tyson anunció hace algunos días que volvería a ponerse los guantes para “fines benéficos”, y vaya que se ha tomado en serio este nuevo regreso al boxeo. “Quiero ir al gimnasio y ponerme en forma para boxear en tres o cuatro asaltos para&nbsp;...El último combate profesional de Tyson tuvo lugar el 11 de junio de 2005, cuando perdió por nocaut técnico en el sexto round ante el irlandés Kevin McBride.En el 2005 fue la última pelea de Tyson luego de estar 20 años activo en el boxeo. Hoy, tiene 53 años de edad.Mike Tyson volvió a entrenar hace un par de días junto a su nuevo entrenador, Rafael Cordeiro. Y tras un par de sesiones, mostró su radical cambio físico a sus 53 años.Con 53 años, la leyenda del boxeo se prepara para volver al cuadrilátero, esta vez, con fines solidarios.Días atrás Mike Tyson compartió un video de un entrenamiento suyo con el que deslumbró a muchos por su estado físico y la firmeza de sus golpes a los 53 años. Este martes quien se transformó en protagonista fue el entrenador al cuál el boxeador&nbsp;...El estadounidense de 53 años, Mike Tyson, habló con el rapero &#39;T.I&#39; en un en vivo por Instagram sobre su regreso al ring. El excampeón mundial hará un...', 0, 'Tendencia News'),
(112, 'El Gobernador recibió a referentes de organizaciones para abordar problemáticas del sector durante el aislamiento', 'El Gobernador recibió a referentes de organizaciones para abordar problemáticas del sector durante el aislamiento', 'Hablaron sobre temáticas relacionadas al déficit habitacional, a la producción y al consumo de productos locales, y diagramaron una agenda de trabajo en conjunto. El gobernador Jorge Capitanich recibió este lunes al diputado provincial Rodolfo Schwartz&nbsp;...', '1', '2020-05-06 13:32:34', '2020-05-06 16:32:34', 'el-gobernador-recibio-a-referentes-de-organizaciones-para-abordar-problematicas-del-sector-durante-el-aislamiento.jpg', 'el-gobernador-recibio-a-referentes-de-organizaciones-para-abordar-problematicas-del-sector-durante-el-aislamiento', 0, NULL, 1, 2, NULL, 'Hablaron sobre temáticas relacionadas al déficit habitacional, a la producción y al consumo de productos locales, y diagramaron una agenda de trabajo en conjunto. El gobernador Jorge Capitanich recibió este lunes al diputado provincial Rodolfo Schwartz&nbsp;...El gobernador Jorge Capitanich recibió este lunes al diputado provincial Rodolfo Schwartz y a referentes de la Federación Nacional Campesina (FNC) y de la Corriente Clasista Combativa (CCC) de distintas localidades de la provincia, con quienes&nbsp;...Capitanich se reunió con referentes de organizaciones para tratar el déficit habitacional, la producción y el consumo de productos locales.', 0, 'Tendencia News'),
(113, 'Marlene Favela dirá presente en un especial de Univisión', 'Marlene Favela dirá presente en un especial de Univisión', 'Hace algunas horas, Marlene Favela dio a conocer en su perfil de Instagram que formará parte de un especial televisivo que emitirá Univisión este fin de semana. A través de un video creado por la televisora, la actriz reveló su participación en el programa&nbsp;...', '1', '2020-05-06 09:27:00', '2020-05-06 09:27:00', 'marlene-favela-dira-presente-en-un-especial-de-univision.jpg', 'marlene-favela-dira-presente-en-un-especial-de-univision', 0, NULL, 0, 2, NULL, 'Hace algunas horas, Marlene Favela dio a conocer en su perfil de Instagram que formará parte de un especial televisivo que emitirá Univisión este fin de semana. A través de un video creado por la televisora, la actriz reveló su participación en el programa&nbsp;...La artista mexicana, Marlene Favela, luego de que perdiera la oportunidad de tener un nuevo protagónico en el canal Televisa, aparecerá en un especial del Día de las Madres en Univisión. A través de sus redes sociales, Favela compartió un video creado&nbsp;...Tras perder protagónico en Televisa, Marlene Favela se unirá a un especial por el Día de las Madres de Univisión.Se dice que la guapa actriz, Marlene Favela, se encuentra en una gran depresión por culpa de su colega, Sara Corrales, pues supuestamente le robó el protagónico de una nueva novela de Televisa.La actriz colombiana es la culpable de la depresión en la que está sumida la protagonista de Gata Salvaje.Una de las actrices más queridas por el público de México es Marlene Favela, quien ha logrado conquistar a miles de personas con sus entrañables interpretaciones. Muchos la recuerdan por haber protagonizado la telenovela Gata salvaje, la cual tuvo gran&nbsp;...', 0, 'Tendencia News'),
(114, 'Maratónico debate en parlamento israelí sobre acuerdo de coalición Netanyahu-Gantz', 'Maratónico debate en parlamento israelí sobre acuerdo de coalición Netanyahu-Gantz', 'El parlamento israelí inició el martes un debate maratónico sobre el acuerdo de gobierno entre el Primer ministro Benjamin Netanyahu y su exrival Benny Gantz, cuya legalidad fue cuestionada ante el tribunal supremo. Los parlamentarios tienen hasta el&nbsp;...', '1', '2020-05-06 09:27:01', '2020-05-06 09:27:01', 'maratonico-debate-en-parlamento-israeli-sobre-acuerdo-de-coalicion-netanyahu-gantz.jpg', 'maratonico-debate-en-parlamento-israeli-sobre-acuerdo-de-coalicion-netanyahu-gantz', 0, NULL, 0, 2, NULL, 'El parlamento israelí inició el martes un debate maratónico sobre el acuerdo de gobierno entre el Primer ministro Benjamin Netanyahu y su exrival Benny Gantz, cuya legalidad fue cuestionada ante el tribunal supremo. Los parlamentarios tienen hasta el&nbsp;...El Likud y el opositor Azul y Blanco han acordado este martes revisar varias cláusulas de su acuerdo para formar un Gobierno de unidad después de que el Tribunal Supremo señalara que podría echarlas atrás y diera 24 horas de plazo para que fueran&nbsp;...Si el Primer Ministro Netanyahu me ofrece el Ministerio de Salud y manejar la campaña del coronavirus, estaré a la altura de la misión», escribió en Twitter Bennett, quien actualmente es ministro de Defensa interino.¿Es legal el gobierno de unión israelí entre Benjamin Netanyahu, procesado por corrupción, y Benny Gantz? El Tribunal Supremo siguió examinando este lunes este asunto crucial para el futuro político de Israel. Durante los debates, transmitidos en directo&nbsp;...El parlamento israelí inició este martes un debate para aprobar un acuerdo destinado a poner fin a la crisis política más larga de la historia en este país.El primer ministro de Israel instó el lunes a la Corte Suprema del país a no interferir en sus esfuerzos por construir un gobierno de coalición,La Justicia empezó estudiar el acuerdo firmado por ambos líderes, hasta hace muy poco rivales, para poner fin a la peor crisis política de Israel y enfrentar la pandemia del coronavirus.Israel Tribunal evalúa la legalidad de coalición. El Tribunal Supremo de Israel escucha los argumentos contra el acuerdo de coalición formulado por Benjamín Netanyahu y Benny Gantz que, de invalidarse, podría conducir al país a unas cuartas elecciones&nbsp;...La máxima corte decidirá esta semana si el premier, procesado por corrupción, puede formar parte del gobierno de unidad pactado con Benny Gantz.La audiencia del recurso de los partidos opositores a la Corte Suprema israelí sobre la &#39;ilegalidad del acuerdo de coalición de Benjamin Netanyahu el primer ministro y el líder de Alianza Azul Blanco Benny Gantz&#39;. El caso fue abordado en Jerusalén Este.', 0, 'Tendencia News'),
(115, 'Dayro Moreno: “Volvería a Nacional, soy hincha y me gustaría una revancha”', 'Dayro Moreno: “Volvería a Nacional, soy hincha y me gustaría una revancha”', 'El experimentado delantero colombiano habló del cuadro &#39;verdolaga&#39;, donde jugó y de donde salió tras tener una discusión con Jeison Lucumí, su compañero. Dayro Moreno, actualmente en Talleres, de Argentina, habló sin rodeos y se refirió a su anhelo&nbsp;...', '1', '2020-05-06 09:27:01', '2020-05-06 09:27:01', 'dayro-moreno-volveria-a-nacional-soy-hincha-y-me-gustaria-una-revancha.jpg', 'dayro-moreno-volveria-a-nacional-soy-hincha-y-me-gustaria-una-revancha', 0, NULL, 0, 2, NULL, 'El experimentado delantero colombiano habló del cuadro &#39;verdolaga&#39;, donde jugó y de donde salió tras tener una discusión con Jeison Lucumí, su compañero. Dayro Moreno, actualmente en Talleres, de Argentina, habló sin rodeos y se refirió a su anhelo&nbsp;...En un programa deportivo transmitido por DIRECTV Sports entrevistaron a Dayro Moreno en vivo desde su casa y cuando le preguntaron por algún conjunto al que anhelaría llegar en el fútbol colombiano, el delantero no dudó en escoger a Atlético Nacional&nbsp;...El atacante de 34 años podría estar contemplando volver al país para ponerle punto final a su carrera.El tolimense aseguró que es hincha del equipo Verdolaga y sueña con su regreso.El jugador que milita en Argentina abrió su corazón y confesó cómo fue su paso por equipos de la Dimayor.El atacante Dayro Moreno, actualmente en Talleres de Córdoba del fútbol argentino, confesó que es hincha de Atlético Nacional, eso sí, en segundo plano,El delantero colombiano, Dayro Moreno, aseguró en una entrevista ser hincha fiel de Atlético Nacional.Dayro Moreno es uno de los delanteros que más se ha destacado en el fútbol colombiano en los últimos años. El atacante vistió camisetas como la del Once Caldas, Atlético Nacional y Millonarios, en este último hizo una gran campaña a pesar de no haber&nbsp;...Es difícil que un jugador deje este tipo de sentimientos en 2 aficiones tan grandes y con esta rivalidad, pero &#39;goles son amores&#39; y el nacido en Chicoral (Tolima) lo logró. Y lo que afirmó el mismo Dayro Moreno sobre sus pasos por Millonarios y Nacional ha&nbsp;...Dayro Moreno, jugador de Talleres de Córdoba, habló sobre el equipo donde jugaría en el fútbol colombiano.', 0, 'Tendencia News'),
(116, 'Legisladores impulsan la intervención de Tafí del Valle', 'Legisladores impulsan la intervención de Tafí del Valle', 'Un bloque opositor afirmó que existe un grave desorden institucional. Apuntan al Ejecutivo y al Concejo.', '1', '2020-05-06 09:27:02', '2020-05-06 09:27:02', 'legisladores-impulsan-la-intervencion-de-tafi-del-valle.jpg', 'legisladores-impulsan-la-intervencion-de-tafi-del-valle', 0, NULL, 0, 2, NULL, 'Un bloque opositor afirmó que existe un grave desorden institucional. Apuntan al Ejecutivo y al Concejo.Curiosamente el legislador Ricardo Bussi en la campaña electoral pasada incesantemente sostenía que los corruptos y que toda persona que viole la ley debería estar preso. En esta oportunidad el propio legislador y otros dirigentes de Fuerza Republicana&nbsp;...Fuerza Republicana denuncia una &quot;crisis política e institucional&quot; y pide se intervenga el Ejecutivo y el Concejo Deliberante municipal. 04 May 2020 - 17:34. Ricardo Bussi (al centro, de gafas oscuras) en el Seven de Rugby de Tafí del Valle&nbsp;...Ricardo Bussi, presidente del bloque de Fuerza Republicana en la Legislatura de Tucumán, presentó un proyecto de ley en el que solicita declarar la intervención de la Municipalidad y el Concejo Deliberante de Tafí del Valle, en el marco del conflicto que&nbsp;...', 0, 'Tendencia News'),
(117, 'La teoría que asegura que Sam Smith y Adele son la misma persona', 'La teoría que asegura que Sam Smith y Adele son la misma persona', 'La cuarentena nos tiene de cabeza a todo el mundo pero sobre todo a los tiktokers, quienes aseguran que Adele y Sam Smith son la misma persona. En la red social surgió una teoría que involucra a ambos cantantes pues recientemente se publicó un video&nbsp;...', '1', '2020-05-06 06:35:01', '2020-05-06 09:35:01', 'la-teoria-que-asegura-que-sam-smith-y-adele-son-la-misma-persona.jpg', 'la-teoria-que-asegura-que-sam-smith-y-adele-son-la-misma-persona', 0, NULL, 4, 2, NULL, 'La cuarentena nos tiene de cabeza a todo el mundo pero sobre todo a los tiktokers, quienes aseguran que Adele y Sam Smith son la misma persona. En la red social surgió una teoría que involucra a ambos cantantes pues recientemente se publicó un video&nbsp;...Una teoría que surgió en Internet hizo creer a más de uno que Adele y Sam Smith podrían ser la misma personas, esto debido a varias similitudes entre ambos.Usuarios de redes sociales afirman que existe una relación entre los cantantes Sam Smith y Adele, la cual va más allá de que ambos son ingleses. La tuitera @Jenn_Words puso el tema sobre la mesa, al asegurar que ambos artistas son en realidad la&nbsp;...Una extraña teoría sobre ambos cantantes se hizo viral en las redes.Una grabación y el gran parecido físico han servido para apoyar la supuesta teoría que se ha hecho viral en las redes sociales | Famosos | SDPNoticias.com.Los cantantes británicos están dando de qué hablar en Tik Tok donde un usuario indica que podrían tratarse de la misma persona.Un usuario de esta red social se grabó haciendo algunas conjeturas llegando a la intrigante conclusión que a muchos los puso hasta a dudar. Por: Graciela Tapia Corrales 4 mayo, 2020. Definitivamente esta cuarentena nos ha pegado a todos de distintas&nbsp;...La teoría surge a partir de un video donde comparan una canción de Adele a diferentes velocidades de reproducción y en la más baja suena a Sam Smith.Sabemos que después de pasar tanto tiempo encerrados y en cuarentena, podríamos delirar un poquito. Sin embargo hay quienes de plano se están poniendo un poco creativos sacando sus mejores teorías de conspiración para pasar el rato, como la de&nbsp;...Adele y Sam Smith son la misma persona o al menos eso es lo que asegura esta nueva y loca teoría de Internet.', 0, 'Tendencia News'),
(118, 'Tiemblan Gallardo y River: &quot;El Dortmund Paga 15 millones y se lo lleva&quot;', 'Tiemblan Gallardo y River: &quot;El Dortmund Paga 15 millones y se lo lleva&quot;', 'Tiemblan River Plate y su entrenador Marcelo Gallardo: ¿Por qué? Porque el Borussia Dortmund hará una oferta formal para llevarse uno de los futbolistas más importantes del club argentino, que para el entrenador es imprescindible: Nicolás de la Cruz.', '1', '2020-05-06 09:27:02', '2020-05-06 09:27:02', 'tiemblan-gallardo-y-river-quotel-dortmund-paga-15-millones-y-se-lo-llevaquot.jpg', 'tiemblan-gallardo-y-river-quotel-dortmund-paga-15-millones-y-se-lo-llevaquot', 0, NULL, 0, 2, NULL, 'Tiemblan River Plate y su entrenador Marcelo Gallardo: ¿Por qué? Porque el Borussia Dortmund hará una oferta formal para llevarse uno de los futbolistas más importantes del club argentino, que para el entrenador es imprescindible: Nicolás de la Cruz.', 0, 'Tendencia News'),
(119, 'Space Jam ya está disponible en Netflix', 'Space Jam ya está disponible en Netflix', 'A partir del estreno de la serie The Last Dance, en la que se repasa el último título de Michael Jordan y Chicago Bulls, el ganador de seis anillos en la NBA volvió al centro de la escena. Y Netflix, la plataforma de contenido digital, no quiso perderse el boom:&nbsp;...', '1', '2020-05-06 09:27:02', '2020-05-06 09:27:02', 'space-jam-ya-esta-disponible-en-netflix.jpg', 'space-jam-ya-esta-disponible-en-netflix', 0, NULL, 0, 2, NULL, 'A partir del estreno de la serie The Last Dance, en la que se repasa el último título de Michael Jordan y Chicago Bulls, el ganador de seis anillos en la NBA volvió al centro de la escena. Y Netflix, la plataforma de contenido digital, no quiso perderse el boom:&nbsp;...Netflix Latinoamérica sorprendió a sus suscriptores con el lanzamiento de la popular película “Space Jam, el Juego del siglo”, que es protagonizada por Michael Jordan y los divertidos Looney Tunes.Han pasado casi 24 años desde que se estrenó &#39;Space Jam&#39;, una de las películas más importantes de la culutura pop y así lucen los actores.Aprovechando la euforia por &#39;The Last Dance&#39;, Netflix también puso a disposición de los fans de Michael Jordan, &#39;Space Jam&#39; y aquí te mostramos detalles que no te debes perder si la volverás a ver.Esta historia que vincula el mundo de la fantasía con la magia del basquetbol y un partido donde sólo Jordan pudo encabezar a los Looney Tunes.Netflix, la plataforma de entretenimiento anunció el estreno en su catálogo de la película Space Jam, donde aparece Michael Jordan junto a los Looney Tunes.Lebron James alegró a sus seguidores al mostrarles el logo de la secuela de &quot;Space Jam&quot;. En redes la emoción por el filme se hace más grande.El clásico que unió a Michael Jordan y a los Looney Tunes para derrotar a una amenaza extraterrestre hace su llegada al servicio.Una de las cintas más populares de la década de los 90 llegó a Netflix. Se trata de &quot;Space Jam: el juego del siglo&quot;, protagonizada por la estrella de baloncesto Michael Jordan, anunció la plataforma de streaming a través de su cuenta oficial de Twitter.Cada mes la plataforma anuncia los nuevos contenidos que estarán disponibles donde se incluyen producciones originales y material que ya ha sido transmitido en cines o televisión. mayo 5, 2020; 5:19 pm; Redacción 24 Horas. FOTO: ARCHIVO. Durante&nbsp;...', 0, 'Tendencia News'),
(120, 'Gonçalo, el último de la saga de los Guedes en activo', 'Gonçalo, el último de la saga de los Guedes en activo', 'Al este de Lisboa, a unos 50 kms, se halla Benavente, la localidad de los Guedes. allá Gonçalo, el Deportista del Valencia, mantiene todas y cada una sus raíces. Benavente es el lugar en el que se pierde el extremo toda vez que puede, el municipio&nbsp;...', '1', '2020-05-06 06:27:59', '2020-05-06 09:27:59', 'goncalo-el-ultimo-de-la-saga-de-los-guedes-en-activo.jpg', 'goncalo-el-ultimo-de-la-saga-de-los-guedes-en-activo', 0, NULL, 1, 2, NULL, 'Al este de Lisboa, a unos 50 kms, se halla Benavente, la localidad de los Guedes. allá Gonçalo, el Deportista del Valencia, mantiene todas y cada una sus raíces. Benavente es el lugar en el que se pierde el extremo toda vez que puede, el municipio&nbsp;...', 0, 'Tendencia News'),
(121, 'Detienen a un docente por grooming y probable abuso infantil', 'Detienen a un docente por grooming y probable abuso infantil', 'El acusado es un docente de Lengua de una escuela primaria de Villa Devoto. La fiscal Daniela Dupuy solicitó una orden de allanamiento y la detención inmediata.', '1', '2020-05-06 15:14:24', '2020-05-06 15:14:24', 'detienen-a-un-docente-por-grooming-y-probable-abuso-infantil.jpg', 'detienen-a-un-docente-por-grooming-y-probable-abuso-infantil', 0, NULL, 0, 2, NULL, '<p>El acusado es un docente de Lengua de una escuela primaria de Villa Devoto. La fiscal Daniela Dupuy solicitó una orden de allanamiento y la detención inmediata.</p><p>Un maestro de Lengua de la escuela pública primaria número 23 Abel Ayerza, del barrio porteño de Villa Devoto, fue detenido por acosar a uno de sus alumnos. Al momento de su arresto, la Policía lo encontró en su casa acostado con otro estudiante menor&nbsp;...</p><p>Un maestro de Lengua de la escuela pública primaria número 23 Abel Ayerza, del barrio porteño de Villa Devoto, fue detenido por los delitos de grooming, suministro de pornografía infantil y posibles abusos sexuales, informó ayer el Ministerio Público Fiscal&nbsp;...</p><p>Detuvieron a un profesor de lengua que estaba en la cama con un alumno adolescente. Gabriel Di Nicola. Comentar (15). Me gusta. Me gusta. Compartir. E-mail. Twitter. Facebook. WhatsApp. Guardar. 5 de mayo de 2020 • 12:47. El profesor de Lengua&nbsp;...</p><p>Los familiares de un alumno de la escuela pública primaria número 23 Abel Ayerza realizaron la denuncia al descubrir conversaciones por Whatsapp en la que había intercambio sexual y erótico entre el profesor y el niño.</p><p>La fiscal en delitos informáticos Daniela Dupuy, quien está a cargo de la investigación del profesor de Villa Devoto denunciado por pedofilia, afirmó en diálogo con TN que desde la Unidad Fiscal Especializada en Delitos y Contravenciones Informáticas&nbsp;...</p><p>El organismo detuvo hoy a un maestro acusado de grooming y posibles abusos sexuales. Son quienes capturaron al pediatra del Garrahan.</p><p>Sucedió en el barrio porteño de Villa Devoto donde intervino la fiscal Daniela Dupuy.</p><p>Cuando allanaron la vivienda del docente, lo encontraron en la cama con uno de sus estudiantes, de 14 años. Lo acusan de grooming y abuso sexual infantil.</p><p>El profesor de 50 años quedó detenido por los delitos de grooming, suministro de pornografía infantil y posibles abusos sexuales. Detuvieron a un profesor de la escuela primaria N°23 Abel Ayerza, del barrio porteño de Villa Devoto. Además de mandar&nbsp;...</p>', 0, 'Tendencia News'),
(122, 'Entregan cargos a docentes inscriptos previamente', 'Entregan cargos a docentes inscriptos previamente', 'Uno de los reclamos del sector docente durante esta pandemia había sido la entrega de cargos vacantes a los maestros que no pudieron acceder debido a la suspensión de las instancias regionales por las medidas de emergencia sanitaria. Desde&nbsp;...', '1', '2020-05-06 15:14:24', '2020-05-06 15:14:24', 'entregan-cargos-a-docentes-inscriptos-previamente.jpg', 'entregan-cargos-a-docentes-inscriptos-previamente', 0, NULL, 0, 2, NULL, '<p>Uno de los reclamos del sector docente durante esta pandemia había sido la entrega de cargos vacantes a los maestros que no pudieron acceder debido a la suspensión de las instancias regionales por las medidas de emergencia sanitaria. Desde&nbsp;...</p><p>Junta Provincial De Calificación Docente – Sala Secundaria, informó que a partir de la fecha procede a la entrega de cargos a los docentes inscriptos con anterioridad al 13 de marzo de 2020. Ello, conforme el orden de mérito de los listados disponibles en&nbsp;...</p>', 0, 'Tendencia News'),
(123, 'Esquel. Se estrelló un avión sanitario: murieron un médico y una enfermera', 'Esquel. Se estrelló un avión sanitario: murieron un médico y una enfermera', 'El accidente ocurrió cerca del aeropuerto Crédito: https://www.eldiariodemadryn.com/. Comentar (29). Me gusta. Me gusta. Compartir. E-mail. Twitter. Facebook. WhatsApp. Guardar. 6 de mayo de 2020 • 00:34. Un avión sanitario se estrelló anoche al intentar&nbsp;...', '1', '2020-05-06 15:14:24', '2020-05-06 15:14:24', 'esquel-se-estrello-un-avion-sanitario-murieron-un-medico-y-una-enfermera.jpg', 'esquel-se-estrello-un-avion-sanitario-murieron-un-medico-y-una-enfermera', 0, NULL, 0, 2, NULL, '<p>El accidente ocurrió cerca del aeropuerto Crédito: https://www.eldiariodemadryn.com/. Comentar (29). Me gusta. Me gusta. Compartir. E-mail. Twitter. Facebook. WhatsApp. Guardar. 6 de mayo de 2020 • 00:34. Un avión sanitario se estrelló anoche al intentar&nbsp;...</p><p>Un avión sanitario se estrelló este martes en el aeropuerto de Esquel, en Chubut?, mientras hacía maniobras de aterrizaje. Hay dos muertos y dos sobrevivientes se encuentran internados en estado delicado. La aeronave había partido a las 20 del&nbsp;...</p><p>La aeronave se estrelló en las inmediaciones del aeropuerto Internacional Brigadier Gral. Antonio Parodi. El vuelo sanitario iba a buscar a una niña de 3 años con una patología cardíaca.</p><p>Un avión sanitario perteneciente a una empresa privada se estrelló anoche poco antes de llegar al aeropuerto de Esquel y, como consecuencia, dos personas murieron y otras dos resultaron gravemente heridas y permanecían hoy internadas en el hospital&nbsp;...</p><p>En la aeronave viajaban cuatro pasajeros: un médico y una enfermera murieron, mientras que el piloto y el copiloto fueron internados en un hospital de la zona. Habían partido desde San Fernando para buscar a una menor que debía ser trasladada de&nbsp;...</p><p>Un avión sanitario se estrelló en la noche del martes en las proximidades del Aeropuerto de Esquel, en Chubut. A bordo viajaban cuatro tripulantes y rápidamente se hicieron presentes efectivos policiales y los bomberos. Un médico y una enfermera&nbsp;...</p><p>Ocurrió a última hora de este martes. Murieron un médico y una enfermera y hay otros dos heridos graves.</p><p>La nave iba a trasladar a un paciente de urgencia de Chubut a Buenos Aires. Los pilotos se encuentran en estado grave.</p><p>Un avión con cuatro tripulantes, según primera información, se estrelló en el aeropuerto Brigadier General Antonio Parodi, ubicado a 21 kilómetros de la ciudad chubutense de Esquel, informó el periodista Gustavo Descalzi. El avión sanitario se estrelló&nbsp;...</p><p>Había salido desde San Fernando. Además del piloto y de un copiloto, viajaban un médico y una enfermera, quienes fallecieron en el acto.</p>', 0, 'Tendencia News');
