(124, 'Voraz incendio consume un rascacielos de 48 pisos en Emiratos Árabes Unidos', 'Voraz incendio consume un rascacielos de 48 pisos en Emiratos Árabes Unidos', 'El fuego en la Torre Abbco de 48 pisos arrojó escombros sobre estacionamientos y calles cercanas. La estructura de 190 metros (623 pies) de altura es uno de los edificios más altos en Sharjah.', '1', '2020-05-06 15:14:24', '2020-05-06 15:14:24', 'voraz-incendio-consume-un-rascacielos-de-48-pisos-en-emiratos-arabes-unidos.jpg', 'voraz-incendio-consume-un-rascacielos-de-48-pisos-en-emiratos-arabes-unidos', 0, NULL, 0, 2, NULL, '<p>El fuego en la Torre Abbco de 48 pisos arrojó escombros sobre estacionamientos y calles cercanas. La estructura de 190 metros (623 pies) de altura es uno de los edificios más altos en Sharjah.</p><p>Bomberos trabajaron en el lugar y evacuaron la torre residencial, en el emirato de Sharjah.</p><p>Los bomberos lograron evacuar a las personas que se encontraban en el interior del lugar.</p><p>Las llamas han consumido los costados de la Torre Abbco, en el emirato de Sharjah de Emiratos Árabes Unidos (EAU). El edificio de 48 pisos y 190 metros de alto es uno...</p><p>El Abbco Tower es uno de los rascacielos más importantes de Sharjah, ciudad satélite para los trabajadores de Dubái.</p><p>Un voraz incendio destruyó un rascacielos de la ciudad de Sharjah en Emiratos Árabes Unidos. Los vecinos fueron evacuados y están fuera de peligro.</p><p>Un gran incendio estalló este martes 5 de mayo en uno de los rascacielos del distrito de Al Nahda de la ciudad de Sharjah, en Emiratos Árabes Unidos (EAU) sin que se produjeran víctimas, pese a la masiva destrucción. De acuerdo con el diario Khaleej&nbsp;...</p><p>SHARJAH, EAU.- Un rascacielos se incendió el martes en EAU, y las llamas ascendieron rápidamente por los costados del edificio, tal como ha ocurrido en otros incendios recientes que involucran revestimientos inflamables. El fuego en la Torre Abbco de&nbsp;...</p><p>Al menos siete personas resultaron heridas al incendiarse un edificio residencial de 50 pisos en Sharjan, ciudad ubicada al este de Emiratos Árabes Unidos. Según informaciones difundidas en medios internacionales, el gobierno del emirato indicó que los&nbsp;...</p><p>se registró un incendio que causó graves daños en más de 40 pisos de la Torre Abbco, en el área de Al Nahda de Sharjah, una ciudad en Emiratos Árabes Unidos; la noche de este martes 5 de mayo hora local. El fuego ya fue controlado por completo, los&nbsp;...</p>', 0, 'Tendencia News'),
(125, 'Messi no para de recibir halagos en su carrera deportiva', 'Messi no para de recibir halagos en su carrera deportiva', 'Cuatro goles del astro rosarino Lionel Messi fueron incluidos entre los 50 más bellos de la historia de la Liga de Campeones, en una clasificación elaborada por la revista francesa France Football y en la que se impuso Zinedine Zidane, con la volea que le&nbsp;...', '1', '2020-05-06 15:14:25', '2020-05-06 15:14:25', 'messi-no-para-de-recibir-halagos-en-su-carrera-deportiva.jpg', 'messi-no-para-de-recibir-halagos-en-su-carrera-deportiva', 0, NULL, 0, 2, NULL, '<p>Cuatro goles del astro rosarino Lionel Messi fueron incluidos entre los 50 más bellos de la historia de la Liga de Campeones, en una clasificación elaborada por la revista francesa France Football y en la que se impuso Zinedine Zidane, con la volea que le&nbsp;...</p><p>(CRHoy.com).- La prestigiosa revista France Football escogió un gol de Zinedine Zidane como el más bello de la historia de la UEFA Champions League. Cuando se habla de goles en finales, muchos tienen en la retina la conquista que le marcó el francés&nbsp;...</p><p>Cuando Zinedine Zidane marcó de volea en la final de la Champions League en 2002, se supo de inmediato que era un gol para la historia, pero no que pasarían casi 20 años sin que alguien pudiera superarlo, al menos ante los ojos de la crítica y los&nbsp;...</p><p>El tanto de Zinedine Zidane contra el Bayer Leverkusen, en la Final del 2002, fue electo el mejor de la Champions League.</p><p>La anotación del astro francés ante el Bayer Leverkusen en la final de 2002 le permitió al Real Madrid conquistar su novena Copa de Europa.</p><p>La prestigiosa revista France Football eligió el golazo de volea que le marcó Zinedine Zidane a Bayer Leverkusen, por la final de la Champions League 2002, como &quot;el más hermoso&quot; de la historia de la competencia europea.</p><p>La prestigiosa revista deportiva France Football elaboró un ranking con los goles más hermosos registrados en la Champions. Volea de Zinedine Zidane lidera la muestra. Mira los goles.</p><p>La volea de &#39;Zizou&#39; frente al Bayer Leverkusen en Glasgow fue reconocido como el mejor gol en toda la historia de la competición.</p><p>France Football eligió a los mejores de la competencia y el del cordobés, en un PSV-Valencia, quedó entre los más destacados.</p><p>Fue una selección de la revista France Football. En el listado hubo cuatro goles de Messi y uno del cordobés Claudio &quot;Piojo&quot; López. El mejor fue uno de Zidane.</p>', 0, 'Tendencia News'),
(126, 'Día Internacional sin Dietas: Cómo nace y cuál es su mensaje', 'Día Internacional sin Dietas: Cómo nace y cuál es su mensaje', 'El 6 de mayo se celebra el Día Internacional Sin Dietas para hacer una invitación a aceptar el cuerpo humano y de la diversidad de sus formas.', '1', '2020-05-06 13:57:41', '2020-05-06 16:57:41', 'dia-internacional-sin-dietas-como-nace-y-cual-es-su-mensaje.jpg', 'dia-internacional-sin-dietas-como-nace-y-cual-es-su-mensaje', 0, NULL, 1, 2, NULL, '<p>El 6 de mayo se celebra el Día Internacional Sin Dietas para hacer una invitación a aceptar el cuerpo humano y de la diversidad de sus formas.</p><p>Por la Lic. Celeste Mazzucco Ortiz. Nutricionista. El 6 de mayo de cada año, desde 1992 con una cinta color celeste como símbolo, se celebra el “Día Internacional Sin Dietas”, para promover la aceptación del cuerpo humano y la diversidad de sus formas,&nbsp;...</p><p>Todos los años el 6 de mayo se conmemora el Día Internacional Sin Dietas. El motivo es concientizar a la población mundial sobre los riesgos de practicar regímenes alimenticios muy prohibitivos para alcanzar una forma de belleza y promover la aceptación&nbsp;...</p>', 0, 'Tendencia News'),
(127, 'Las fotos de Mía, la hija de Germán Paoloski y Sabrina Garciarena: “Bienvenida, mi amor”', 'Las fotos de Mía, la hija de Germán Paoloski y Sabrina Garciarena: “Bienvenida, mi amor”', 'En plena cuarentena, la actriz dio a luz a su tercera hija y compartió con sus seguidores de Instagram algunas imágenes de la pequeña. 6 de mayo de 2020. Compartir en FacebookCompartir; Compartir en TwitterTweet. La actriz cumplió su sueño de tener&nbsp;...', '1', '2020-05-06 12:14:33', '2020-05-06 15:14:33', 'las-fotos-de-mia-la-hija-de-german-paoloski-y-sabrina-garciarena-bienvenida-mi-amor.jpg', 'las-fotos-de-mia-la-hija-de-german-paoloski-y-sabrina-garciarena-bienvenida-mi-amor', 0, NULL, 1, 2, NULL, '<p>En plena cuarentena, la actriz dio a luz a su tercera hija y compartió con sus seguidores de Instagram algunas imágenes de la pequeña. 6 de mayo de 2020. Compartir en FacebookCompartir; Compartir en TwitterTweet. La actriz cumplió su sueño de tener&nbsp;...</p><p>Sabrina Garciarena y Germán Paoloski tuvieron a Mía y mostraron orgullosos el momento en el que la madre vio por primera vez el rostro de su hija.</p><p>Este martes no fue un día cualquiera para Germán Paoloski, quien debió dejar la conducción de El Noticiero de la Gente en manos de sus compañeros por una razón muy especial: nació su hija, Mía.</p><p>El conductor anunció la feliz noticia a través de sus compañeros de “El noticiero de la gente”. Luego, publicó una imagen en su cuenta de Instagram.</p><p>&quot;Nació Mía, está divina&quot;, dijo el conductor de el &quot;Noticiero de la gente&quot;.</p><p>Este martes al mediodía, Sabrina Garciarena dio a luz a Mía, su tercera hija, fruto de su amor con el periodista y conductor Germán Paoloski. En medio de la incertidumbre y el temor de convertirse en madre en plena pandemia por el coronavirus, la nueva&nbsp;...</p><p>Tenía muchas ganas de tener una nena después de mis dos bombones y acá está. Te amo , escribió la mamá. Pesa 3465 kg y está divina. Nació 12:08 , había adelantado el papá.</p><p>La actriz mostró el momento en que daba a luz a la pequeña, la tercera de sus hijos.</p><p>El conductor y la actriz se convirtieron en padres por tercera vez y tanto la mamá como la beba se encuentran en buen estado de salud.</p><p>El conductor de Telefe Noticias recibió a su primera hija mujer y dedicó un mensaje de amor a Sabrina Garciarena.</p>', 0, 'Tendencia News'),
(128, 'Cómo ver la última superluna del año (Luna de las Flores)', 'Cómo ver la última superluna del año (Luna de las Flores)', 'Cuál será el mejor momento para ver la superluna. Qué hacer en caso que llueva. Cuanto habrá que esperar para ver la próxima.', '1', '2020-05-07 01:17:20', '2020-05-07 01:17:20', 'como-ver-la-ultima-superluna-del-ano-luna-de-las-flores.jpg', 'como-ver-la-ultima-superluna-del-ano-luna-de-las-flores', 0, NULL, 0, 2, NULL, '<p>Cuál será el mejor momento para ver la superluna. Qué hacer en caso que llueva. Cuanto habrá que esperar para ver la próxima.</p><p>Este jueves se podrá apreciar la última superluna del año debido a que ocurrirá el perigeo, es decir, el punto de la órbita lunar más cercano a la Tierra.</p><p>En plena cuarentena por coronavirus, el cielo nos brindará un fenómeno especial: la superluna de flor o Flower Super Moon. Si está nublado, llueve o se complica por otro motivo, no hace falta ni siquiera salir al balcón o la terraza, podrás seguir este&nbsp;...</p><p>CIUDAD DE MÉXICO.- Los primeros meses de este año han traído lunas especiales que han coincidido con un cielo despejado y se pueden disfrutar a simple vista. En este mes de mayo llegará el último fenómeno que se puede ver a simple vista: la&nbsp;...</p><p>También conocida como luna llena de flores, es un fenómeno en el que este satélite natural estará muy próximo a la tierra con 99 % de su luz.</p><p>Cuando apenas comience el jueves 7 de mayor, se podrá ver la última superluna del 2020 o lo que algunos dan a llamar por su esplendoroso resplandor, la Luna llena de flor. Para poder observarla no será necesario un telescopio, ni binoculares: sólo&nbsp;...</p><p>MÉXICO.- Apenas hace unos días pudimos ser testigos del hermoso fenómeno de la superluna, mismo que se repetirá, por última vez en 2020, el 7 de mayo. Y dado que estamos encerrados en casa ¿por qué no prepararnos para disfrutarla en todo su&nbsp;...</p><p>La Luna de las Flores es la última de una serie de cuatro superlunas que se darán este año y aparecerá llena alrededor de tres días durante una hora.</p><p>La Superluna de las flores tendrá lugar durante la noche del jueves 7 de mayo, en ese momento el satélite estará más cerca de la Tierra y causará la sensación de ser más grande y brillante. El evento celeste toma su nombre en la coincidencia con la época&nbsp;...</p><p>A medida que avanza la Jornada Nacional de Sana Distancia en México por el COVID-19, también se incrementan el número de espectáculos naturales que se pueden presenciar desde la comodidad del hogar, tal es el caso de la Luna de las Flores que&nbsp;...</p>', 0, 'Tendencia News'),
(129, 'Cara Delevingne y Ashley Benson terminaron tras dos años de relación', 'Cara Delevingne y Ashley Benson terminaron tras dos años de relación', 'Las celebridades pusieron fin a su historia de amor en plena cuarentena por la pandemia del COVID-19.', '1', '2020-05-07 01:17:21', '2020-05-07 01:17:21', 'cara-delevingne-y-ashley-benson-terminaron-tras-dos-anos-de-relacion.jpg', 'cara-delevingne-y-ashley-benson-terminaron-tras-dos-anos-de-relacion', 0, NULL, 0, 2, NULL, '<p>Las celebridades pusieron fin a su historia de amor en plena cuarentena por la pandemia del COVID-19.</p><p>Así lo confirmaron fuentes cercanas a la pareja.</p><p>ESTADOS UNIDOS.- Cara Delevingne y Ashley Benson han terminado y la ex modelo se encuentra disfrutando de su soltería a lado de sus amigos, según información de E! News. Han pasado casi dos años desde que se diera a conocer que las jóvenes&nbsp;...</p><p>Tras dos años de amor, las dos famosas se separan en medio de una pandemia.</p><p>El amor no es para siempre, ya nos estamos haciendo a la idea. Quizá es por eso que no nos sorprende tanto enterarnos de que Cara Delevingne y Ashley Benson terminaron su relación después de salir durante dos años. De acuerdo con People, Cara y&nbsp;...</p><p>Una fuente aseguró que la actriz y la modelo pusieron fin a su romance tras casi dos años de noviazgo.</p><p>Ninguna de las dos ha hecho público el tema, pero Delevingne se ha refugiado estos días en su círculo de amigas íntimas.</p><p>Las estrellas de Hollywood habrían puesto punto final a su relación en las últimas semanas luego de dos años de intenso romance. Enterate de todo en la nota.</p><p>Han sido varios medios de comunicación los que han reportado la triste noticia, y recordaron que la pareja sostuvo un idílico romance por más de dos años.</p><p>Cara Delevingne y Ashley Benson, una de las parejas más populares del mundo del espectáculo juvenil, terminaron su relación tras casi dos años como pareja. Así lo confirmó la revista People, citando diferentes fuentes cercanas a la supermodelo de 27&nbsp;...</p>', 0, 'Tendencia News'),
(130, 'Impactantes fotos de Son Heung-Min en su entrenamiento militar', 'Impactantes fotos de Son Heung-Min en su entrenamiento militar', 'En el medio de la pandemia por el coronavirus, el futbolista coreano, Son Heung-Min, lleva a cabo el servicio militar obligatorio, tal como lo estipula la ley de su país y circularon las primeras imágenes de la superestrella de la Premier League inglesa entre&nbsp;...', '1', '2020-05-07 01:17:21', '2020-05-07 01:17:21', 'impactantes-fotos-de-son-heung-min-en-su-entrenamiento-militar.jpg', 'impactantes-fotos-de-son-heung-min-en-su-entrenamiento-militar', 0, NULL, 0, 2, NULL, '<p>En el medio de la pandemia por el coronavirus, el futbolista coreano, Son Heung-Min, lleva a cabo el servicio militar obligatorio, tal como lo estipula la ley de su país y circularon las primeras imágenes de la superestrella de la Premier League inglesa entre&nbsp;...</p><p>LAS PRIMERAS IMÁGENES DEL JUGADOR DEL TOTTENHAM EN LA BASE DE SEOGWIPO. Hace poco más de dos semanas, Heung-Min Son comenzó el régimen corto del servicio militar en Corea del Sur y ya salieron a la luz las primeras imágenes del&nbsp;...</p><p>El jugador del Tottenham debe cumplir con las cuatro semanas de ejercicios antes de volver a Inglaterra para sumarse a las prácticas de su equipo.</p><p>Heung-min Son, jugador del equipo inglés Tottenham, realiza su servicio militar en Corea del Sur, donde se someterá a diversas pruebas.</p><p>El atacante de Corea del Sur cumple con sus obligaciones en su país.</p><p>A la figura del Tottenham se lo vio con un casco antibalas, la cara tapada, un arma colgada en su hombro derecho y un traje camuflado, mientras realizaba tareas en la base de Seogwipo, ubicada en Jeju Island.</p><p>El jugador de 27 años aparece armado con un fusil al hombro y con un casco a prueba de balas.</p><p>Su entrenamiento militar incluye actividades como tiro con rifle, educación disciplinaria y exposición al gas lacrimógeno.</p><p>Son Heung-Min fue captado mientras realiza el servicio militar | Fotos | Coronavirus en el Mundo hoy | Curiosidades de fútbol | futbolred.com.</p><p>El 6 de abril se oficializó que Heung-Min Son debería cumplir un régimen corto en el servicio militar de Corea del Sur. Y a un mes de haberse confirmado la noticia, aparecieron las primeras imágenes del delantero del Tottenham en plena actividad.</p>', 0, 'Tendencia News'),
(131, 'Sin respuestas a su pedido de visitas, Nahir Galarza levantó la huelga de hambre', 'Sin respuestas a su pedido de visitas, Nahir Galarza levantó la huelga de hambre', 'Nahir Galarza fue condenada por el crimen de Fernando Pastorizzo en diciembre de 2017. Comentar (0). Me gusta. Me gusta. Compartir. E-mail. Twitter. Facebook. WhatsApp. Guardar. 6 de mayo de 2020 • 18:17. Nahir Galarza, la joven condenada a prisión&nbsp;...', '1', '2020-05-07 01:17:21', '2020-05-07 01:17:21', 'sin-respuestas-a-su-pedido-de-visitas-nahir-galarza-levanto-la-huelga-de-hambre.jpg', 'sin-respuestas-a-su-pedido-de-visitas-nahir-galarza-levanto-la-huelga-de-hambre', 0, NULL, 0, 2, NULL, '<p>Nahir Galarza fue condenada por el crimen de Fernando Pastorizzo en diciembre de 2017. Comentar (0). Me gusta. Me gusta. Compartir. E-mail. Twitter. Facebook. WhatsApp. Guardar. 6 de mayo de 2020 • 18:17. Nahir Galarza, la joven condenada a prisión&nbsp;...</p><p>La joven comenzó una protesta sin comer como reclamo a la suspensión de visitas.</p><p>La joven de 21 años bajó 8 kilos por no comer en protesta por no poder recibir visitas en la Unidad Penal de Mujeres de Paraná, donde cumple cla adena perpetua por haber matado a Fernando Pastorizzo.</p><p>Es debido a una negativa sobre la posibilidad de que recibiera a sus familiares. Las visitas fueron postergadas en todas las cárceles del país por el COVID-19.</p><p>La joven homicida sólo consume líquidos desde el 27 de abril pasado.</p><p>En huelga de hambre, por reclamos para recibir visitas, Nahir Galarza bajó 8 kilos desde que comenzó con la protesta en la Unidad Penal Número 6 de Mujeres de Paraná, donde se encuentra detenida por el crimen de su novio al que asesinó de dos&nbsp;...</p><p>La joven está condenada a perpetua por el crimen de su novio, Fernando Pastorizzo, ocurrido en 2017. Aseguran que bajó 8 kilos y sus padres están preocupados.</p><p>Nahir Galarza, condenada por el crimen de su ex pareja, Fernando Pastorizzo, comenzó una huelga de hambre hace nueve días como reclamo a la interrupción de las visitas en el penal. Desde que se decretó la cuarentena la joven, como el resto de los&nbsp;...</p><p>Hace 10 días que la joven esta sin comer para conseguir que ingresen las visitas. “Me niegan todo lo que pido”, sostuvo.</p><p>La joven tomó esta medida como reclamo a que se le impidiera recibir visitas en la Unidad Penal Número 6 de Mujeres de Paraná debido a la emergencia sanitaria.</p>', 0, 'Tendencia News'),
(132, 'El Gobierno provincial desmintió haber comprado alimentos con sobreprecios', 'El Gobierno provincial desmintió haber comprado alimentos con sobreprecios', 'El Ministerio de Desarrollo Social de la Provincia del Chaco desmintió la información que circula en redes sociales y portales digitales acusando al organismo de cometer irregularidades en la adquisición de módulos alimentarios, en particular, la existencia&nbsp;...', '1', '2020-05-07 01:17:21', '2020-05-07 01:17:21', 'el-gobierno-provincial-desmintio-haber-comprado-alimentos-con-sobreprecios.jpg', 'el-gobierno-provincial-desmintio-haber-comprado-alimentos-con-sobreprecios', 0, NULL, 0, 2, NULL, '<p>El Ministerio de Desarrollo Social de la Provincia del Chaco desmintió la información que circula en redes sociales y portales digitales acusando al organismo de cometer irregularidades en la adquisición de módulos alimentarios, en particular, la existencia&nbsp;...</p><p>En lo que va de la pandemia, Provincia entregó 30 mil canastas, que se suman a la tarjeta de Nación.</p>', 0, 'Tendencia News'),
(133, 'El Presidente dijo que el proyecto de ley sobre aborto &quot;está listo y preparado&quot;', 'El Presidente dijo que el proyecto de ley sobre aborto &quot;está listo y preparado&quot;', 'El presidente Alberto Fernández dijo hoy que la iniciativa sobre el aborto &quot;está lista y preparada&quot;, afirmó que no fue enviada al Parlamento &quot;porque estamos viviendo con otras urgencias&quot; y aseguró que el proyecto será enviado &quot;cuando el Congreso esté en&nbsp;...', '1', '2020-05-07 01:17:22', '2020-05-07 01:17:22', 'el-presidente-dijo-que-el-proyecto-de-ley-sobre-aborto-quotesta-listo-y-preparadoquot.jpg', 'el-presidente-dijo-que-el-proyecto-de-ley-sobre-aborto-quotesta-listo-y-preparadoquot', 0, NULL, 0, 2, NULL, '<p>El presidente Alberto Fernández dijo hoy que la iniciativa sobre el aborto &quot;está lista y preparada&quot;, afirmó que no fue enviada al Parlamento &quot;porque estamos viviendo con otras urgencias&quot; y aseguró que el proyecto será enviado &quot;cuando el Congreso esté en&nbsp;...</p><p>El presidente Alberto Fernández aseguró esta tarde que sigue &quot;comprometido&quot; con la legalización del aborto, y subrayó que la propuesta está &quot;lista&quot;, pero no la presentó en el Congreso porque existen &quot;otras urgencias&quot; en medio de la pandemia.</p><p>El presidente Alberto Fernández también expresó que desde el Gobierno preparan protocolos para flexibilizar la cuarentena a partir del 10 de mayo y descartó que los espectáculos públicos -como los partidos de fútbol- vuelvan a tener concurrencia de&nbsp;...</p><p>El presidente aseguró que sigue &quot;comprometido&quot; con la legalización de la interrupción voluntaria del embarazo.</p><p>El presidente sostuvo que la idea es presentarlo cuando el Congreso esté en condiciones de tratarlo.</p><p>El Presidente de la Nación habló, además, acerca de la próxima fase de la cuarentena que comenzará el próximo 11 de mayo. El presidente Alberto Fernández aseguró que sigue &quot;comprometido&quot; con la legalización del aborto, y subrayó que la propuesta&nbsp;...</p><p>En medio de la urgencia sanitaria a raíz de la pandemia del coronavirus, el presidente de la Nación Alberto Fernández sostuvo este miércoles que la iniciativa sobre el aborto &quot;está lista y preparada&quot;, afirmó que no fue enviada al Parlamento &quot;porque estamos&nbsp;...</p><p>El Presidente volvió a mostrarse comprometido con la norma que legaliza la interrupción voluntaria del embarazo. &quot;No la hemos enviado porque estamos con otras urgencias&quot;.</p><p>Según Alberto Fernández, las urgencias actuales por la pandemia han demorado el proyecto de ILE y otras normas.</p><p>La propuesta no fue presentada en el Congreso por la pandemia, pero el presidente se mostró comprometido con la campaña.</p>', 0, 'Tendencia News'),
(134, 'Cher estrenará versión en español de la canción “Chiquitita”, ¿Mejor que ABBA?', 'Cher estrenará versión en español de la canción “Chiquitita”, ¿Mejor que ABBA?', 'La legendaria cantante Cher ha sorprendido a sus fans con el anuncio de su versión en español del tema “Chiquitita”.', '1', '2020-05-07 01:17:22', '2020-05-07 01:17:22', 'cher-estrenara-version-en-espanol-de-la-cancion-chiquitita-mejor-que-abba.jpg', 'cher-estrenara-version-en-espanol-de-la-cancion-chiquitita-mejor-que-abba', 0, NULL, 0, 2, NULL, '<p>La legendaria cantante Cher ha sorprendido a sus fans con el anuncio de su versión en español del tema “Chiquitita”.</p><p>Se sabe que Cher lanzará este viernes 8 una versión en español de Chiquitita, clásico de ABBA. Se sabe que es a beneficio de UNICEF, que habrá videoclip, que veremos una transmisión benéfica para asistir a las víctimas de la pandemia de coronavirus.</p><p>Cher publicará el viernes a través de las plataformas digitales una versión en castellano del clásico de ABBA Chiquitita con la intención de recaudar fondos para las víctimas del covid-19. “Empecé a ensayarla a finales del año pasado. Cuando todo empezó&nbsp;...</p><p>Cher publicará el próximo viernes una versión totalmente en español del clásico Chiquitita de ABBA. El videoclip se estrenará un día después, el sábado 9, durante Unicef Won&#39;t Stop, un encuentro benéfico y virtual organizado por UNICEF para recaudar&nbsp;...</p><p>La reconocida cantante Cher, el viernes 08 de Mayo, mediante distintas plataformas digitales lanzará una versión en español del tema clásico de Abba &quot;Chiquitita&quot;, con el objetivo de recaudar fondos para las víctimas contagiadas de coronavirus. &quot;Empecé a&nbsp;...</p><p>La cantante Cher, anunció a través de redes sociales que interpretará el clásico de ABBA, “Chiquitita”, en la versión español, en beneficio a la UNICEF para el apoyo del Covid-19. Por: Redacción 06 Mayo 2020 13 49. Facebook &middot; Twitter &middot; Email&nbsp;...</p><p>Apoyará Cher a los afectados por el coronavirus. MADRID (EFE).— Cher publicará el próximo viernes a través de las plataformas digitales una versión en castellano del clásico de ABBA “Chiquitita” con la intención de recaudar fondos para las víctimas del&nbsp;...</p><p>El próximo 8 de mayo Cher publicará en las distintas plataformas digitales una versión en castellano de la icónica canción del grupo ABBA, “Chiquitita”, con la intención de recaudar fondos para ayudar a las víctimas del coronavirus. La cantante comentó&nbsp;...</p><p>La cantante estadounidense Cher interpretará el clásico de ABBA como parte de una iniciativa del Unicef para ayudar a personas afectadas por la COVID-19.</p><p>Será durante un evento benéfico virtual organizado por UNICEF para ayudar a las víctimas del coronavirus, y que se podrá seguir en streaming.</p>', 0, 'Tendencia News'),
(135, 'El Papa pide a la Virgen de Luján que interceda en este tiempo de dificultad', 'El Papa pide a la Virgen de Luján que interceda en este tiempo de dificultad', 'Pasado mañana, 8 de mayo, se celebra en la Argentina la fiesta de Nuestra Señora de Luján”, recordó el papa Francisco tras su catequesis en la audiencia general trasmitida por medios electrónicos. “Que ella, Madre de Dios y Madre nuestra, interceda por&nbsp;...', '1', '2020-05-07 01:17:22', '2020-05-07 01:17:22', 'el-papa-pide-a-la-virgen-de-lujan-que-interceda-en-este-tiempo-de-dificultad.jpg', 'el-papa-pide-a-la-virgen-de-lujan-que-interceda-en-este-tiempo-de-dificultad', 0, NULL, 0, 2, NULL, '<p>Pasado mañana, 8 de mayo, se celebra en la Argentina la fiesta de Nuestra Señora de Luján”, recordó el papa Francisco tras su catequesis en la audiencia general trasmitida por medios electrónicos. “Que ella, Madre de Dios y Madre nuestra, interceda por&nbsp;...</p><p>El Papa Francisco pidió la intercesión de la Virgen de Luján, patrona de Argentina, para superar las dificultades causadas por la pandemia de coronavirus en todo el mundo.</p><p>Por Redacción Grupo La Verdad. El próximo viernes 8 de Mayo se conmemora la solemnidad de Nuestra Señora de Luján y las diversas parroquias de la ciudad están llevando a cabo diversas actividades. Desde el día 29 de abril se está rezando la novena&nbsp;...</p>', 0, 'Tendencia News'),
(136, 'El Brad Pitt argentino que es furor en TikTok', 'El Brad Pitt argentino que es furor en TikTok', 'A pesar de que en TikTok la mayoría de los videos son sobre comedia, bailes o actuaciones, en este caso un argentino se viralizó por parecerse a Brad Pitt.', '1', '2020-05-07 01:17:23', '2020-05-07 01:17:23', 'el-brad-pitt-argentino-que-es-furor-en-tiktok.jpg', 'el-brad-pitt-argentino-que-es-furor-en-tiktok', 0, NULL, 0, 2, NULL, '<p>A pesar de que en TikTok la mayoría de los videos son sobre comedia, bailes o actuaciones, en este caso un argentino se viralizó por parecerse a Brad Pitt.</p><p>Shiloh estableció un especial vínculo con la exesposa de su padre, Brad Pitt. Ella invitó al joven a participar de uno de sus recientes proyectos actorales.</p><p>Se sabe que Shiloh, la hija de Angelina Jolie y Brad Pitt, tiene muy buena relación con Jennifer Aniston. Y según trascendió, ahora quiere decirle “mamá”.</p><p>Luciano Chierichetti es argentino y se convirtió en tendencia en Tik Tok por el enorme parecido que guarda con el actor de Hollywood Crédito: Agencias. Comentar (5). Me gusta. Me gusta. Compartir. E-mail. Twitter. Facebook. WhatsApp. Guardar. 6 de mayo&nbsp;...</p><p>El personaje ha logrado romper esta red social debido a su parecido a Brad Pitt.</p><p>Sin embargo, varios usuarios en la red social han dudado de la veracidad del parecido con el actor.</p><p>Brad Pitt es uno de los actores más cotizados de Hollywood. Con su gran talento y su increíble físico, se ha ganado el puesto entre los más grandes de la historia y acumulado una gran cantidad de seguidores. Ahora, un joven argentino, de nombre Luciano&nbsp;...</p><p>A pesar de ello, muchos usuarios de TikTok piensan que el muchacho usa un filtro para ser idéntico al actor de EE. UU.</p><p>Luciano Chierichetti se convirtió en tendencia en Tik Tok por el enorme parecido que guarda con el actor de Hollywood.</p><p>Se llama Luciano Chierichetti y los usuarios que lo vieron en TikTok enloquecieron por ser &quot;idéntico&quot; al actor.</p>', 0, 'Tendencia News'),
(137, 'Los carpinchos invadieron las redes sociales y nadie sabe por qué', 'Los carpinchos invadieron las redes sociales y nadie sabe por qué', 'El animal comenzó a ganar simpatizantes en el mundo cibernético a través de diversas publicaciones que destacan sus tiernas cualidades. Especialistas recuerdan que &quot;no son mascotas&quot;.', '1', '2020-05-07 01:17:23', '2020-05-07 01:17:23', 'los-carpinchos-invadieron-las-redes-sociales-y-nadie-sabe-por-que.jpg', 'los-carpinchos-invadieron-las-redes-sociales-y-nadie-sabe-por-que', 0, NULL, 0, 2, NULL, '<p>El animal comenzó a ganar simpatizantes en el mundo cibernético a través de diversas publicaciones que destacan sus tiernas cualidades. Especialistas recuerdan que &quot;no son mascotas&quot;.</p><p>En los últimos días se empezó una tendencia de compartir memes con un particular protagonista: el carpincho. Pero, ¿cómo llegaron estos animales a la cima de las redes sociales?</p><p>Los carpinchos invadieron las redes sociales. En los últimos días, se generaron infinidad de publicaciones donde los idolatran y hasta hay un grupo de jóvenes tucumanos que imitan el comportamiento de este simpático animalito. Las respuestas acerca de&nbsp;...</p><p>Una veterinaria cuenta su experiencia de crianza de carpinchos y desde el gobierno provincial advierten que es un delito domesticarlos o cazarlos. El recuerdo de Tincho Carpincho.</p><p>La cuarentena ya comprobó que con tal de divertirse, a la gente solo le hace falta una buena excusa para hacer que prácticamente c.</p><p>Con la cuarentena obligatoria, Internet y las redes son el &quot;refugio&quot; de miles de personas que buscan entretenerse. Pero ahora son protagonistas de una pasión de los usuarios que hasta el momento no se conocía: los carpinchos. Sí, los carpinchos.</p>', 0, 'Tendencia News'),
(138, 'Para Michel Houllebecq, el mundo poscoronavirus será &quot;un poco peor&quot;', 'Para Michel Houllebecq, el mundo poscoronavirus será &quot;un poco peor&quot;', '&quot;Sería falso afirmar que hemos redescubierto lo trágico&quot;, dijo el autor francés en una carta. Comentar (0). Me gusta. Me gusta. Compartir. E-mail. Twitter. Facebook. WhatsApp. Guardar. 6 de mayo de 2020 • 17:04. En coincidencia con Alessandro Baricco y&nbsp;...', '1', '2020-05-07 01:17:23', '2020-05-07 01:17:23', 'para-michel-houllebecq-el-mundo-poscoronavirus-sera-quotun-poco-peorquot.jpg', 'para-michel-houllebecq-el-mundo-poscoronavirus-sera-quotun-poco-peorquot', 0, NULL, 0, 2, NULL, '<p>&quot;Sería falso afirmar que hemos redescubierto lo trágico&quot;, dijo el autor francés en una carta. Comentar (0). Me gusta. Me gusta. Compartir. E-mail. Twitter. Facebook. WhatsApp. Guardar. 6 de mayo de 2020 • 17:04. En coincidencia con Alessandro Baricco y&nbsp;...</p><p>El escritor francés contemporáneo más leído en el extranjero afirma que “nunca antes la muerte fue tan discreta como en estas últimas semanas”.</p><p>El narrador francés Michel Houellebecq cree que el mundo poscoronavirus será el mismo, “pero un poco peor”. “No creo ni por un segundo en las declaraciones de tipo &#39;nada será como antes&#39;. Al contrario, creo que será exactamente igual”, dijo ayer el&nbsp;...</p><p>El último maldito de la literatura francesa, cronista despiadado de la decadencia de la sociedad occidental del siglo XXI, no tiene ninguna esperanza en el futuro. La pandemia de Covid-19 –que en Francia supera los 25.000 mil muertos- no será una&nbsp;...</p><p>El más influyente de los narradores franceses de la actualidad publicó este lunes una carta en la que reflexiona sobre las consecuencias del coronavirus. El impacto del confinamiento en la escritura, la confirmación de la tendencia de una “obsolescencia en&nbsp;...</p><p>El escritor francés, en una carta pública titulada “Será peor”, se refirió al coronavirus y el confinamiento: &quot;Hay que admitirlo: la mayoría de los correos electrónicos intercambiados en las últimas semanas tenían como objetivo principal comprobar que el&nbsp;...</p><p>&quot;No creo ni por un segundo en las declaraciones de tipo &#39;nada será como antes&#39;. Al contrario, creo que será exactamente igual&quot;, dijo el reconocido escritor frances Michel Houellebecq.</p><p>Este lunes, el más influyente de los narradores franceses de la actualidad publica publicó una carta en la que reflexiona sobre las consecuencias de la pandemia y el impacto del confinamiento en la escritura. “La muerte nunca ha sido tan discreta como en&nbsp;...</p><p>El escritor francés Michel Houellebecq no cree en absoluto que el mundo poscoronavirus vaya a ser diferente; al contrario, cree que será el mismo, &quot;pero un poco peor&quot;.</p><p>El escritor francés Michel Houellebecq considera que el mundo postcoronavirus no va a ser diferente o mejor sino, por el contrario &quot;será igual y todavía un poco peor&quot;, según un texto escrito para la radio pública France Inter con el que decidió romper su&nbsp;...</p>', 0, 'Tendencia News'),
(139, 'Explosivo: Jorge Rial reveló que Marcos Peña pidió la salida de Nelson Castro de TN', 'Explosivo: Jorge Rial reveló que Marcos Peña pidió la salida de Nelson Castro de TN', 'El conductor de Intrusos contó que, tras una pregunta del periodista que incomodó al exjefe de Gabinete, pidieron que lo corran del noticiero.', '1', '2020-05-07 01:17:23', '2020-05-07 01:17:23', 'explosivo-jorge-rial-revelo-que-marcos-pena-pidio-la-salida-de-nelson-castro-de-tn.jpg', 'explosivo-jorge-rial-revelo-que-marcos-pena-pidio-la-salida-de-nelson-castro-de-tn', 0, NULL, 0, 2, NULL, '<p>El conductor de Intrusos contó que, tras una pregunta del periodista que incomodó al exjefe de Gabinete, pidieron que lo corran del noticiero.</p><p>El conductor de Intrusos revelò las internas del noticiero de El Trece y contò el pedido del ex jefe de Gabinete a las autoridades del canal.</p><p>Los movientos internos dentro del Grupo Clarín no siempre son claros, pero esta vez, se filtró un dato sobre los cambios en los roles periodísticos. Según.</p>', 0, 'Tendencia News'),
(140, 'PlayStation revela un nuevo tráiler sobre &quot;The Last of Us Part II&quot;', 'PlayStation revela un nuevo tráiler sobre &quot;The Last of Us Part II&quot;', '&#39;The Last of Us Part II&#39;, llega a las tiendas el próximo 19 de junio.', '1', '2020-05-07 01:17:24', '2020-05-07 01:17:24', 'playstation-revela-un-nuevo-trailer-sobre-quotthe-last-of-us-part-iiquot.jpg', 'playstation-revela-un-nuevo-trailer-sobre-quotthe-last-of-us-part-iiquot', 0, NULL, 0, 2, NULL, '<p>&#39;The Last of Us Part II&#39;, llega a las tiendas el próximo 19 de junio.</p><p>La historia de The Last of Us Part II para PS4 se revela en el tráiler oficial centrado en Ellie. Las escenas muestran tanto jugabilidad como cinemáticas.</p><p>The Last of Us Part II ya casi está aquí. La secuela del exitoso y popular juego de los estudios de Naughty Dog llegará siete años más tarde, y su último tráiler nos da un pequeño vistazo a la que parece que será una historia llena de terror y tensión para Ellie&nbsp;...</p><p>También se reveló la fecha de lanzamiento del esperado videojuego.</p><p>El esperado juego fue anunciado por PlayStation para el 19 de junio, exclusivo para la consola de Sony.</p><p>Da igual lo que hayas visto o leído, nada es comparable con jugarlo”, dijo Neil Druckmann, el director de Naughty Dog, el estudio que el próximo 19 de junio lanzará The Last of Us Part II.</p><p>Semanas después de que se filtrara casi toda la narrativa de The Last of Us Part II y que Naughty Dog decidiera anunciar su fecha de lanzamiento solo...</p><p>El nuevo trailer de The Last of Us Part II ya está aquí, y nos revela una historia oscura, pesada, y llena de odio y venganza.</p><p>El juego The Last of Us Part II llegará a PlayStation 4 el 19 de junio del 2020.</p><p>Naughty Dog comparte el nuevo tráiler de The Last of Us Part II en donde conoceremos más de la historia.</p>', 0, 'Tendencia News'),
(141, 'Así ardió la Torre Abbco en Emiratos Árabes: pedazos de edificio en llamas caían sobre autos', 'Así ardió la Torre Abbco en Emiratos Árabes: pedazos de edificio en llamas caían sobre autos', 'Emiratos Árabes.- Un de los edificios más altos de Emiratos Árabes se ha incendiado este martes, indicaron autoridades locales. El rascacielos siniestrado tenía una altura de 190 metros y contaba con 48 pisos. Las imágenes en redes sociales difundidas&nbsp;...', '1', '2020-05-07 04:59:30', '2020-05-07 07:59:30', 'asi-ardio-la-torre-abbco-en-emiratos-arabes-pedazos-de-edificio-en-llamas-caian-sobre-autos.jpg', 'asi-ardio-la-torre-abbco-en-emiratos-arabes-pedazos-de-edificio-en-llamas-caian-sobre-autos', 0, NULL, 1, 2, NULL, '<p>Emiratos Árabes.- Un de los edificios más altos de Emiratos Árabes se ha incendiado este martes, indicaron autoridades locales. El rascacielos siniestrado tenía una altura de 190 metros y contaba con 48 pisos. Las imágenes en redes sociales difundidas&nbsp;...</p><p>La Torre Abbco había sido inaugurada en 2006 y medía 190 metros. Fuente: Twitter. 00:52. Video. Comentar (1). Me gusta. Me gusta. Compartir. E-mail. Twitter. Facebook. WhatsApp. Guardar. 6 de mayo de 2020 • 08:50. SHARJAH (AP).- Un rascacielos se&nbsp;...</p><p>Un incendio de grandes proporciones se desató este martes en un rascacielos residencia de 48 pisos en el emirato de Sharjah, en el este de Emiratos Árabes Unidos (EAU), y siete personas resultaron heridas.</p><p>SHARJAH, Emiratos Árabes Unidos — Un rascacielos se incendió el martes en Emiratos Árabes Unidos, y las llamas ascendieron rápidamente por los costados del edificio, tal como ha ocurrido en otros incendios recientes que involucran revestimientos&nbsp;...</p><p>El edificio fue inaugurado en 2006 y se tuvo que recurrir a drones especiales para atacar las llamas desde las.</p><p>Bomberos trabajaron en el lugar y evacuaron la torre residencial, en el emirato de Sharjah.</p><p>Un gigantesco incendio afectó el martes a uno de l