(142, 'Germán Paoloski habló desde la clínica y mostró a Mía, su hija junto a Sabrina Garciarena', 'Germán Paoloski habló desde la clínica y mostró a Mía, su hija junto a Sabrina Garciarena', 'Este martes 6, en El noticiero del mediodía (Telefe) tocó el turno de dar una noticia muy especial. Es que Germán Paoloski, su conductor, se comunicó por videollamada para presentar a Mía, su primera hija mujer (ya tiene a los varones León y Beltrán) junto&nbsp;...', '1', '2020-05-07 01:17:24', '2020-05-07 01:17:24', 'german-paoloski-hablo-desde-la-clinica-y-mostro-a-mia-su-hija-junto-a-sabrina-garciarena.jpg', 'german-paoloski-hablo-desde-la-clinica-y-mostro-a-mia-su-hija-junto-a-sabrina-garciarena', 0, NULL, 0, 2, NULL, '<p>Este martes 6, en El noticiero del mediodía (Telefe) tocó el turno de dar una noticia muy especial. Es que Germán Paoloski, su conductor, se comunicó por videollamada para presentar a Mía, su primera hija mujer (ya tiene a los varones León y Beltrán) junto&nbsp;...</p><p>La tercera hija de la pareja nació en medio del aislamiento social. En Instagram, ambos publicaron fotos de la recién nacida y parto.</p><p>Los flamantes padres compartieron imágenes de la beba recién nacida Crédito: Instagram. Comentar (0). Me gusta. Me gusta. Compartir. E-mail. Twitter. Facebook. WhatsApp. Guardar. 6 de mayo de 2020 • 09:21. Mientras el mundo sigue suspendido por la&nbsp;...</p><p>Minutos después de que naciera, sus padres publicaron fotos en las redes sociales.</p><p>En plena cuarentena, la actriz dio a luz a su tercera hija y compartió con sus seguidores de Instagram algunas imágenes de la pequeña. 6 de mayo de 2020. Compartir en FacebookCompartir; Compartir en TwitterTweet. La actriz cumplió su sueño de tener&nbsp;...</p><p>Pura ternura! A través de las redes sociales, el periodista y la actriz compartieron postales de la recién nacida a modo de presentación pública. ¡Mirá!</p><p>La pequeña nació ayer y pesó 3465 kg. Es la tercera hija del matrimonio que conforman la actriz y el conductor.</p><p>El conductor publicó una imagen en su cuenta de Instagram. Junto a la actriz Sabrina Garciarena ya son padres de Beltrán, de seis años, y León, de tres.</p><p>El periodista compartió la primera imagen de la nena y le dedicó unas tiernas palabras.</p><p>Mía nació el martes en plena cuarentena y sus padres compartieron fotos del inolvidable momento.</p>', 0, 'Tendencia News'),
(143, 'El Racing que ganó el PRODE es documental', 'El Racing que ganó el PRODE es documental', 'Cada 6 de mayo se abre el baúl de los recuerdos. Aún parece impensado, mucho más si se mira a la distancia. Un día como hoy pero 36 años atrás, el plantel de Racing de Córdoba consiguió lo que todo el país quería: ganar el PRODE y, por consiguiente,&nbsp;...', '1', '2020-05-07 01:17:25', '2020-05-07 01:17:25', 'el-racing-que-gano-el-prode-es-documental.jpg', 'el-racing-que-gano-el-prode-es-documental', 0, NULL, 0, 2, NULL, '<p>Cada 6 de mayo se abre el baúl de los recuerdos. Aún parece impensado, mucho más si se mira a la distancia. Un día como hoy pero 36 años atrás, el plantel de Racing de Córdoba consiguió lo que todo el país quería: ganar el PRODE y, por consiguiente,&nbsp;...</p><p>Una producción cordobesa creó el documental con el apoyo del Polo Audiovisual. Quedó clasificada para un festival en Barcelona tras participar de una selección en Dinamarca. Entrá y mirá el tráiler.</p><p>El material de la productora “Ideas por Rosca” cuenta la historia del día en que el plantel académico se ganó el Prode con su victoria ante Ferro. El video con los avances.</p><p>El plantel conducido por Marchetta había acertado 12 partidos y le quedaba uno solo... ¡el que disputaba con Ferro! Conocé la historia que pasó un 6 de mayo, hace 36 años.</p><p>Hoy se cumplen 36 años de la noche en la que los jugadores de Racing de Córdoba enfrentaron a Ferro Carril Oeste sabiendo que, si ganaban el partido, también se llevarían el Prode.</p><p>Una productora cordobesa participó de un festival en Copenhague con el film sobre aquella historia del plantel de &quot;La Academia&quot; en el &#39;84, con buenas críticas. Quedó seleccionado en Barcelona.</p><p>Fue una de las historias más pintorescas de los tiempos del PRODE, cuando los jugadores de la Academia dependieron de sí mismos para alcanzar la recompensa, la cual estuvo lejos de lo que esperaban.</p><p>Se cumplirán este miércoles 36 años de una de las historias más pintorescas de los tiempos del concurso de Pronósticos Deportivos (Prode), cuando los jugadores de Racing de Córdoba dependieron de sí mismos para alcanzar el total de 13 puntos y en&nbsp;...</p><p>Mañana se cumplen 36 años de una historia magnífica. Roberto Gasparini, el “Pato”, marcó para la academia cordobesa el gol decisivo mediante un portentoso tiro libre ejecutado a cinco minutos del final.</p><p>Una productora cordobesa llegó a un festival en Copenhague promoviendo la particular historia que se registró en 1984. 6 de mayo de 2020. Compartir en FacebookCompartir; Compartir en TwitterTweet. Play. El documental Prode. Corría la década del 80 y&nbsp;...</p>', 0, 'Tendencia News'),
(144, 'Se incendió una pesquera en Madryn: graves daños materiales pero no heridos', 'Se incendió una pesquera en Madryn: graves daños materiales pero no heridos', 'Alrededor de las 15 de este miércoles, los Bomberos de Puerto Madryn debieron combatir un importante incendio desatado en una planta pesquera. Ocurrió sobre la calle Bolivia, propiedad de la firma Food Partners Patagonia. Según las primeras&nbsp;...', '1', '2020-05-07 01:17:25', '2020-05-07 01:17:25', 'se-incendio-una-pesquera-en-madryn-graves-danos-materiales-pero-no-heridos.jpg', 'se-incendio-una-pesquera-en-madryn-graves-danos-materiales-pero-no-heridos', 0, NULL, 0, 2, NULL, '<p>Alrededor de las 15 de este miércoles, los Bomberos de Puerto Madryn debieron combatir un importante incendio desatado en una planta pesquera. Ocurrió sobre la calle Bolivia, propiedad de la firma Food Partners Patagonia. Según las primeras&nbsp;...</p><p>Esta tarde, poco después de las 14.30 en el parque industrial liviano de Madryn, en la planta pesquera de la empresa Food Partners se desató un incendio que arrasó totalmente las obras de ampliación de las cámaras de congelados. Según una versión, el&nbsp;...</p><p>Se trata de un siniestro de importantes dimensiones que se registró este miércoles cerca de las 15 en el Parque Industrial Liviano de Puerto Madry, así lo indicó Radio 3 cadena patagonia. Allí se apersonaron tres dotaciones de Bomberos Voluntarios para&nbsp;...</p><p>Pasado el mediodía se registró un incendio en una empresa pesquera de la localidad de Puerto Madryn. Se trataría de Food Partner, que tiene uno de sus galpones ubicado en la zona del Parque Industrial de la ciudad portuaria. Por el momento se&nbsp;...</p><p>En la reunión de trabajo se elaboró un cuadro de situación actual y se trazaron lineamientos a seguir «en pos del progreso, tanto de la actividad portuaria, como también de las actividades industriales y comerciales que de ella se desprenden». El titular de&nbsp;...</p><p>VIDEOS | El fuego se inició cerca de las 15 hs en la pesquera Food Partners, ubicada en el Parque Industrial Liviano. Bomberos trabaja en el lugar.</p><p>El siniestro se desató este miércoles por la tarde en la firma Food Partners y trabajan tres dotaciones de bomberos.</p><p>Alrededor de las 15 de este miércoles, los Bomberos de Puerto Madryn debieron combatir un importante incendio desatado en una planta pesquera que al momento del siniestro se encontraba desahabitada, debido a los protocolos por el Covid-19 que por&nbsp;...</p>', 0, 'Tendencia News');
