(145, 'Murió Florian Schneider, cofundador de Kraftwerk, banda pionera de la música electrónica', 'Murió Florian Schneider, cofundador de Kraftwerk, banda pionera de la música electrónica', 'No se vería como una falta de respeto decir, cibermetafóricamente, que con la muerte de uno de los fundadores de Kraftwerk, Florian Schneider-Esleben, se le desenchufó un cable a los pioneros de la música electrónica. El grupo alemán fue el primero que&nbsp;...', '1', '2020-05-07 02:29:49', '2020-05-07 05:29:49', 'murio-florian-schneider-cofundador-de-kraftwerk-banda-pionera-de-la-musica-electronica.jpg', 'murio-florian-schneider-cofundador-de-kraftwerk-banda-pionera-de-la-musica-electronica', 0, NULL, 1, 2, NULL, '<p>No se vería como una falta de respeto decir, cibermetafóricamente, que con la muerte de uno de los fundadores de Kraftwerk, Florian Schneider-Esleben, se le desenchufó un cable a los pioneros de la música electrónica. El grupo alemán fue el primero que&nbsp;...</p><p>Florian Schneider, fundador de los alemanes Kraftwerk, pioneros de la música electrónica, murió este miércoles a los 73 años Crédito: Europa Press. Comentar (0). Me gusta. Me gusta. Compartir. E-mail. Twitter. Facebook. WhatsApp. Guardar. 6 de mayo de&nbsp;...</p><p>Schneider es considerado uno de los pioneros de la música electrónica en el mundo. En 2014, la banda de Düsseldorf ganó el exclusivo premio Grammy a la carrera artística.</p><p>Fue uno de los pioneros en experimentar con sintetizadores y máquinas. Había creado Kraftwerk en 1968 pero había abandonado la banda hace una década. Murió en Berlín, a los 73 años, tras padecer...</p><p>Las mezclas de ritmos y estilos de la banda influyó a cientos de músicos de finales del siglo XX e inicios del XXI.</p><p>El músico alemán tuvo una larga lucha contra el cáncer. Es considerado, junto a Ralf Hütter -con quien fundó la agrupación-, uno de los pioneros de la música electrónica.</p><p>Uno de los cofundadores del grupo alemán pionero en música electrónica, Kraftwerk, Florian Schneider-Esleben, murió a los 73 años, informó a la AFP este miércoles una mánager de la formación. &quot;Florian Schneider murió a causa de un cáncer fulminante&nbsp;...</p><p>El músico alemán Florian Schneider, fundador de la mítica banda de música electrónica Kraftwerk, murió en Berlín a los 73 años a consecuencia de un cáncer. Schneider tocó el sintetizador, el vocoder, la flauta, el saxofón y más, así como tuvo también el rol&nbsp;...</p><p>Florian Schneider, músico alemán cofundador de la legendaria banda de música electrónica Kraftwerk, murió a los 73 años a causa de un cáncer. El artista fundó el grupo junto a Ralf Hütter en 1970, dos años después de que se conocieran en la Academia&nbsp;...</p><p>El músico alemán, fundador de la mítica banda de música electrónica &quot;Kraftwerk&quot;, murió en Berlín a los 73 años a consecuencia de un cáncer, informaron este miércoles fuentes de la compañía discográfica Sony.</p>', 0, 'Tendencia News'),
(146, 'Café dalgona: cómo se hace el batido que es furor en redes durante la cuarentena', 'Café dalgona: cómo se hace el batido que es furor en redes durante la cuarentena', 'Para los fanáticos del café llegó una nueva tendencia que surgió en Corea del Sur, cuando el país asiático entró en cuarentena por el brote del coronavirus. Este café tiene aspecto cremoso y dulce y se convirtió en la última obsesión de Internet,&nbsp;...', '1', '2020-05-07 01:17:26', '2020-05-07 01:17:26', 'cafe-dalgona-como-se-hace-el-batido-que-es-furor-en-redes-durante-la-cuarentena.jpg', 'cafe-dalgona-como-se-hace-el-batido-que-es-furor-en-redes-durante-la-cuarentena', 0, NULL, 0, 2, NULL, '<p>Para los fanáticos del café llegó una nueva tendencia que surgió en Corea del Sur, cuando el país asiático entró en cuarentena por el brote del coronavirus. Este café tiene aspecto cremoso y dulce y se convirtió en la última obsesión de Internet,&nbsp;...</p><p>Café Dalgona, el batido de Nutella y el batido de Oreo tienen versiones saludables y nutritivas gracias a un experto en nutrición. Pruébalas con menos calorías.</p>', 0, 'Tendencia News'),
(147, 'El video de Onur y Sherazade al ritmo del jazz, que cautiva a sus fans', 'El video de Onur y Sherazade al ritmo del jazz, que cautiva a sus fans', 'Halit y Bergüzar, al ritmo de sus raíces. 05:03. Video. Comentar (0). Me gusta. Me gusta. Compartir. E-mail. Twitter. Facebook. WhatsApp. Guardar. 6 de mayo de 2020 • 10:44. Después de verlos juntos en Las mil y una noche y en Mi vida eres tu, Halit Ergenç&nbsp;...', '1', '2020-05-06 22:21:33', '2020-05-07 01:21:33', 'el-video-de-onur-y-sherazade-al-ritmo-del-jazz-que-cautiva-a-sus-fans.jpg', 'el-video-de-onur-y-sherazade-al-ritmo-del-jazz-que-cautiva-a-sus-fans', 0, NULL, 1, 2, NULL, '<p>Halit y Bergüzar, al ritmo de sus raíces. 05:03. Video. Comentar (0). Me gusta. Me gusta. Compartir. E-mail. Twitter. Facebook. WhatsApp. Guardar. 6 de mayo de 2020 • 10:44. Después de verlos juntos en Las mil y una noche y en Mi vida eres tu, Halit Ergenç&nbsp;...</p><p>Los actores turcos Halit Ergenç y Bergüzar Korel, protagonistas de la teleserie &quot;Las mil y una noches&quot;, se lucieron en &quot;Son Mektup&quot;.</p><p>Halit Ergenç, conocido por su personaje de Onur en &quot;Las mil y una noche&quot;, participó en un videoclip de su pareja, Bergüzar Korel, quien personificó a Sherazade en la ficción turca que se transmitió en El Trece. ¡Entrá a la nota!</p><p>Ellos se enamoraron haciendo la telenovela Las mil y una noches. Y el público se enamoró de ellos como pareja. Al principio, por la intrincada historia de encuentros y desencuentros de sus personajes, Onur y Sherazade, en la tira que hoy vuelve a verse&nbsp;...</p><p>Los protagonistas de Las mil y una noches conquistaron a sus seguidores con un videoclip musical juntos.</p><p>Hace unos años los argentinos nos enamoramos de lo que era en ese tiempo una novedad para nosotros: las novelas turcas. Caracterizadas por una carga emotiva importante, sin dudas una de las historias que más quedó registrada en la memoria de los&nbsp;...</p><p>Los protagonistas de “Las mil y una noches”, participaron de la producción de un videoclip para un tema musical. Por: Medios. Bergüzar Korel y Halit Ergenç se conocieron interpretando a Onur y Sherezade en la novela turca Las mil y una noches y al poco&nbsp;...</p><p>La protagonista de “Las mil y una noches”, Bergüzar Korel, invitó a su marido, Halit Ergenç, a participar del clip del clásico tema turco “Son Mektup” que ella interpreta. 5 de mayo de 2020. Compartir en FacebookCompartir; Compartir en TwitterTweet. Play.</p><p>&quot;Onur&quot; y &quot;Sherezade&quot;, los protagonistas de la famosa serie turca, participaron de la producción de un videoclip para un tema musical.</p><p>La protagonista de Las mil y una noches, Bergüzar Korel, invitó a su marido, Halit Ergenç, a participar del videoclip del tema turco “Son Mektup”.</p>', 0, 'Tendencia News'),
(148, '&#39;Riverdale&#39;, la serie que adelantó su final por culpa de covid-19', '&#39;Riverdale&#39;, la serie que adelantó su final por culpa de covid-19', 'este 6 de mayo termina la cuarta temporada de la famosa serie. Protagonista habla de su experiencia.', '1', '2020-05-07 01:17:26', '2020-05-07 01:17:26', '39riverdale39-la-serie-que-adelanto-su-final-por-culpa-de-covid-19.jpg', '39riverdale39-la-serie-que-adelanto-su-final-por-culpa-de-covid-19', 0, NULL, 0, 2, NULL, '<p>este 6 de mayo termina la cuarta temporada de la famosa serie. Protagonista habla de su experiencia.</p><p>The CW confirmó cuando se estrena el último episodio y quién será su directora.</p><p>Riverdale estrena el último episodio de su cuarta temporada miércoles 6 de mayo, a las 20.30 horas (MEX). Primero en Warner Channel.</p>', 0, 'Tendencia News'),
(149, 'El peligro de abusar de la comida en lata (conservas) y cómo disminuirlo', 'El peligro de abusar de la comida en lata (conservas) y cómo disminuirlo', 'La comida en lata es una buena opción para aquellos que no tienen tanto tiempo para cocinar o, simplemente, no les gusta mucho.', '1', '2020-05-07 01:17:26', '2020-05-07 01:17:26', 'el-peligro-de-abusar-de-la-comida-en-lata-conservas-y-como-disminuirlo.jpg', 'el-peligro-de-abusar-de-la-comida-en-lata-conservas-y-como-disminuirlo', 0, NULL, 0, 2, NULL, '<p>La comida en lata es una buena opción para aquellos que no tienen tanto tiempo para cocinar o, simplemente, no les gusta mucho.</p>', 0, 'Tendencia News'),
(150, 'La asombrosa técnica de Federico Molinari para sacar el lingote que sorprendió a Guido Kaczka: &quot;¡De no creer!&quot;', 'La asombrosa técnica de Federico Molinari para sacar el lingote que sorprendió a Guido Kaczka: &quot;¡De no creer!&quot;', 'El atleta sorprendió a todos con su curiosa técnica para sacar el lingote de plata Crédito: Captura de video. Comentar (0). Me gusta. Me gusta. Compartir. E-mail. Twitter. Facebook. WhatsApp. Guardar. 6 de mayo de 2020 • 15:32. Federico Molinari , el&nbsp;...', '1', '2020-05-06 22:20:24', '2020-05-07 01:20:24', 'la-asombrosa-tecnica-de-federico-molinari-para-sacar-el-lingote-que-sorprendio-a-guido-kaczka-quotde-no-creerquot.jpg', 'la-asombrosa-tecnica-de-federico-molinari-para-sacar-el-lingote-que-sorprendio-a-guido-kaczka-quotde-no-creerquot', 0, NULL, 1, 2, NULL, '<p>El atleta sorprendió a todos con su curiosa técnica para sacar el lingote de plata Crédito: Captura de video. Comentar (0). Me gusta. Me gusta. Compartir. E-mail. Twitter. Facebook. WhatsApp. Guardar. 6 de mayo de 2020 • 15:32. Federico Molinari , el&nbsp;...</p><p>El atleta olímpico Federico Molinari estuvo en Bienvenidos a bordo, el programa de juegos que conduce Guido Kazcka en eltrece. El joven se animó a la prueba del lingote y sorprendió a todos con su técnica para sacarlo.</p><p>Antes de sorprender a Guido Kaczka (42) con una impecable vertical, una limpia medialuna y una improvisada vuelta mortal hacia atrás, el atleta olímpico Federico Molinari (36) dejó sin palabras al conductor de Bienvenidos a bordo (El Trece, a las 22) al&nbsp;...</p><p>Federico Molinari revolucionó la gimnasia artística argentina y trascendió las fronteras del deporte. Trabajó con Flavio Mendoza, llegó a participar del Bailando por un sueño, la rompió en el programa Combate y ahora volvió a demostrar sus habilidades en&nbsp;...</p><p>El gimnasta Federico Molinari estuvo como invitado en el programa de Guido Kaczka, “Bienvenidos a Bordo” (eltrece) y allí sorprendió a todos con sus grandes habilidades físicas. Molinari se dispuso a jugar al juego del lingote: dentro de una caja&nbsp;...</p><p>Federico Molinari, el reconocido gimnasta argentino, participó del programa que conduce Guido Kaczka y se animó a sacar el ansiado lingote.</p><p>Federico Molinari, uno de los deportistas más destacados del país, estuvo como invitado en el programa de Guido Kaczka y desplegó una increíble técnica para sacar el lingote. Uno de los juegos de Bienvenidos a Bordo consiste en quitar por un pequeño&nbsp;...</p><p>Federico Molinari , el gimnasta argentino especialista en anillas, sorprendió a todos con su particular método para sacar el lingote de plata de la caja de cristal en Bienvenidos a bordo . El atleta dejó boquiabierto a Guido Kaczka y a Noelia Marzol , que lo&nbsp;...</p><p>El gimnasta argentino especialista en anillas ganó el juego empleando una estrategia poco convencional y se llevó todos los aplausos.</p><p>Sacar el lingote de la caja de cristal es una de las pruebas más difíciles de Bienvenidos a bordo, y la mayoría de los participantes han sido sorprendidos por el cronómetro sin lograrlo.</p>', 0, 'Tendencia News'),
(151, 'Ariana Grande revela sus nuevos tatuajes, ¿qué significan?', 'Ariana Grande revela sus nuevos tatuajes, ¿qué significan?', 'Ariana Grande, la mujer con más seguidores en Instagram, dejó ver por primera vez completamente sus dos nuevos tatuajes.', '1', '2020-05-07 00:01:55', '2020-05-07 03:01:55', 'ariana-grande-revela-sus-nuevos-tatuajes-que-significan.jpg', 'ariana-grande-revela-sus-nuevos-tatuajes-que-significan', 0, NULL, 4, 2, NULL, '<p>Ariana Grande, la mujer con más seguidores en Instagram, dejó ver por primera vez completamente sus dos nuevos tatuajes.</p><p>Desde que se estrenara como cantante, Ariana Grande no deja de causar conmoción entre el ejército de fanáticos, que constantemente se mantienen al tanto de sus más recientes noticias y acontecer, siempre cargado de sorpresas e intrigas relacionadas a&nbsp;...</p><p>Ariana Grande y Justin Bieber anunciaron en sus redes, el pasado 30 de abril, un proyecto musical que tiene como fecha de estreno este viernes 8 de mayo. No es la primera vez que los artistas se unen para una canción. Ambos de por sí son buenos&nbsp;...</p>', 0, 'Tendencia News'),
(152, '5 de mayo de 2020: ¡Tiempo de prueba, tiempo de Evangelio!', '5 de mayo de 2020: ¡Tiempo de prueba, tiempo de Evangelio!', 'Este martes 5 de mayo, de la cuarta semana de Pascua, el padre Johan Pacheco reflexiona acerca de cómo Jesús nos invita a reconocerlo escuchando su ...', '1', '2020-05-07 01:17:28', '2020-05-07 01:17:28', '5-de-mayo-de-2020-tiempo-de-prueba-tiempo-de-evangelio.jpg', '5-de-mayo-de-2020-tiempo-de-prueba-tiempo-de-evangelio', 0, NULL, 0, 2, NULL, '<p>Este martes 5 de mayo, de la cuarta semana de Pascua, el padre Johan Pacheco reflexiona acerca de cómo Jesús nos invita a reconocerlo escuchando su ...</p><p>“Ustedes no creen porque no son ovejas mías.” Ser oveja de Jesús, ser parte del rebaño, es creer como Jesús. Más que creer en él, se trata de creer como él. Es hacer lo mismo que él hizo. Jesús revela al Padre por medio de las obras que él hace, las obras&nbsp;...</p><p>Se celebraba en Jerusalén la fiesta de la Dedicación del templo. Era invierno, y Jesús se paseaba en el templo por el pórtico de Salomón. Los judíos, rodeándolo, le preguntaban: “¿Hasta cuándo nos vas a tener en suspenso? Si tú eres el Mesías, dínoslo&nbsp;...</p>', 0, 'Tendencia News'),
(153, '“Lo importante es estar clasificada a Tokio”', '“Lo importante es estar clasificada a Tokio”', 'Si la pandemia del Covid-19 no hubiese afectado a gran parte de la población mundial, hoy Paula Pareto ya tendría la certeza de si su boleto para estar en los Juegos Olímpicos de Tokio ya estaba asegurado. Obviamente todo el deporte se vio obligado a&nbsp;...', '1', '2020-05-07 02:06:33', '2020-05-07 05:06:33', 'lo-importante-es-estar-clasificada-a-tokio.jpg', 'lo-importante-es-estar-clasificada-a-tokio', 0, NULL, 8, 2, NULL, '<p>Si la pandemia del Covid-19 no hubiese afectado a gran parte de la población mundial, hoy Paula Pareto ya tendría la certeza de si su boleto para estar en los Juegos Olímpicos de Tokio ya estaba asegurado. Obviamente todo el deporte se vio obligado a&nbsp;...</p><p>La mejor judoca argentina de la historia no pierde el tiempo y se desafía constantemente con duros ejercicios.</p><p>Paula Pareto está entrenando a full y en sus redes muestra un sinfín de ejercicios dificilísimos de hacer. Llevando a cabo estas pruebas, la deportista deja en claro el poder de una atleta de élite, así que... ¡ojo si lo hacés en casa! En su nuevo desafío,&nbsp;...</p>', 0, 'Tendencia News'),
(154, 'Coronavirus en Argentina: cuáles son las enfermedades previas que más potenciaron el riesgo de los infectados en el ...', 'Coronavirus en Argentina: cuáles son las enfermedades previas que más potenciaron el riesgo de los infectados en el ...', 'Parecía improbable que en el corto plazo se volviera a hablar de alguna enfermedad por fuera del coronavirus, pero a casi 50 días de la cuarentena, cuando la pandemia lleva dos meses en el país y más de 5.000 casos registrados, empieza a despejarse&nbsp;...', '1', '2020-05-07 00:10:36', '2020-05-07 03:10:36', 'coronavirus-en-argentina-cuales-son-las-enfermedades-previas-que-mas-potenciaron-el-riesgo-de-los-infectados-en-el.jpg', 'coronavirus-en-argentina-cuales-son-las-enfermedades-previas-que-mas-potenciaron-el-riesgo-de-los-infectados-en-el', 0, NULL, 6, 2, NULL, '<p>Parecía improbable que en el corto plazo se volviera a hablar de alguna enfermedad por fuera del coronavirus, pero a casi 50 días de la cuarentena, cuando la pandemia lleva dos meses en el país y más de 5.000 casos registrados, empieza a despejarse&nbsp;...</p><p>A casi un mes de la cuarentena impuesta a raíz de la pandemia de Covid-19, autoridades sanitarias realizaron relevamientos y pudieron establecer qué patologías específicas -por fuera de la edad- ejercen los peores efectos en quienes se contagian de&nbsp;...</p><p>Los Ministerios de Salud de la ciudad y de la provincia de Buenos Aires hicieron un relevamiento de cuáles son las enfermedad crónicas más habituales en las víctimas mortales del virus.</p>', 0, 'Tendencia News'),
(155, 'Coronavirus: el Gobierno no logra comprar alimentos y peligra el abastecimiento', NULL, 'Los depósitos están vacíos y en medio de la crisis por el coronavirus , las ollas de los comedores también. Mientras, la burocracia estatal no puede resolver algo que parece obvio. El Estado no puede comprar alimentos al mismo precio que lo hace cualquier particular. Increíble, pero le cobran más.', '1', '2020-05-07 02:55:19', '2020-05-07 05:55:19', '155_TRZUlM4PN5MoZxks.jpg', 'coronavirus-el-gobierno-no-logra-comprar-alimentos-y-peligra-el-abastecimiento', 0, NULL, 14, 0, '0', '<p><span style=\"font-family: Georgia, serif; font-size: 19px;\">Las torpezas y las sospechas de corrupción en el Ministerio de Desarrollo Social en la compra de alimentos,&nbsp;</span><a class=\"link\" href=\"https://www.lanacion.com.ar/economia/coronavirus-polemica-compra-alimentos-del-gobierno-precios-nid2351250\" style=\"margin: 0px; padding: 0px; border-width: 0px 0px 1px; border-top-style: initial; border-right-style: initial; border-bottom-style: solid; border-left-style: initial; border-top-color: initial; border-right-color: initial; border-bottom-color: rgb(204, 204, 204); border-left-color: initial; border-image: initial; outline: 0px; font-size: 19px; font-family: Georgia, serif; vertical-align: baseline; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: inherit; color: rgb(0, 116, 196); transition: all 0.2s ease 0s; background-color: rgb(255, 255, 255);\">que denunció LA NACION hace exactamente un mes&nbsp;</a><span style=\"font-family: Georgia, serif; font-size: 19px;\">, empezó a tener consecuencias concretas en el sistema de asistencialismo que desde hace años tiene como vértice a la cartera que maneja&nbsp;</span><a href=\"https://www.lanacion.com.ar/tema/daniel-arroyo-tid67358\" data-event=\"contentLinkClick\" style=\"margin: 0px; padding: 0px; border-width: 0px 0px 1px; border-top-style: initial; border-right-style: initial; border-bottom-style: solid; border-left-style: initial; border-top-color: initial; border-right-color: initial; border-bottom-color: rgb(204, 204, 204); border-left-color: initial; border-image: initial; outline: 0px; font-size: 19px; font-family: Georgia, serif; vertical-align: baseline; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: inherit; color: rgb(0, 116, 196); transition: all 0.2s ease 0s; background-color: rgb(255, 255, 255);\">Daniel Arroyo&nbsp;</a><span style=\"font-family: Georgia, serif; font-size: 19px;\">.</span></p><p><span style=\"font-family: Georgia, serif; font-size: 19px;\">Los datos son elocuentes.&nbsp;</span><span style=\"margin: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-weight: 800; font-stretch: inherit; font-size: 19px; line-height: inherit; font-family: Georgia, serif; vertical-align: baseline;\">La semana pasada se abrieron las licitaciones de harina, aceite, fideos, arroz, leche en polvo, azúcar y l&nbsp;</span><span style=\"font-family: Georgia, serif; font-size: 19px;\"></span><span style=\"margin: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-weight: 800; font-stretch: inherit; font-size: 19px; line-height: inherit; font-family: Georgia, serif; vertical-align: baseline;\">entejas&nbsp;</span><span style=\"font-family: Georgia, serif; font-size: 19px;\">. Se ofreció comprar 11.900.000 paquetes o botellas de esos productos. Como estableció un decreto presidencial después del escándalo de los sobreprecios, los precios máximos fueron el tope al que se adjudicó. Sin embargo, la falta de credibilidad de que el Estado pagará en un plazo de 15 días impidieron que se cubre la demanda.&nbsp;</span><span style=\"margin: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-weight: 800; font-stretch: inherit; font-size: 19px; line-height: inherit; font-family: Georgia, serif; vertical-align: baseline;\">Apenas lograron hacerse del 34% de los productos que pidieron. Dicho de otra forma, solo compraron uno de cada tres alimentos que necesitaban&nbsp;</span><span style=\"font-family: Georgia, serif; font-size: 19px;\">. Para ser más precisos: el Estado no logró comprar un solo kilo de arroz, lentejas y azúcar.</span><span style=\"font-family: Georgia, serif; font-size: 19px;\"><br></span><br></p>', 0, 'ALIMENTACIÓN'),
(156, 'Este es el régimen con el que Adele bajo 110 libras', 'Este es el régimen con el que Adele bajo 110 libras', 'Adele ahora muestra una estilizada figura ¿cómo lo logró? La cantante realizó un régimen alimenticio que le permitió perder muchos kilos de peso.', '1', '2020-05-07 08:10:31', '2020-05-07 08:10:31', 'este-es-el-regimen-con-el-que-adele-bajo-110-libras.jpg', 'este-es-el-regimen-con-el-que-adele-bajo-110-libras', 0, NULL, 0, 2, NULL, '<p>Adele ahora muestra una estilizada figura ¿cómo lo logró? La cantante realizó un régimen alimenticio que le permitió perder muchos kilos de peso.</p><p>La nueva imagen de la cantante Adele se volvió viral en internet. Aquí te contamos cómo es que lo logró.</p><p>La cantante Adele ha rebajado unas 100 libras en poco menos de un año.</p><p>La dieta sirtfood ayudó a Adele a perder peso; sin embargo, expertos señalan que puede ser peligrosa por la exagerada restricción calórica.</p><p>La cantante reapareció en redes sociales con una fotografía en la que luce una impactante figura, lo que generó preguntas en sus fans.</p><p>Este miércoles 06 de mayo, Adele se convirtió en tendencia en Twitter después de dar a conocer una fotografía en donde mostraba su radical cambio de peso. La publicación contó con más de 7 millones de “Likes” y alrededor de 178 mil comentarios de&nbsp;...</p><p>Adele sorprendió al mundo al subir una foto a su cuenta de Instagram donde luce con un aspecto físico espectacular. Fue así como lo logró.</p><p>Dejó de fumar, redujo el consumo de alcohol y ajustó a la mitad las calorías. Con una dieta súper estricta bajó 50 kilos. Lo hizo en silencio, lejos de los medios y las redes sociales, hasta que decidió mostrar su nueva figura. Hoy, la cantante británica Adele&nbsp;...</p><p>Esto es todo lo que debes saber de la dieta sirtfood, el secreto de Adele para bajar de peso y estar delgada.</p><p>Informate, enterate de la actualidad Argentina y mirá los noticieros en vivo.</p>', 0, 'Tendencia News'),
(157, 'Adiós al amor: Cara Delevingne y Ashley Benson se separaron después de dos años', 'Adiós al amor: Cara Delevingne y Ashley Benson se separaron después de dos años', 'La modelo y la actriz compartían una casa en Los Ángeles. Se cree que la ruptura sucedió en abril Fuente: LA NACION - Crédito: Grosby Group. Comentar (0). Me gusta. Me gusta. Compartir. E-mail. Twitter. Facebook. WhatsApp. Guardar. 6 de mayo de 2020&nbsp;...', '1', '2020-05-07 08:10:31', '2020-05-07 08:10:31', 'adios-al-amor-cara-delevingne-y-ashley-benson-se-separaron-despues-de-dos-anos.jpg', 'adios-al-amor-cara-delevingne-y-ashley-benson-se-separaron-despues-de-dos-anos', 0, NULL, 0, 2, NULL, '<p>La modelo y la actriz compartían una casa en Los Ángeles. Se cree que la ruptura sucedió en abril Fuente: LA NACION - Crédito: Grosby Group. Comentar (0). Me gusta. Me gusta. Compartir. E-mail. Twitter. Facebook. WhatsApp. Guardar. 6 de mayo de 2020&nbsp;...</p><p>En plena pandemia, la modelo y la actriz le pusieron punto final a su historia de amor luego de dos años.</p><p>Tras dos años de mantener aparentemente una estable relación amorosa, salió a luz pública la noticia de la ruptura.</p><p>Una fuente cercana a la pareja aseguró que la actriz y la modelo pusieron fin a su romance tras casi dos años de noviazgo.</p><p>Así lo confirmaron fuentes cercanas a la pareja.</p><p>Redacción. Siendo ambas reconocidas figuras del cine y el mundo de la moda, además de una de las parejas LGBT+ más influyentes del espectáculo, la modelo Cara Delevingne y la actriz Ashley Benson conmocionaron a sus fanáticos, luego de darse a&nbsp;...</p><p>Nadie sabe porque, solo pudimos observar como borraban sus fotos juntas, algo está pasando pues parece que todo terminó.</p><p>Si una cosa es segura, es que 2020 ha tenido una buena cantidad de rupturas de celebridades.</p><p>Ciudad de México— Las actrices Cara Delevingne y Ashley Benson se separaron a principios de abril, de acuerdo con fuentes de People. Un informante contó que Delevingne ha pasado tiempo con sus amigos desde entonces, entre ellos Kaia Gerber, y las&nbsp;...</p><p>Cara Delevingne y Ashley Benson, una de las parejas más populares del mundo del espectáculo juvenil, terminaron su relación tras casi dos años como pareja. Así lo confirmó la revista People, citando diferentes fuentes cercanas a la supermodelo de 27&nbsp;...</p>', 0, 'Tendencia News'),
(158, 'El actor Vin Diesel mantiene una disputa por la saga “Rápido y Furioso”', 'El actor Vin Diesel mantiene una disputa por la saga “Rápido y Furioso”', 'El artista sostiene una pelea con el equipo que se niega a reconocer su aporte.', '1', '2020-05-07 08:10:32', '2020-05-07 08:10:32', 'el-actor-vin-diesel-mantiene-una-disputa-por-la-saga-rapido-y-furioso.jpg', 'el-actor-vin-diesel-mantiene-una-disputa-por-la-saga-rapido-y-furioso', 0, NULL, 0, 2, NULL, '<p>El artista sostiene una pelea con el equipo que se niega a reconocer su aporte.</p><p>Si el mundo estuviera bajo circunstancias más normales en cuestión de unas semanas (específicamente el 22 de mayo) se hubiera estrenado Rápidos y furiosos 9, cinta que reunía los ingredientes necesarios para ser uno de los éxitos más grandes del año&nbsp;...</p><p>En SensaCine.com.mx : Una publicación borrada de Instagram da muestra de la pelea que están librando algunos miembros de la película.</p><p>El actor mantiene una pelea con el equipo de la película que hasta el momento no había trascendido. En la nota, todos los detalles.</p><p>El actor que da vida a Dominic Toretto nunca imaginó que ese proyecto duraría más 20 años.</p><p>El actor se ha enfrentado con la Producers Guild of América para que lo reconozcan como productor de &quot;Rápidos y Furiosos&quot;.</p><p>Sin duda, la saga de Fast and Furious sigue muy viva gracias a la labor de Vin Diesel no sólo como protagonista, sino también como productor. Sin embargo, el Gremio de Productores de América (Producers Guild) se niega a considerarle como tal. Y el actor&nbsp;...</p><p>El actor mantiene una guerra con el equipo de la película que hasta el momento no había salido a la luz.</p><p>Producers Guild of América se ha mostrado reacia a otorgarle a Diesel los privilegios de productor de Fast and Furious, franquicia que ha ayudado a moldear.</p><p>Según informa Variety, la Producers Guild of América se mostró reacia a otorgarle al actor los privilegios de productor de la franquicia. Europa Press Sin duda, la saga “Rápidos y Furiosos” sigue muy viva gracias a la labor de Vin Diesel no sólo como&nbsp;...</p>', 0, 'Tendencia News'),
(159, '¡Flamengo tiene 38 casos de coronavirus!', '¡Flamengo tiene 38 casos de coronavirus!', 'La intención de los dirigentes de fútbol en Brasil es que la pelota vuelva a rodar cuanto antes. Sin ir más lejos, en Porto Alegre, Inter y.', '1', '2020-05-07 08:10:32', '2020-05-07 08:10:32', 'flamengo-tiene-38-casos-de-coronavirus.jpg', 'flamengo-tiene-38-casos-de-coronavirus', 0, NULL, 0, 2, NULL, '<p>La intención de los dirigentes de fútbol en Brasil es que la pelota vuelva a rodar cuanto antes. Sin ir más lejos, en Porto Alegre, Inter y.</p><p>La idea de algunos dirigentes del fútbol en Brasil ha sido reactivar entrenamientos de sus equipos lo antes posible, respetando los protocolos sanitarios. Equipos como Inter y Gremio ya retornaron a sus prácticas, pero Flamengo tiene cada vez más&nbsp;...</p><p>La idea de varios dirigentes de fútbol en Brasil es la de retornar a los entrenamientos lo antes posible, respetando siempre las medidas de precaución y los distintos protocolos sanitarios. En Porto Alegre, por ejemplo, Inter y Gremio ya volvieron a las&nbsp;...</p><p>Medios brasileros confirmaron que ocho empleados del club dieron positivo a las pruebas de coronavirus y eso dificulta el regreso a las actividades del plantel, que esta semana perdió a su masajista justamente por Covid-19.</p><p>El miembro del plantel estuvo dos semanas hospitalizado y tras sufrir un paro cardíaco, pereció. Se desempeñaba como masajista. Jorge Luiz Domingos, masajista del Flamengo. Foto: TN.com. Compartir en Compartir en. Un miembro del plantel del&nbsp;...</p><p>El club anunció un acuerdo con los futbolistas para poder sobrellevar la crisis general debido a la interrupción de las competiciones. A su vez, confirma 8 positivos por Covid-19.</p><p>Tras el fallecimiento del masajista del ahora se conocieron nuevos casos de contagio entre los miembros del club.</p><p>Sao Paulo, 5 may (EFE).- El Flamengo, campeón de la Liga de Brasil y la Copa Libertadores en 2019, anunció este martes que llegó a un acuerdo con sus jugadores para reducir el 25 % de sus salarios entre los meses de mayo y junio, debido a la&nbsp;...</p><p>Río de Janeiro, EFE.- Jorge Luiz Domingos, Jorginho, masajista del Flamengo desde hace 40 años, murió este lunes de un paro cardíaco en un hospital de Río de Janeiro, donde estaba ingresado después de contraer el coronavirus COVID-19. Jorginho era&nbsp;...</p><p>El arquero de Real Madrid Thibaut Courtois consideró “injusto” que consagran campeón de La Liga al FC Barcelona, la Premier League podría acortar la duración de los partidos, el FC Barcelona reanuda los entrenamientos este miércoles, Flamengo&nbsp;...</p>', 0, 'Tendencia News'),
(160, 'El divertido ida y vuelta sexual de Lizy Tagliani y su novio', 'El divertido ida y vuelta sexual de Lizy Tagliani y su novio', 'Por el coronavirus la conductora quedó separada de su novio, Leo Alturria, y a través de sus redes sociales tuvieron un desopilante y subido de tono intercambio. ¡Mirá!', '1', '2020-05-07 08:10:32', '2020-05-07 08:10:32', 'el-divertido-ida-y-vuelta-sexual-de-lizy-tagliani-y-su-novio.jpg', 'el-divertido-ida-y-vuelta-sexual-de-lizy-tagliani-y-su-novio', 0, NULL, 0, 2, NULL, '<p>Por el coronavirus la conductora quedó separada de su novio, Leo Alturria, y a través de sus redes sociales tuvieron un desopilante y subido de tono intercambio. ¡Mirá!</p><p>La pareja no aguanta más sin verse.</p><p>La conductora compartió una imagen con su característico humor para mostrar cómo estará al terminar la cuarentena.</p><p>La conductora estaría disconforme con su ciclo de Telefe y hay rumores de conflictos con la producción. En la nota, los detalles.</p><p>Hace unas semanas, y a pesar del aislamiento social, preventivo y obligatorio, Lizy Tagliani anunció su casamiento con Leo Alturria luego de que su novio declarara sus intenciones de pasar por el altar en las redes sociales. Pero mientras espera que llegue&nbsp;...</p><p>La conductora anunció hace unos días que se casará luego de la cuarentena.</p><p>Con un invitado especial en su programa, se vivió uno de los momentos más graciosos de la comediante.</p><p>La modelo argentina, que actualmente se desempeña como conductora de un noticiero televisivo en el Canal 26, Sol Pérez posteó una imagen que dejó con la boca abierta a más de uno de sus seguidores. La rubia utilizó su cuenta oficial de Instagram para&nbsp;...</p><p>La conductora compartió una imagen para mostrar cómo se imaginaba al terminar la cuarentena, y revolucionó las redes. Mirá.</p><p>La conductora publicó una foto muy divertida que usó para ilustrar su actual estado sentimental.</p>', 0, 'Tendencia News'),
(161, 'Jorge Asís: &quot;El problema del Presidente es que su gestión se agota con la peste&quot;', 'Jorge Asís: &quot;El problema del Presidente es que su gestión se agota con la peste&quot;', 'Durante su mano a mano con Luis Novaresio, en Animales Sueltos, el periodista y escritor Jorge Asís se refirió a las consecuencias económicas de la cuarentena y sentenció: &quot;El problema del presidente Alberto Fernández es que su gestión se agota con la&nbsp;...', '1', '2020-05-07 08:10:32', '2020-05-07 08:10:32', 'jorge-asis-quotel-problema-del-presidente-es-que-su-gestion-se-agota-con-la-pestequot.jpg', 'jorge-asis-quotel-problema-del-presidente-es-que-su-gestion-se-agota-con-la-pestequot', 0, NULL, 0, 2, NULL, '<p>Durante su mano a mano con Luis Novaresio, en Animales Sueltos, el periodista y escritor Jorge Asís se refirió a las consecuencias económicas de la cuarentena y sentenció: &quot;El problema del presidente Alberto Fernández es que su gestión se agota con la&nbsp;...</p><p>El periodista y escritor opinó sobre el escenario político y económico en medio de la pandemia de coronavirus.</p>', 0, 'Tendencia News'),
(162, 'El Sindicato de Químicos recuerda el 101 aniversario del nacimiento de Eva Perón', 'El Sindicato de Químicos recuerda el 101 aniversario del nacimiento de Eva Perón', 'Por medio de un comunicado, el gremio encabezado por Sergio Gónzalez expuso que “para nosotros hoy es un día de Homenaje y Orgullo por haber tenido y...', '1', '2020-05-07 08:10:33', '2020-05-07 08:10:33', 'el-sindicato-de-quimicos-recuerda-el-101-aniversario-del-nacimiento-de-eva-peron.jpg', 'el-sindicato-de-quimicos-recuerda-el-101-aniversario-del-nacimiento-de-eva-peron', 0, NULL, 0, 2, NULL, '<p>Por medio de un comunicado, el gremio encabezado por Sergio Gónzalez expuso que “para nosotros hoy es un día de Homenaje y Orgullo por haber tenido y...</p><p>Nacida en el interior de la Provincia de Buenos Aires, Eva Duarte migró a Buenos Aires a la temprana edad de 15 años. Allí se dedicó a la actuación destacándose cine, teatro y radioteatro. Esto le valdría años más tarde el desprecio de los sectores&nbsp;...</p><p>Política argentina, se casó con el general Juan Domingo Perón y lo acompañó en su gobierno realizando una extensa obra de trabajo social e impulsa la participación de las mujeres en la vida política; ferviente promotora del voto femenino. Su muerte&nbsp;...</p><p>Desde el Partido Justicialista de General Pueyrredón recordaron a Eva Perón al cumplirse este jueves 7 de mayo, “ 101 años del nacimiento de la mujer más trascendente de nuestra Patria. Ella, junto a Juan Domingo Perón, desarrolló la Justicia Social”.</p><p>Con el acompañamiento de todos los legisladores integrantes del Bloque FREJUPA –especialmente de las diputadas Silvina Larreta, Valeria Luján, Carina Pereyra y Lilia Caimari-, la Vicepresidenta 1° de la Cámara de Diputados de nuestra provincia, Alicia&nbsp;...</p><p>En un comunicado que lleva la firma de sus autoridades, destacaron la «entrega en pos de los descamisados y las mujeres argentinas». Autoridades del Partido Justicialista de Balcarce recordaron la figura de Eva Duarte al cumplirse este 7 de mayo el 101°&nbsp;...</p><p>Se cumple un nuevo aniversario del nacimiento de Eva Perón Crédito: Pinélides Fusco. Comentar (0). Me gusta. Me gusta. Compartir. E-mail. Twitter. Facebook. WhatsApp. Guardar. 7 de mayo de 2020 • 02:00. Nace una figura emblemática del peronismo,&nbsp;...</p><p>Ante la imposibilidad de poder realizar actos en tributo a su memoria, debido a las restricciones impuestas por el emergencia sanitaria, la Juventud.</p><p>Buenos Aires, 7 may (Prensa Latina) Los argentinos recuerdan hoy a Evita Perón, la voz de los descamisados y los humildes, la rebelde, la mujer que revolucionó la historia política de este país donde su ejemplo perdura y traspasa a las nuevas&nbsp;...</p><p>Eva María Duarte, quien pasó a la posteridad como &#39;Evita&#39;, cumpliría hoy 101 años. Quien fuera primera dama e impulsora del Partido Peronista Feminista tendrá d.</p>', 0, 'Tendencia News'),
(163, 'Teoría conspirativa revela que Sam Smith y Adele son la misma persona', 'Teoría conspirativa revela que Sam Smith y Adele son la misma persona', 'Recientemente esta teoría se viralizó en TikTok, pero la idea no es nueva; surgió en 2018 en Twitter.', '1', '2020-05-07 08:10:33', '2020-05-07 08:10:33', 'teoria-conspirativa-revela-que-sam-smith-y-adele-son-la-misma-persona.jpg', 'teoria-conspirativa-revela-que-sam-smith-y-adele-son-la-misma-persona', 0, NULL, 0, 2, NULL, '<p>Recientemente esta teoría se viralizó en TikTok, pero la idea no es nueva; surgió en 2018 en Twitter.</p><p>Aunque se viralzó desde Tik Tok, la idea no es nueva: surgió en febrero de 2018 en Twitter.</p><p>Desde hace varios meses en redes sociales, internautas han compartido una teoría de conspiración del medio del espectáculo, la cual asegura que Adele y Sam Smi.</p><p>Un usuario de Tik Tok se lo hizo notar a sus fans al revelar una teoría que dice que Adele y Sam Smith son la misma persona que no es nueva, surgió en febrero de 2018 en Twitter.</p><p>Ahora que Adele volvió a las redes sociales con una renovación completa, todos los reflectores la han apuntado. La cantante de Inglaterra viene con todo y para contribuir al mame de Adele, te presentamos la teoría que afirma que ella y Sam Smith, son en&nbsp;...</p><p>Mientras muchos ven series otros más están armando teorías sobre famosos y esta es una muy interesante, pues si se parecen Adele y Sam Smith.</p><p>Un usuario de Tik Tok casi le vuela la cabeza a sus fans al revelar una teoría que dice que Adele y Sam Smith son la misma persona, ¡no lo vas a creer!.</p>', 0, 'Tendencia News'),
(164, 'Un halo lunar apareció en la noche pampeana e impactó a todos', 'Un halo lunar apareció en la noche pampeana e impactó a todos', 'El halo lunar es un fenómeno metereológico en el que se forma un anillo incandescente de color blanco alrededor de la Luna.', '1', '2020-05-07 05:27:10', '2020-05-07 08:27:10', 'un-halo-lunar-aparecio-en-la-noche-pampeana-e-impacto-a-todos.jpg', 'un-halo-lunar-aparecio-en-la-noche-pampeana-e-impacto-a-todos', 0, NULL, 1, 2, NULL, '<p>El halo lunar es un fenómeno metereológico en el que se forma un anillo incandescente de color blanco alrededor de la Luna.</p><p>La imagen de la Luna fue captada por un vecino que la envió al medio local. Este fenómeno es más común en lugares con mucho frío como Siberia o Alaska.</p><p>El fenómeno fue captado por el teléfono celular de un joven, en la ciudad de Santa Rosa. ¡Mirá la imagen!</p><p>Este miércoles por la noche, un lector de LA ARENA envió una curiosa foto tomada del cielo santarroseño. Se trata de un Halo Lunar, un fenómeno no tan usual. En la imagen se puede observar alrededor de la Luna un Halo. Se trata de una suerte de disco&nbsp;...</p><p>Un halo alrededor de la luna, no tan usual, fue registrado por un pampeano en una foto tomada del cielo de la Capital, Santa Rosa.</p>', 0, 'Tendencia News'),
(165, 'De Voldemort a Tronchatoro: Ralph Fiennes confirmado para nueva cinta de &#39;Matilda&#39;', 'De Voldemort a Tronchatoro: Ralph Fiennes confirmado para nueva cinta de &#39;Matilda&#39;', 'Redacción. El notable actor británico ha sorprendido a varias generaciones con sus destacadas actuaciones, y en esta ocasión vuelve para dar vida a la terrible villana y enemiga de los niños Miss Tronchatoro. Según informaron los medios especializados&nbsp;...', '1', '2020-05-07 08:10:33', '2020-05-07 08:10:33', 'de-voldemort-a-tronchatoro-ralph-fiennes-confirmado-para-nueva-cinta-de-39matilda39.jpg', 'de-voldemort-a-tronchatoro-ralph-fiennes-confirmado-para-nueva-cinta-de-39matilda39', 0, NULL, 0, 2, NULL, '<p>Redacción. El notable actor británico ha sorprendido a varias generaciones con sus destacadas actuaciones, y en esta ocasión vuelve para dar vida a la terrible villana y enemiga de los niños Miss Tronchatoro. Según informaron los medios especializados&nbsp;...</p><p>El remake de la exitosa y película Matilda cada vez va tomando más forma, ya que esta semana se habría confirmado quién será la nueva Agatha Tronchatoro. Según el sitio Deadline, quien dará vida al temido personaje de Pam Ferris será nada más ni&nbsp;...</p><p>El actor le dará vida al malvado director que en la versión de los 90 fue interpretado por Pan Ferris.</p><p>El actor, famoso por cintas como &quot;La lista de Schindler&quot;, &quot;El paciente inglés&quot; y la saga fílmica de Harry Potter, encarnará a la malvada directora en una nueva producción que está preparando Netflix.</p><p>La exitosa novela de Roald Dahl tendrá una nueva versión en forma de musical. El prestigioso actor inglés fue el primero en sumarse al proyecto de Netflix.</p><p>La película se basa en la popular versión del musical teatral de la clásica historia de Roald Dahl.</p><p>Este remake estará más apegado a la obra musical de Matilda que a la película original con la que creciste.</p><p>El actor británico Ralph Fiennes interpretará al popular personaje de &#39;Agatha Tronchatoro&#39; en el musical de &#39;Matilda&#39; que se está desarrollando para Netflix, según lo informado por Deadline. Aunque es de resaltar, que esta no no será la primera vez que el&nbsp;...</p><p>El actor encarnará a la recordada Agatha Tronchatoro, la malvada directora del colegio en la historia de &quot;Matilda&quot;.</p><p>La compañía de streaming eligió a un famoso actor para ponerse en la piel de la villana de la historia.</p>', 0, 'Tendencia News'),
(166, 'Botafogo reconoce interés en sacar del retiro a Arjen Robben', 'Botafogo reconoce interés en sacar del retiro a Arjen Robben', 'Ricardo Rotenberg, vicepresidente del Botafogo, reconoció este miércoles que tuvo contacto con el neerlandés Arjen Robben y le hizo una oferta para que salga del retiro y juegue en el futbol brasileño. &quot;Pedí a Marcos Leite que me ayudara a entrar en&nbsp;...', '1', '2020-05-07 08:10:33', '2020-05-07 08:10:33', 'botafogo-reconoce-interes-en-sacar-del-retiro-a-arjen-robben.jpg', 'botafogo-reconoce-interes-en-sacar-del-retiro-a-arjen-robben', 0, NULL, 0, 2, NULL, '<p>Ricardo Rotenberg, vicepresidente del Botafogo, reconoció este miércoles que tuvo contacto con el neerlandés Arjen Robben y le hizo una oferta para que salga del retiro y juegue en el futbol brasileño. &quot;Pedí a Marcos Leite que me ayudara a entrar en&nbsp;...</p><p>Robben no sería la única bomba europea que el cuadro de Botafogo tiene en su carpeta.</p><p>El delantero se despidió del futbol en la Temporada 2018-19 vistiendo los colores del Bayern; recientemente ha externado su interés de volver a las canchas.</p><p>El virtuoso atacante holandés aseguró que extraña al fútbol y un equipo brasileño le hizo una propuesta para que se incorpore a su plantel. Los detalles.</p><p>El equipo brasileño quiere hacerse con otro bombazo europeo y regresar del retiro al futbolista holandés Arjen Robben, como lo ha hecho con Keisuke Honda.</p><p>Arjen Robben, delantero holandés finalista del Mundial Sudáfrica 2010 con su selección y exjugador del Real Madrid, Chelsea y Bayern Munich, se retiró la temporada 2019, pero en una reciente entrevista admitió que extraña el fútbol. “Al inicio no&nbsp;...</p><p>Delantero holandés admitió que extraña el fútbol, lo que hizo que el Botafogo se aliste para inicar un proyecto para contratarlo.</p><p>El holandés reconoció que le gustaría volver a jugar y las ofertas no se demoraron en llegar | Deportes | Expreso.</p><p>La carrera de Arjen Robben tuvo tu punto final en junio de 2019, cuando decidió retirarse tras 20 años de un gran nivel. Sin embargo, él mismo se encargó de abrir en los últimos días una ventana para un posible regreso a la actividad en un podcast del&nbsp;...</p><p>El vicepresidente del Botafogo comunicó que el club estaría dispuesto a recibir a Arjen Robben. | Curiosidades de fútbol | futbolred.com.</p>', 0, 'Tendencia News'),
(167, 'Heung-Min Son es fotografiado mientras cumple con el servicio militar en Corea del Sur', 'Heung-Min Son es fotografiado mientras cumple con el servicio militar en Corea del Sur', 'El futbolista del Tottenham de la Premier League, Heung-Min Son, fue captado mientras cumple con el servicio militar en Corea del Sur.', '1', '2020-05-07 05:11:03', '2020-05-07 08:11:03', 'heung-min-son-es-fotografiado-mientras-cumple-con-el-servicio-militar-en-corea-del-sur.jpg', 'heung-min-son-es-fotografiado-mientras-cumple-con-el-servicio-militar-en-corea-del-sur', 0, NULL, 1, 2, NULL, '<p>El futbolista del Tottenham de la Premier League, Heung-Min Son, fue captado mientras cumple con el servicio militar en Corea del Sur.</p><p>Volante del Tottenham tiene que cumplir las 4 semanas de servicio militar que exige el gobierno de Corea del Sur.</p><p>Con el fusil en el hombro fue visto al futbolista del Tottenham cumpliendo con el servicio militar tras paralización de la Premier League por el COVID-19.</p><p>El 6 de abril se oficializó que Heung-Min Son debería cumplir un régimen corto en el servicio militar de Corea del Sur. Y a un mes de haberse confirmado la noticia, aparecieron las primeras imágenes del delantero del Tottenham ?en plena actividad.</p><p>El futbolista Heung-min Son inició el 20 de abril su servicio militar en Corea del Sur y este miércoles se dio a conocer la primera imagen del atacante.</p><p>Este día se filtraron algunas imágenes del delantero del Tottenham Hotspur en un campo de entrenamiento.</p><p>El surcorenao Heung-min Son, futbolista del Tottenham inglés, está cumpliendo su servicio militar obligatorio en la isla de Jeju, lugar donde está desde el pasado 20 de abril. Y ahora, se ha viralizado la primera imagen del delantero en el campamento de la&nbsp;...</p><p>La historia de Heung-Min Son es muy particular. La estrella del Tottenham nació en Corea del Sur y debe cumplir con el servicio militar obligatorio, algo que decidió hacer durante el parate de la Premier League debido a la pandemia del coronavirus.</p><p>La estrella de los Spurs aprovechó el parón de la Premier League por la pandemia y de esta manera cumplir con sus obligaciones nacionales.</p><p>Son Heung-Min, goleador de la Totenham, cambió los botines de fútbol por las botas, la pelota por un fusil y junto a La Marina patrulla Corea del Sur combatiendo al COVID-19.</p>', 0, 'Tendencia News'),
(168, 'Entre Ríos: los detuvieron violando la cuarentena con marihuana y un carpincho vivo en el baúl', 'Entre Ríos: los detuvieron violando la cuarentena con marihuana y un carpincho vivo en el baúl', 'Viajaban hacia la ciudad de Federación y fueron parados en un control policial. Los agentes encontraron drogas y al animal vivo en el baúl.', '1', '2020-05-07 08:10:34', '2020-05-07 08:10:34', 'entre-rios-los-detuvieron-violando-la-cuarentena-con-marihuana-y-un-carpincho-vivo-en-el-baul.jpg', 'entre-rios-los-detuvieron-violando-la-cuarentena-con-marihuana-y-un-carpincho-vivo-en-el-baul', 0, NULL, 0, 2, NULL, '<p>Viajaban hacia la ciudad de Federación y fueron parados en un control policial. Los agentes encontraron drogas y al animal vivo en el baúl.</p><p>Cuatro hombres viajaban hacia la ciudad de Federación en Entre Ríos y fueron retenidos en un control policial. Los agentes encontraron drogas y al animal vivo en el baúl.</p><p>Los detuvieron por violación de la cuarentena. La policía de la ciudad entrerriana de Federación se encontraba realizando un operativo de control vehicular cuando pararon a un remis que venía con cuatro hombres, cuando revisaron el auto encontraron&nbsp;...</p><p>Tenían marihuana en el baúl del auto. En total cuatro hombres fueron aprehendidos.</p>', 0, 'Tendencia News'),
(169, 'Benatia reabre la polémica de 2018: &quot;Todos saben lo que pasa cuando juegas ante Real Madrid en Champions”', 'Benatia reabre la polémica de 2018: &quot;Todos saben lo que pasa cuando juegas ante Real Madrid en Champions”', 'Medhi Benatia tiene claro que no le cometió penal a Lucas Vázquez en la vuelta de cuartos de la Champions 2018 contra Real Madrid.', '1', '2020-05-07 08:10:34', '2020-05-07 08:10:34', 'benatia-reabre-la-polemica-de-2018-quottodos-saben-lo-que-pasa-cuando-juegas-ante-real-madrid-en-champions.jpg', 'benatia-reabre-la-polemica-de-2018-quottodos-saben-lo-que-pasa-cuando-juegas-ante-real-madrid-en-champions', 0, NULL, 0, 2, NULL, '<p>Medhi Benatia tiene claro que no le cometió penal a Lucas Vázquez en la vuelta de cuartos de la Champions 2018 contra Real Madrid.</p><p>Mehdi Benatia todavía recuerda el penal en el último minuto que le cobraron contra el Merengue hace dos años atrás y decretó la clasificación del combinado español a semifinales.</p><p>Una jugada que ocurrió hace dos años, mantiene a Mehdi Benatia muy furioso con en el Real Madrid.</p><p>Medhi Benatia hizo un repaso sobre a recordada serie entre Real Madrid y Juventus de hace dos años, donde el conjunto italiano estuvo cerca de una remontada épica. “Sentíamos, tras el 3-0 de la ida, que estábamos sentenciados, pero vimos la&nbsp;...</p><p>Mehdi Benatia recordó el penalti a Lucas Vázquez gracias al que el Real Madrid eliminó a la Juventus hace un par de temporadas después de una remontada tan estéril como espectacular de los italianos. - BeSoccer.</p>', 0, 'Tendencia News');
