(170, 'Vino, cerveza y gaseosas podrán acceder a beneficios nacionales', 'Vino, cerveza y gaseosas podrán acceder a beneficios nacionales', 'Serán beneficiados con los programas vigentes a nivel nacional para el sostenimiento del empleo y la producción.', '1', '2020-05-07 05:14:05', '2020-05-07 08:14:05', 'vino-cerveza-y-gaseosas-podran-acceder-a-beneficios-nacionales.jpg', 'vino-cerveza-y-gaseosas-podran-acceder-a-beneficios-nacionales', 0, NULL, 1, 2, NULL, '<p>Serán beneficiados con los programas vigentes a nivel nacional para el sostenimiento del empleo y la producción.</p><p>Tras gestiones de Bodegas de Argentina, los eslabones de la cadena vitivinícola fueron incluidos entre las actividades que pueden acceder al programa ATP.</p><p>Los principales productos de la cadena vitivinícola fueron incluidos en el listado de actividades y rubros que pueden acceder al programa de asistencia al trabajo y la producción (ATP) en el actual contexto de crisis sanitaria por el coronavirus, informó este&nbsp;...</p><p>Tras gestiones conjuntas impulsadas por la COVIAR, fue incluida en el listado del programa que actualizó la AFIP.</p><p>Los principales productos de la cadena vitivinícola fueron incluidos en el listado de actividades y rubros que pueden acceder al programa de asistencia lanzado en el marco de la crisis sanitaria por el COVID-19. Tras gestiones conjuntas llevadas a cabo por&nbsp;...</p><p>De acuerdo a lo solicitado por la Corporación Vitivinícola Argentina (COVIAR) en relación a la inclusión de la cadena vitivinícola en el Programa de Asistencia de Emergencia al Trabajo y la Producción, a requerimiento del Ministerio de Desarrollo Productivo&nbsp;...</p><p>Distintas instituciones del mundo del vino se atribuyen, a través de la realización de diferentes gestiones, el resultado exitoso de este logro; que fue informado a la prensa mediante comunicados que, curiosamente, omiten a algunas entidades según quien&nbsp;...</p>', 0, 'Tendencia News'),
(171, 'Gobierno acordó apoyo nacional para proyectos chaqueños', 'Gobierno acordó apoyo nacional para proyectos chaqueños', 'Financiamiento para la producción local de alimentos, desarrollo de proyectos de economía popular, gestión integral de residuos sólidos urbanos y fondos verdes, fueron algunos de los temas que el mandatario chaqueño coordinó junto a las autoridades&nbsp;...', '1', '2020-05-07 08:10:35', '2020-05-07 08:10:35', 'gobierno-acordo-apoyo-nacional-para-proyectos-chaquenos.jpg', 'gobierno-acordo-apoyo-nacional-para-proyectos-chaquenos', 0, NULL, 0, 2, NULL, '<p>Financiamiento para la producción local de alimentos, desarrollo de proyectos de economía popular, gestión integral de residuos sólidos urbanos y fondos verdes, fueron algunos de los temas que el mandatario chaqueño coordinó junto a las autoridades&nbsp;...</p>', 0, 'Tendencia News'),
(172, 'Giovanni Moreno ilusiona a los hinchas de Racing: &quot;si se puede voy a volver&quot;', 'Giovanni Moreno ilusiona a los hinchas de Racing: &quot;si se puede voy a volver&quot;', 'El volante colombiano jugó para la &#39;academia&#39; entre 2010 y 2012.', '1', '2020-05-07 08:10:35', '2020-05-07 08:10:35', 'giovanni-moreno-ilusiona-a-los-hinchas-de-racing-quotsi-se-puede-voy-a-volverquot.jpg', 'giovanni-moreno-ilusiona-a-los-hinchas-de-racing-quotsi-se-puede-voy-a-volverquot', 0, NULL, 0, 2, NULL, '<p>El volante colombiano jugó para la &#39;academia&#39; entre 2010 y 2012.</p><p>El volante colombiano Giovanni Moreno dio luces sobre su regreso a Racing de Avellaneda.</p><p>Sería el segundo ciclo del jugador colombiano en la Academia. Su partida fue hace ya ocho años.</p><p>Aunque no lo estaban entrevistando a él, puso un mensaje en medio de la entrevista de un excompañero y generó mucho &#39;ruido&#39; entre la afición de &#39;la Acadé&#39;. Y aunque muchos hinchas de Nacional han quedado esperando que el zurdo pueda volver de&nbsp;...</p><p>A través de sus redes sociales ambos clubes invitaron a la gente para que compartieran los videos de los lujos del volante antioqueño que jugó en los dos elencos y hoy está en el fútbol chino. El #GioChallenge, como etiquetaron la tendencia, empezó&nbsp;...</p>', 0, 'Tendencia News'),
(173, 'A puro ritmo, Onur y Sherezade reaparecieron en un video y enloquecieron a sus fans', 'A puro ritmo, Onur y Sherezade reaparecieron en un video y enloquecieron a sus fans', 'Los actores Halit Ergenç y Bergüzar Korel, recordados por interpretar a Ounr y Sherezade en la novela Las mil y una noches, y quienes además son pareja, sorprendieron a sus fanáticos al publicar en redes sociales un video donde se los ve bailar al ritmo&nbsp;...', '1', '2020-05-07 08:10:35', '2020-05-07 08:10:35', 'a-puro-ritmo-onur-y-sherezade-reaparecieron-en-un-video-y-enloquecieron-a-sus-fans.jpg', 'a-puro-ritmo-onur-y-sherezade-reaparecieron-en-un-video-y-enloquecieron-a-sus-fans', 0, NULL, 0, 2, NULL, '<p>Los actores Halit Ergenç y Bergüzar Korel, recordados por interpretar a Ounr y Sherezade en la novela Las mil y una noches, y quienes además son pareja, sorprendieron a sus fanáticos al publicar en redes sociales un video donde se los ve bailar al ritmo&nbsp;...</p><p>Los actores turcos Halit Ergenç y Bergüzar Korel, protagonistas de la teleserie &quot;Las mil y una noches&quot;, se lucieron en &quot;Son Mektup&quot;.</p><p>Halit y Bergüzar, al ritmo de sus raíces. 05:03. Video. Comentar (0). Me gusta. Me gusta. Compartir. E-mail. Twitter. Facebook. WhatsApp. Guardar. 6 de mayo de 2020 • 10:44. Después de verlos juntos en Las mil y una noche y en Mi vida eres tu, Halit Ergenç&nbsp;...</p><p>Halit Ergenç, conocido por su personaje de Onur en &quot;Las mil y una noche&quot;, participó en un videoclip de su pareja, Bergüzar Korel, quien personificó a Sherazade en la ficción turca que se transmitió en El Trece. ¡Entrá a la nota!</p><p>Ellos se enamoraron haciendo la telenovela Las mil y una noches. Y el público se enamoró de ellos como pareja. Al principio, por la intrincada historia de encuentros y desencuentros de sus personajes, Onur y Sherazade, en la tira que hoy vuelve a verse&nbsp;...</p><p>Los protagonistas de Las mil y una noches conquistaron a sus seguidores con un videoclip musical juntos.</p><p>La protagonista de “Las mil y una noches”, Bergüzar Korel, invitó a su marido, Halit Ergenç, a participar del clip del clásico tema turco “Son Mektup” que ella interpreta. 5 de mayo de 2020. Compartir en FacebookCompartir; Compartir en TwitterTweet. Play.</p><p>Los protagonistas de “Las mil y una noches”, participaron de la producción de un videoclip para un tema musical. Por: Medios. Bergüzar Korel y Halit Ergenç se conocieron interpretando a Onur y Sherezade en la novela turca Las mil y una noches y al poco&nbsp;...</p><p>Hace unos años los argentinos nos enamoramos de lo que era en ese tiempo una novedad para nosotros: las novelas turcas. Caracterizadas por una carga emotiva importante, sin dudas una de las historias que más quedó registrada en la memoria de los&nbsp;...</p><p>La protagonista de Las mil y una noches, Bergüzar Korel, invitó a su marido, Halit Ergenç, a participar del videoclip del tema turco “Son Mektup”.</p>', 0, 'Tendencia News'),
(174, '“El Depo” celebra su 96° año de vida', '“El Depo” celebra su 96° año de vida', 'Este jueves 7 de mayo, el Club Social y Deportivo Madryn, cumple sus 96 años desde su fundación. Aunque no se podrá celebrar con cena y fiesta como sucede año tras año, la institución festejará disfrutando del gran momento que en cuanto a&nbsp;...', '1', '2020-05-07 08:10:35', '2020-05-07 08:10:35', 'el-depo-celebra-su-960-ano-de-vida.jpg', 'el-depo-celebra-su-960-ano-de-vida', 0, NULL, 0, 2, NULL, '<p>Este jueves 7 de mayo, el Club Social y Deportivo Madryn, cumple sus 96 años desde su fundación. Aunque no se podrá celebrar con cena y fiesta como sucede año tras año, la institución festejará disfrutando del gran momento que en cuanto a&nbsp;...</p><p>Deportivo Madryn cumple este jueves 7 de mayo 96 años de vida y su presidente, Gustavo Sastre, tomó la palabra y habló de la actualidad del club. Además, expresó su satisfacción por el crecimiento institucional del último tiempo y su confirmación como&nbsp;...</p>', 0, 'Tendencia News'),
(175, 'Lista de los Shows cancelados de CBS esta temporada', 'Lista de los Shows cancelados de CBS esta temporada', 'La cadena ha anunciado su lista de renovaciones y cancelados, y acá traemos la lista de las cabezas que rodaron.', '1', '2020-05-07 08:10:36', '2020-05-07 08:10:36', 'lista-de-los-shows-cancelados-de-cbs-esta-temporada.jpg', 'lista-de-los-shows-cancelados-de-cbs-esta-temporada', 0, NULL, 0, 2, NULL, '<p>La cadena ha anunciado su lista de renovaciones y cancelados, y acá traemos la lista de las cabezas que rodaron.</p><p>La mayor parte de la programación de la cadena volverá para la temporada 2020-2021, con nuevos episodios. La red anunció renovaciones para los siguientes dramas: All Rise, Blue Bloods, Bull, FBI, FBI: Most Wanted, MacGyver, Magnum PI, NCIS, NCIS:&nbsp;...</p>', 0, 'Tendencia News'),
(176, 'El plantel del Atlético de Madrid se sometió a las pruebas de coronavirus', 'El plantel del Atlético de Madrid se sometió a las pruebas de coronavirus', 'Así fue la mañana en la que los miembros de la primera plantilla se realizaron las pruebas previas al regreso a los entrenamientos. ??? #AúpaAtleti pic.twitter.com/jSxj04OwnT. — Atlético de Madrid (@Atleti) May 6, 2020. Los resultados de las pruebas&nbsp;...', '1', '2020-05-07 05:26:46', '2020-05-07 08:26:46', 'el-plantel-del-atletico-de-madrid-se-sometio-a-las-pruebas-de-coronavirus.jpg', 'el-plantel-del-atletico-de-madrid-se-sometio-a-las-pruebas-de-coronavirus', 0, NULL, 1, 2, NULL, '<p>Así fue la mañana en la que los miembros de la primera plantilla se realizaron las pruebas previas al regreso a los entrenamientos. ??? #AúpaAtleti pic.twitter.com/jSxj04OwnT. — Atlético de Madrid (@Atleti) May 6, 2020. Los resultados de las pruebas&nbsp;...</p><p>El Atlético de Madrid, dirigido por el argentino Diego Simeone, se juntó hoy en el estadio Wanda Metropolitano para realizar los respectivos tests, de cara al reinicio de las prácticas y de La Liga española de fútbol. Estos estudios fueron hechos en medio de&nbsp;...</p>', 0, 'Tendencia News'),
(177, 'Florian Schneider, co-fundador de Kraftwerk, muere a los 73', 'Florian Schneider, co-fundador de Kraftwerk, muere a los 73', 'Producto de un cáncer falleció el músico de la banda pionera en música electrónica, según informó su compañero Ralf Hütter.', '1', '2020-05-07 08:10:36', '2020-05-07 08:10:36', 'florian-schneider-co-fundador-de-kraftwerk-muere-a-los-73.jpg', 'florian-schneider-co-fundador-de-kraftwerk-muere-a-los-73', 0, NULL, 0, 2, NULL, '<p>Producto de un cáncer falleció el músico de la banda pionera en música electrónica, según informó su compañero Ralf Hütter.</p><p>No se vería como una falta de respeto decir, cibermetafóricamente, que con la muerte de uno de los fundadores de Kraftwerk, Florian Schneider-Esleben, se le desenchufó un cable a los pioneros de la música electrónica. El grupo alemán fue el primero que&nbsp;...</p><p>Schneider es considerado uno de los pioneros de la música electrónica en el mundo. En 2014, la banda de Düsseldorf ganó el exclusivo premio Grammy a la carrera artística.</p><p>El músico alemán Florian Schneider-Esleben, fundador de la mítica banda de música electrónica Kraftwerk, murió en Berlín a los 73 años a consecuencia de un cáncer, informaron hoy fuentes de la compañía discográfica Sony. Schneider-Esleben, nacido&nbsp;...</p><p>Ciudad de México. GDA/El Universal. El músico Florian Schneider, uno de los cofundadores de la banda Kraftwerk, falleció hoy a la edad de 73 años, así lo informó la revista Billboard. El artista alemán formó parte de Kraftwerk hasta 2008 cuando anunció su&nbsp;...</p><p>La muerte de uno de los fundadores del grupo alemán, pioneros de la música electrónica y cuyo deceso a causa del cáncer se informó hoy, se da justo en los días apocalípticos de la pandemia. En el presente que alguna vez fue futuro para una banda que&nbsp;...</p><p>Florian Schneider, fundador de los alemanes Kraftwerk, pioneros de la música electrónica, murió este miércoles a los 73 años Crédito: Europa Press. Comentar (0). Me gusta. Me gusta. Compartir. E-mail. Twitter. Facebook. WhatsApp. Guardar. 6 de mayo de&nbsp;...</p><p>El miembro de la mítica banda alemana Kraftwerk, Florian Schneider, dejó de existir luego de una larga batalla con el cáncer.</p><p>La noticia de la muerte fue confirmada por uno de sus colaboradores musicales y su disquera al diario británico The Guardian.</p><p>El mundo de la música ha lamentado la muerte de Florian Schneider a sus 73 años, uno de los fundadores de Kraftwerk. ¿Por qué fue tan importante? La banda fue conocida por su experimentación constante.</p>', 0, 'Tendencia News'),
(178, 'Wanda Nara mostró su lado más solidario en la lucha contra el coronavirus', 'Wanda Nara mostró su lado más solidario en la lucha contra el coronavirus', 'Wanda Nara compartió imágenes de una acción solidaria de la que fue parte y en el marco de la lucha contra el Covid-19.', '1', '2020-08-20 15:34:16', '2020-08-20 18:34:16', 'wanda-nara-mostro-su-lado-mas-solidario-en-la-lucha-contra-el-coronavirus.jpg', 'wanda-nara-mostro-su-lado-mas-solidario-en-la-lucha-contra-el-coronavirus', 0, NULL, 1, 2, NULL, '<p>Wanda Nara compartió imágenes de una acción solidaria de la que fue parte y en el marco de la lucha contra el Covid-19.</p><p>La rubia quiso ayudar desde Italia en medio de la pandemia.</p><p>Para sorpresa de sus seguidores de Instagram, Wanda Nara publicó una extraña foto luciendo un corpiño de encaje rosa y sumó una misteriosa frase.</p><p>Mauro Icardi está pasando esta cuarentena obligatoria junto a toda su familia. Tiene un hermoso agregado: su padre lo fue a visitar y se tuvo que quedar por el coronavirus. Los niños están disfrutando de su abuelo como nunca. Wanda Nara, pareja del&nbsp;...</p><p>Wanda Nara amplió su gimnasio de la paradisíaca casa en la que reside en el lago de Como, Italia. Y a qué no saben como fue...</p><p>Wanda Nara utilizó Instagram para contar qué estaba haciendo con sus hijas en medio de la cuarentena y aprovechó la oportunidad para referirse a su marido.</p><p>Wanda Nara se mostró en Instagram ayudando a sus hijitas con la tarea en cuarentena y le tiró un palito a su marido, Mauro Icardi.</p><p>Para deleitar a sus más de 6.4 millones de admiradores de Instagram, Wanda Nara compartió unas fotos que han causado impacto. En esta ocasión, la esposa.</p><p>Si bien Wanda Nara suele deslumbrar con su glamour y sensualidad, esta vez lo logró de manera natural y con un particular look para dormir.</p><p>En las últimas semanas, Wanda Nara fue noticia por diversos motivos: desde el conflicto constante con Maxi López, hasta las fuertes declaraciones de su padre Andrés en su contra hasta por un noble gesto con una enfermera italiana fan de.</p>', 0, 'Tendencia News'),
(179, 'Una mujer falleció en Vedia por COVID-19', 'Una mujer falleció en Vedia por COVID-19', 'Una mujer, de 86 años, falleció a causa de una insuficiencia respiratoria, en Vedia, partido de Leandro N. Alem. A raíz de su deceso, se activó un protocolo y se le realizó un hisopado, dando como resultado positivo de Covid-19. La persona fallecida se&nbsp;...', '1', '2020-08-20 15:35:03', '2020-08-20 18:35:03', 'una-mujer-fallecio-en-vedia-por-covid-19.jpg', 'una-mujer-fallecio-en-vedia-por-covid-19', 0, NULL, 2, 2, NULL, '<p>Una mujer, de 86 años, falleció a causa de una insuficiencia respiratoria, en Vedia, partido de Leandro N. Alem. A raíz de su deceso, se activó un protocolo y se le realizó un hisopado, dando como resultado positivo de Covid-19. La persona fallecida se&nbsp;...</p><p>Se toma conocimiento de deseso persona sexo femenino de (86), a causa de una insuficiencia respiratoria. Se activa protocolo, se le realiza hisopado.</p><p>La Posta, medio periodístico de Chacabuco, tomó conocimiento del deceso de una persona de 86 años en el hospital de Vedia a causa de una insuficiencia respiratoria. La noticia fue informada primero por medios de la ciudad de Junín. Según pudo&nbsp;...</p><p>La mujer vivía en un geriátrico, sufrió una insuficiencia respiratoria y el test de COVID 19 dio positivo.</p>', 0, 'Tendencia News'),
(180, 'Corte en Ruta 88: Necesitamos una ayuda inmediata del gobierno nacional, provincial y local', 'Corte en Ruta 88: &quot;Necesitamos una ayuda inmediata del gobierno nacional, provincial y local&quot;', 'En ruta 88 y Génova, a metros de una cadena de venta de alimentos, organizaciones sociales llevan adelante un corte para sostener el pedido de &quot;Con hambre no hay cuarentena&quot; que vienen realizando desde hace algunas semanas. El referente del&nbsp;...', '1', '2020-05-07 22:48:06', '2020-05-08 01:48:06', 'corte-en-ruta-88-quotnecesitamos-una-ayuda-inmediata-del-gobierno-nacional-provincial-y-localquot.jpg', 'corte-en-ruta-88-quotnecesitamos-una-ayuda-inmediata-del-gobierno-nacional-provincial-y-localquot', 0, NULL, 2, 0, '0', '<p>En ruta 88 y Génova, a metros de una cadena de venta de alimentos, organizaciones sociales llevan adelante un corte para sostener el pedido de &quot;Con hambre no hay cuarentena&quot; que vienen realizando desde hace algunas semanas. El referente del&nbsp;...</p><p>Bajo la consigna “Con hambre no hay cuarentena”, repiten el reclamo realizado la semana pasada, ahora en la Ruta 88 a la altura de Génova. Corte de organizaciones en la Ruta 88 en reclamo de mayor entrega de alimentos. Tal como viene ocurriendo en&nbsp;...</p><p>Es a la altura de la calle Génova, reclamando la entrega de alimentos y el cobro del IFE. “La realidad es que queremos quedarnos en nuestra casas pero no podemos”, cuestionaron desde el MTR.</p><p>El Intendente dice que está abierto al diálogo, pero hemos querido hacer petitorios para hablar con él y no hemos podido, señalaron desde las organizaciones sociales.</p><p>Una numerosa columna de organizaciones sociales se instaló en ruta 88 y Génova donde mantienen un corte total en la puerta de un reconocido mayorista, y solicitaron la intervención de autoridades.</p>', 0, 'Tendencia News');
